INSERT INTO `monsieurbiz_cms_page_translation` (`id`, `translatable_id`, `title`, `content`, `slug`, `metaTitle`, `metaKeywords`, `metaDescription`, `locale`) VALUES (1,1,'Accessoires d\'Origine','[{\"code\":\"sections.cover\",\"data\":{\"image\":\"/media/rich-editor/x_larg_error404_1_1920x660_crop_center-62987db292586.jpg\",\"alt\":null}},{\"code\":\"sections.section_wysiwyg\",\"data\":{\"title\":\"Votre SEAT ne mérite que le meilleur\",\"wysiwyg\":\"<b>Les Accessoires d’Origine SEAT sont développés pour s’adapter parfaitement à votre véhicule.&nbsp; </b>Il sont soumis à un cahier des charges strict pour vous garantir une sécurité optimale. Eléments de protection ou de personnalisation, solutions de chargement, équipements multimédia, quelques clics suffiront pour trouver votre bonheur dans la vaste gamme des accessoires SEAT.\"}},{\"code\":\"sections.section_text_image\",\"data\":{\"images\":[{\"image\":\"/media/rich-editor/seat_attelage_720x500_ce51400d032b4bc4ac3d30c9a7911b1e-62987e0d0ecbc.jpg\",\"alt\":null}],\"title\":\"Une gamme d\'accessoires pour répondre <b>à tous vos besoins</b>\",\"text\":\"<p>Besoin de personnaliser votre véhicule à votre image ou de l\'équiper d\'accessoires parfaitement adaptés à votre quotidien ? Découvrez l\'ensemble de notre gamme d\'accessoires qui rendront votre SEAT unique et vos voyages toujours plus agréables.</p><p>Que ce soit pour gagner de l\'espace pour transporter vos bagages, protéger votre véhicule contre les défis du quotidien ou rouler en toute sérénité lors de vos voyages en famille, Volkswagen met à votre disposition une gamme d\'accessoires complète pour les modèles Ibiza, Arona, Leon, Leon Sportstourer, Ateca, Tarraco.<br></p>\",\"cta_link\":null,\"cta_label\":null,\"mod\":\"image-left\"}},{\"code\":\"sections.section_text_image\",\"data\":{\"images\":[{\"image\":\"/media/rich-editor/seat_barres_720x500_8580256bd48349a4852ce1fd6209dbb7-62987e8d6f53a.jpg\",\"alt\":null}],\"title\":\"Les engagements SEAT <b>au service de vos exigences</b>\",\"text\":\"<p>Attelage, barre de toit, tapis de protection, coffres de toit, support de téléphone portable ou système de navigation… SEAT a mis tout son savoir-faire pour concevoir des accessoires certifiés pour votre véhicule et ainsi bénéficier de produits faciles à installer et à utiliser au quotidien.</p><p><b>Commander vos accessoires en ligne sur notre site, c\'est l\'assurance de bénéficier d\'un niveau de qualité et de sécurité optimal.</b></p>\",\"cta_link\":null,\"cta_label\":null,\"mod\":\"image-right\"}},{\"code\":\"sections.section_text_image\",\"data\":{\"images\":[{\"image\":\"/media/rich-editor/coffre_toit_371x250_e37954e3b9ef460f8d67e8fdf7923b32-62987ee5f326c.jpg\",\"alt\":null},{\"image\":\"/media/rich-editor/porte_velo_371x250_8871d61417424a1e842781e4e8ae8ba6-62987ee5f37f8.jpg\",\"alt\":null},{\"image\":\"/media/rich-editor/porte_ski_371x250_0826a870d5764749ba76d8d3e6d13db3-62987ee5f3e01.jpg\",\"alt\":null}],\"title\":\"Des accessoires conçus<br/><b>pour votre SEAT</b>\",\"text\":null,\"cta_link\":null,\"cta_label\":null,\"mod\":\"image-left\"}}]','accessoires-d-origine','Accessoires d\'Origine',NULL,'Votre SEAT ne mérite que le meilleur Les accessoires d’Origine SEAT sont développés pour s’adapter parfaitement à votre véhicule. Il sont soumis à un cahier des charges strict pour vous garantir une sécurité optimale. Eléments de protection ou de personnalisation, solutions de chargement, équipements multimédia, quelqu','fr_FR'),(2,2,'Condition Générales d\'Utilisation','[{\"code\":\"sections.section_wysiwyg\", \"data\":{\"title\":null,\"wysiwyg\":\"<div class=\\\"page-title-wrapper\\\">\\r\\n<h1><b>CONDITIONS G\\u00C9N\\u00C9RALES D\\u2019UTILISATION PLATEFORME DE PR\\u00C9SENTATION DES ACCESSOIRES SKODA<\\/b><\\/h1>\\r\\n<h1><br \\/><br \\/><\\/h1>\\r\\n<p><i><span style=\\\"font-weight: 400;\\\">Derni\\u00E8re mise \\u00E0 jour le :<\\/span><\\/i> <b><i>17\\/05\\/2018<\\/i><\\/b><\\/p>\\r\\n<p><b>PREAMBULE<\\/b><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Skoda France division de Volkswagen Group France, Soci\\u00E9t\\u00E9 anonyme au capital de 198 502 510 euros, 11 avenue de Boursonne, 02600 Villers-Cotter\\u00EAts Cedex France, immatricul\\u00E9e au RCS de Soissons sous le num\\u00E9ro 832 277 370 (ci-apr\\u00E8s \\u00AB <\\/span><a href=\\\"http:\\/\\/www.skoda.fr\\/informations\\/mentions-legales\\\"><b>Skoda France <\\/b><\\/a><span style=\\\"font-weight: 400;\\\">\\u00BB), propose de multiples accessoires destin\\u00E9s aux v\\u00E9hicules qu\\u2019elle commercialise par l\\u2019interm\\u00E9diaire son r\\u00E9seau de distribution agr\\u00E9\\u00E9 et fournit, via une plateforme d\\u00E9di\\u00E9e et accessible en ligne par le r\\u00E9seau Internet \\u00E0 l\\u2019adresse suivante : http:\\/\\/accessoires.skoda.fr\\u00A0 (ci-apr\\u00E8s la \\u00AB<\\/span><b> Plateforme<\\/b><span style=\\\"font-weight: 400;\\\"> \\u00BB), la possibilit\\u00E9 pour le Client de consulter l\\u2019ensemble des accessoires SKODA et d\\u2019\\u00EAtre mis en relation avec un distributeur agr\\u00E9\\u00E9 Skoda France pour \\u00E9ventuellement acqu\\u00E9rir un ou plusieurs accessoires pr\\u00E9sent\\u00E9s sur la Plateforme.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol>\\r\\n<li><b> ACCEPTATION DES CGU<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Par l\\u2019utilisation de la Plateforme, l\\u2019Utilisateur reconna\\u00EEt avoir pris connaissance des pr\\u00E9sentes CGU et les accepter sans r\\u00E9serve, ainsi que tous documents s\\u2019y r\\u00E9f\\u00E9rant tels que <\\/span><a href=\\\"http:\\/\\/www.skoda.fr\\/informations\\/mentions-legales\\\"><span style=\\\"font-weight: 400;\\\">la politique de protection de la vie priv\\u00E9e et des donn\\u00E9es personnelles<\\/span><\\/a><span style=\\\"font-weight: 400;\\\">\\u00A0 et <\\/span><a href=\\\"http:\\/\\/www.skoda.fr\\/informations\\/cookies\\\"><span style=\\\"font-weight: 400;\\\">la politique d\\u2019utilisation des cookies.<\\/span><\\/a><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"2\\\">\\r\\n<li><b> D\\u00C9FINITIONS<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Les termes d\\u00E9finis ci-dessous commen\\u00E7ant par des majuscules et utilis\\u00E9s au singulier ou au pluriel auront la signification suivante :<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00AB <\\/span><b>Donn\\u00E9es<\\/b><span style=\\\"font-weight: 400;\\\"> \\u00BB : d\\u00E9signent les informations concernant l\\u2019Utilisateur, y compris ses Donn\\u00E9es \\u00E0 caract\\u00E8re personnel, fournies directement ou indirectement par cet Utilisateur, lorsqu\\u2019il utilise la Plateforme. L\\u2019Utilisateur garantit \\u00E0 Skoda France fournir des informations exactes et \\u00E0 jour en particulier son adresse mail.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00AB <\\/span><b>Donn\\u00E9es \\u00E0 Caract\\u00E8re Personnel<\\/b><span style=\\\"font-weight: 400;\\\"> \\u00BB d\\u00E9signent au regard de l\'article 2 de la Loi Informatique et Libert\\u00E9s \\u00AB<\\/span><i><span style=\\\"font-weight: 400;\\\"> toute information relative \\u00E0 une personne physique identifi\\u00E9e ou qui peut \\u00EAtre identifi\\u00E9e, directement ou indirectement, par r\\u00E9f\\u00E9rence \\u00E0 un num\\u00E9ro d\'identification ou \\u00E0 un ou plusieurs \\u00E9l\\u00E9ments qui lui sont propres<\\/span><\\/i><span style=\\\"font-weight: 400;\\\">\\u00BB et l\\u2019article 4 du R\\u00E8glement Europ\\u00E9en sur la protection des donn\\u00E9es \\u00E0 caract\\u00E8re personnel \\u00AB <\\/span><i><span style=\\\"font-weight: 400;\\\">toute information se rapportant \\u00E0 une personne physique identifi\\u00E9e ou identifiable (ci-apr\\u00E8s d\\u00E9nomm\\u00E9e \\u00ABpersonne concern\\u00E9e\\u00BB); est r\\u00E9put\\u00E9e \\u00EAtre une \\u00ABpersonne physique identifiable\\u00BB une personne physique qui peut \\u00EAtre identifi\\u00E9e, directement ou indirectement, notamment par r\\u00E9f\\u00E9rence \\u00E0 un identifiant, tel qu\'un nom, un num\\u00E9ro d\'identification, des donn\\u00E9es de localisation, un identifiant en ligne, ou \\u00E0 un ou plusieurs \\u00E9l\\u00E9ments sp\\u00E9cifiques propres \\u00E0 son identit\\u00E9 physique, physiologique, g\\u00E9n\\u00E9tique, psychique, \\u00E9conomique, culturelle ou sociale \\u00BB. <\\/span><\\/i><span style=\\\"font-weight: 400;\\\">Sont notamment comprises dans les Donn\\u00E9es \\u00E0 Caract\\u00E8re personnel, les donn\\u00E9es relatives aux Utilisateurs de la Plateforme permettant leur identification<\\/span><i><span style=\\\"font-weight: 400;\\\">.<\\/span><\\/i><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0\\u00AB <\\/span><b>Services<\\/b><span style=\\\"font-weight: 400;\\\"> \\u00BB : d\\u00E9signent l\\u2019ensemble des actions propos\\u00E9es par la Plateforme qui sont accessibles aux Utilisateurs.\\u00A0<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00AB <\\/span><b>Utilisateur<\\/b><span style=\\\"font-weight: 400;\\\"> \\u00BB : d\\u00E9signe toute personne physique acc\\u00E9dant \\u00E0 la Plateforme, pour son compte ou pour le compte d\\u2019une personne morale, qu\\u2019elle soit simple visiteur ou client.<\\/span><\\/p>\\r\\n<h1><\\/h1>\\r\\n<ol start=\\\"3\\\">\\r\\n<li><b> OBJET<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0Les pr\\u00E9sentes Conditions G\\u00E9n\\u00E9rales d\\u2019Utilisation, ainsi que les documents auxquels elles font r\\u00E9f\\u00E9rences, ont pour objet de d\\u00E9finir les conditions, droits, obligations, responsabilit\\u00E9s et limites applicables \\u00E0 toute utilisation de la Plateforme, par tout Utilisateur (ci-avant et ci-apr\\u00E8s les \\u00AB <\\/span><b>CGU<\\/b><span style=\\\"font-weight: 400;\\\"> \\u00BB).\\u00A0<\\/span><\\/p>\\r\\n<h1><\\/h1>\\r\\n<ol start=\\\"4\\\">\\r\\n<li><b> DESCRIPTION DES SERVICES<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0La Plateforme permet aux Utilisateurs de consulter en ligne l\\u2019ensemble des accessoires commercialis\\u00E9s par SKODA, d\\u2019en faire une s\\u00E9lection, que l\\u2019Utilisateur peut ensuite recevoir \\u00E0 l\\u2019adresse mail qu\\u2019il renseigne, et d\\u2019\\u00EAtre mis en relation avec un distributeur agr\\u00E9\\u00E9 SKODA pour r\\u00E9aliser l\\u2019achat d\\u2019un ou plusieurs accessoires.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"5\\\">\\r\\n<li><b> DISPONIBILIT\\u00C9 DE LA PLATEFORME<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">L\\u2019Utilisateur reconna\\u00EEt et accepte qu\\u2019en l\\u2019\\u00E9tat actuel de la technique, Skoda France ne puisse pas garantir une disponibilit\\u00E9 continue de la Plateforme ni des Services.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Skoda France fera ses meilleurs efforts afin de rendre la Plateforme disponible de mani\\u00E8re continue, sauf en cas d\\u2019op\\u00E9rations de maintenance, de mise \\u00E0 jour ou par suite d\\u2019\\u00E9v\\u00E8nements \\u00E9chappant \\u00E0 son contr\\u00F4le pouvant cr\\u00E9er des interruptions de services, en tout ou partie, des perturbations plus ou moins importantes. Dans de tels cas, Skoda France prendra les mesures raisonnables dont elle dispose pour traiter ces interruptions ou perturbations.\\u00A0<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"6\\\">\\r\\n<li><b> COMPORTEMENT<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0Chaque Utilisateur se doit d\\u2019utiliser la Plateforme de mani\\u00E8re responsable, avec respect et courtoisie \\u00E0 l\\u2019\\u00E9gard des droits de Skoda France et de tout tiers.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">En acc\\u00E9dant \\u00E0 la Plateforme, l\\u2019Utilisateur s\\u2019engage et garantit notamment :<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">disposer des qualit\\u00E9s et comp\\u00E9tences requises pour utiliser la Plateforme ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">avoir un comportement conforme \\u00E0 l\\u2019ensemble des dispositions des pr\\u00E9sentes CGU et \\u00E0 respecter ces CGU ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">communiquer des donn\\u00E9es exactes, exhaustives et \\u00E0 jour ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">respecter les droits de propri\\u00E9t\\u00E9 intellectuelle de Skoda France et des \\u00E9ventuels tiers ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">respecter toutes les lois en vigueur y compris celles du pays d\\u2019o\\u00F9 il acc\\u00E8de \\u00E0 la Plateforme ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">\\u00E0 utiliser la Plateforme dans la limite de ses fonctionnalit\\u00E9s et de sa destination.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">En outre, l\\u2019Utilisateur s\\u2019interdit, notamment :<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">d\\u2019utiliser les fonctionnalit\\u00E9s de la Plateforme \\u00E0 des fins non pr\\u00E9vues dans les CGU ou contraire \\u00E0 la destination de la Plateforme et\\/ou qui porteraient atteinte aux droits de Skoda France, d\\u2019un de ses partenaires ou de tout tiers ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">d\\u2019utiliser une fausse identit\\u00E9 ou de tromper autrement qui que ce soit ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">de communiquer \\u00E0 Skoda France des coordonn\\u00E9es et informations fausses, usurp\\u00E9es ou erron\\u00E9es ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">de t\\u00E9l\\u00E9charger vers la Plateforme, afficher, rendre accessible ou transmettre par tout moyen et notamment par courrier \\u00E9lectronique :<\\/span><\\/p>\\r\\n<ul>\\r\\n<li style=\\\"font-weight: 400;\\\"><span style=\\\"font-weight: 400;\\\">des contenus qu\\u2019il n\\u2019aurait pas le droit de t\\u00E9l\\u00E9charger,<\\/span><\\/li>\\r\\n<li style=\\\"font-weight: 400;\\\"><span style=\\\"font-weight: 400;\\\">un contenu ill\\u00E9gal, pr\\u00E9judiciable, mena\\u00E7ant, injurieux, harcelant, d\\u00E9lictuel, diffamatoire, vulgaire, obsc\\u00E8ne, contraire aux bonnes m\\u0153urs, portant atteinte \\u00E0 la vie priv\\u00E9e d\'une personne, odieux ou d\\u00E9sobligeant ou choquant d\'un point de vue notamment racial, ethnique ou autre,<\\/span><\\/li>\\r\\n<li style=\\\"font-weight: 400;\\\"><span style=\\\"font-weight: 400;\\\">tout \\u00E9l\\u00E9ment contenant des virus logiciels ou autres codes, fichiers ou programmes informatiques con\\u00E7us pour interrompre, d\\u00E9truire ou limiter la fonctionnalit\\u00E9 de tout logiciel ou mat\\u00E9riel informatique ou de tout \\u00E9quipement de t\\u00E9l\\u00E9communication ;<\\/span><\\/li>\\r\\n<\\/ul>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">perturber ou interrompre le fonctionnement de la Plateforme ou des serveurs ou r\\u00E9seaux connect\\u00E9s \\u00E0 la Plateforme, ou enfreindre les exigences, proc\\u00E9dures, r\\u00E8gles ou r\\u00E9glementations ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">acc\\u00E9der \\u00E0 des Donn\\u00E9es \\u00E0 caract\\u00E8re personnel qui ne lui sont pas destin\\u00E9es ou entrer dans un serveur ou une partie de la Plateforme auquel l\\u2019Utilisateur n\\u2019est pas autoris\\u00E9 \\u00E0 avoir acc\\u00E8s ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">tenter de sonder, de scruter ou de tester la vuln\\u00E9rabilit\\u00E9 d\'un syst\\u00E8me et notamment de la Plateforme, ou encore d\\u2019enfreindre les mesures de s\\u00E9curit\\u00E9 ou d\'authentification sans en avoir re\\u00E7u l\\u2019autorisation ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">usurper ou tenter d\\u2019usurper l\\u2019identit\\u00E9 d\\u2019un autre Utilisateur ou de tout tiers ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">nuire \\u00E0 une personne physique ou morale par le biais de la Plateforme ;<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">-\\u00A0 \\u00A0 \\u00A0 <\\/span> <span style=\\\"font-weight: 400;\\\">porter atteinte \\u00E0 la r\\u00E9putation de Skoda France, de la Plateforme, d\\u2019un ou plusieurs autres Utilisateurs ou de tout tiers.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">L\\u2019Utilisateur s\\u2019engage \\u00E9galement \\u00E0 ne pas divulguer des informations personnelles, professionnelles ou confidentielles diffus\\u00E9es au travers de la Plateforme ou dont il aurait connaissance de par l\\u2019utilisation de la Plateforme ou provenant de tiers. A fortiori, l\\u2019Utilisateur s\\u2019abstient de tout traitement de Donn\\u00E9es \\u00E0 caract\\u00E8re personnel obtenues sur la Plateforme ou par son biais et notamment de toute collecte ou de toute utilisation non autoris\\u00E9e ou d\\u00E9tourn\\u00E9e et de tout acte susceptible de porter atteinte \\u00E0 la vie priv\\u00E9e et aux Donn\\u00E9es \\u00E0 caract\\u00E8re personnel ou \\u00E0 la r\\u00E9putation d\\u2019un ou plusieurs autre(s) Utilisateur(s) ou toute autre personne physique ou morale.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Les Utilisateurs sont invit\\u00E9s \\u00E0 signaler \\u00E0 Skoda France toute utilisation frauduleuse de la Plateforme dont ils auraient connaissance et notamment tout contenu qui contreviendrait aux interdictions \\u00E9nonc\\u00E9es dans les CGU ou plus g\\u00E9n\\u00E9ralement aux lois et dispositions r\\u00E8glementaires en vigueur.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"7\\\">\\r\\n<li><b> DROITS DE PROPRI\\u00C9T\\u00C9 INTELLECTUELLE<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">La Plateforme, en ce compris l\\u2019ensemble des \\u00E9l\\u00E9ments qui la compose, notamment les graphismes, images, photographies, animations, clips, textes, logos, logiciels et interfaces (ci-apr\\u00E8s le \\u00AB <\\/span><b>Contenu<\\/b><span style=\\\"font-weight: 400;\\\"> \\u00BB) sont prot\\u00E9g\\u00E9s par des droits de propri\\u00E9t\\u00E9 intellectuelle et propri\\u00E9t\\u00E9 exclusive de Skoda France, \\u00E0 l\\u2019exception des marques, logos, images, photos et signes distinctifs appartenant \\u00E0 des soci\\u00E9t\\u00E9s tierces ou \\u00E0 des tiers.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Toutes utilisations, y compris toute reproduction, distribution, modification, retransmission ou publication du Contenu sont strictement interdites sans accord pr\\u00E9alable \\u00E9crit de Skoda France.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Il est en particulier interdit de (i) copier, modifier, cr\\u00E9er une \\u0153uvre d\\u00E9riv\\u00E9e, assembler, d\\u00E9compiler (\\u00E0 l\'exception des cas pr\\u00E9vus par la loi), vendre, attribuer, sous-licencier ou transf\\u00E9rer de quelque mani\\u00E8re que ce soit tout droit aff\\u00E9rant au Contenu et de (ii) modifier tout ou partie du Contenu en vue notamment d\'obtenir un acc\\u00E8s non autoris\\u00E9 \\u00E0 la Plateforme.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">En cons\\u00E9quence, toute reproduction et\\/ou repr\\u00E9sentation, totale ou partielle, du Contenu, sans l\\u2019autorisation pr\\u00E9alable et \\u00E9crite de Skoda France, sont interdites et constitueraient une contrefa\\u00E7on sanctionn\\u00E9e notamment par les dispositions du Code de la propri\\u00E9t\\u00E9 intellectuelle.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Skoda France, ou tout autre titulaire de ces droits, pourra mettre en \\u0153uvre toute mesure ou action, y compris judiciaire, pour faire cesser une atteinte \\u00E0 ses droits, en particulier de propri\\u00E9t\\u00E9 intellectuelle et se r\\u00E9serve le droit de demander des dommages et int\\u00E9r\\u00EAts en cas d\\u2019une telle atteinte.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"8\\\">\\r\\n<li><b> COOKIES<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Les cookies sont des donn\\u00E9es stock\\u00E9es dans l\\u2019\\u00E9quipement terminal d\\u2019un internaute et utilis\\u00E9es par la Plateforme pour envoyer des informations au navigateur de l\\u2019internaute, permettant \\u00E0 ce navigateur de renvoyer des informations au site d\\u2019origine.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Skoda France utilise des cookies ; <\\/span><a href=\\\"http:\\/\\/www.skoda.fr\\/informations\\/cookies\\\"><span style=\\\"font-weight: 400;\\\">la politique d\\u2019utilisation des cookies<\\/span><\\/a><span style=\\\"font-weight: 400;\\\"> informe les internautes sur cette utilisation.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">L\\u2019Utilisateur dispose d\\u2019un droit d\\u2019acc\\u00E8s, de rectification et d\'opposition sur ses Donn\\u00E9es \\u00E0 caract\\u00E8re personnel communiqu\\u00E9es par le biais des cookies.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Le param\\u00E9trage du logiciel de navigation permet d\\u2019informer de la pr\\u00E9sence de cookies et de la refuser.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Cependant, certaines fonctionnalit\\u00E9s de la Plateforme ne pourront plus \\u00EAtre utilis\\u00E9es si l\\u2019Utilisateur refuse cette installation des cookies.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"9\\\">\\r\\n<li><b> LIENS HYPERTEXTES<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Toute cr\\u00E9ation de liens vers la Plateforme, tout encadrement (framing) de la Plateforme et plus g\\u00E9n\\u00E9ralement toute utilisation d\'un \\u00E9l\\u00E9ment composant la Plateforme sont soumis \\u00E0 l\'autorisation pr\\u00E9alable et \\u00E9crite de Skoda France, qui pourra \\u00EAtre r\\u00E9voqu\\u00E9e \\u00E0 tout moment \\u00E0 sa seule discr\\u00E9tion.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Skoda France n\\u2019est aucunement responsable du contenu des sites vers lesquels les liens hypertextes redirigent l\\u2019Utilisateur.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"10\\\">\\r\\n<li><b> PROTECTION DE VOS DONNEES A CARACTERE PERSONNEL<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Skoda France collecte des Donn\\u00E9es \\u00E0 caract\\u00E8re personnel des Utilisateurs, principalement l\\u2019adresse mail.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Skoda France s\\u2019engage \\u00E0 faire tous ses efforts pour que les Donn\\u00E9es des Utilisateurs, et en particulier les Donn\\u00E9es \\u00E0 caract\\u00E8re personnel, restent confidentielles. Skoda France s\\u2019autorise \\u00E0 les communiquer uniquement \\u00E0 ses partenaires et sous-traitants dans le respect de la r\\u00E8glementation applicable. Skoda France leur demande \\u00E0 ce titre de conserver confidentielles ces Donn\\u00E9es.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Pour plus d\\u2019informations concernant la protection de ses Donn\\u00E9es \\u00E0 caract\\u00E8re personnel, l\\u2019Utilisateur est invit\\u00E9 \\u00E0 consulter <\\/span><a href=\\\"http:\\/\\/www.skoda.fr\\/informations\\/mentions-legales\\\"><span style=\\\"font-weight: 400;\\\">la politique de protection de la vie priv\\u00E9e et des donn\\u00E9es personnelles<\\/span><\\/a><span style=\\\"font-weight: 400;\\\"> qui fait partie int\\u00E9grante des pr\\u00E9sentes CGU.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"11\\\">\\r\\n<li><b> RESPONSABILIT\\u00C9<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">L\\u2019Utilisateur reconna\\u00EEt utiliser la Plateforme sous sa seule responsabilit\\u00E9. Il appartient notamment \\u00E0 l\\u2019Utilisateur de se pr\\u00E9munir contre les dangers de l\\u2019Internet et de prendre toutes les mesures n\\u00E9cessaires afin de prot\\u00E9ger ses propres donn\\u00E9es (en ce y compris ses Donn\\u00E9es \\u00E0 caract\\u00E8re personnel) et\\/ou logiciels de la contamination par d\'\\u00E9ventuels virus qui\\u00A0<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">pourraient affecter son ordinateur ou tout autre mat\\u00E9riel informatique qu\\u2019il utilise ou qui est sous sa garde.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">L\\u2019Utilisateur est seul responsable des moyens d\\u2019acc\\u00E8s \\u00E0 Internet et \\u00E0 la Plateforme.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">A l\\u2019exclusion des Donn\\u00E9es, Skoda France essaye de s\\u2019assurer au mieux de l\\u2019exactitude des informations accessibles sur la Plateforme, mais ne garantit pas que les informations fournies par tout tiers soient exactes, compl\\u00E8tes ou \\u00E0 jour.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">En outre, Skoda France d\\u00E9cline toute responsabilit\\u00E9 en cas d\'interruption de la Plateforme, de survenance de dysfonctionnement ou de tout dommage r\\u00E9sultant d\\u2019acte frauduleux de tiers ou d\\u2019Utilisateur(s).<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Par ailleurs, en aucun cas Skoda France ne peut \\u00EAtre tenue pour responsable d\'un quelconque dommage, quelles qu\'en soient la cause, origine, nature et cons\\u00E9quence, d\\u00E9coulant notamment de l\\u2019utilisation non conforme des pr\\u00E9sentes CGU par l\\u2019Utilisateur et de la consultation ou de l\'utilisation de la Plateforme par un tiers.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">LA RESPONSABILITE DE SKODA FRANCE NE POURRA ETRE ENGAGEE POUR UNE CAUSE DONT LE FAIT GENERATEUR A POUR ORIGINE UN CAS DE FORCE MAJEURE, Y COMPRIS SI UN TEL CAS DE FORCE MAJEURE TOUCHE UN DE SES SOUS TRAITANTS, AINSI QUE TOUT EVENEMENT HORS DE SON CONTROLE EXCLUSIF.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">De plus, Skoda France informe l\\u2019Utilisateur qu\\u2019il se r\\u00E9serve le droit, \\u00E0 tout moment et pour quelque raison que ce soit, de mettre en \\u0153uvre tout moyen permettant de suspendre ou supprimer, et ce, sans pr\\u00E9avis, l\\u2019acc\\u00E8s \\u00E0 tout ou partie de la Plateforme et, notamment, pour toute conduite, constat\\u00E9e ou pr\\u00E9sum\\u00E9e, comme \\u00E9tant en violation de tout ou partie des CGU (en ce y compris la politique de protection de la vie priv\\u00E9e et des donn\\u00E9es personnelles) explicitement ou implicitement, sans pr\\u00E9judice de tout dommage et int\\u00E9r\\u00EAt que Skoda France se r\\u00E9serve le droit de r\\u00E9clamer \\u00E0 l\\u2019Utilisateur en r\\u00E9paration du pr\\u00E9judice subi.<\\/span><\\/p>\\r\\n<h1><\\/h1>\\r\\n<ol start=\\\"12\\\">\\r\\n<li><b> MODIFICATION DES CGU<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Les CGU sont susceptibles de faire l\\u2019objet de mises \\u00E0 jour de la part de Skoda France. Les CGU pr\\u00E9c\\u00E9dentes sont alors r\\u00E9sili\\u00E9es de plein droit et remplac\\u00E9es par la nouvelle version qui est imm\\u00E9diatement opposable \\u00E0 l\\u2019Utilisateur et mentionnant la date de la derni\\u00E8re mise \\u00E0 jour indiqu\\u00E9e en haut des pr\\u00E9sentes CGU. Pour \\u00EAtre inform\\u00E9 de ces \\u00E9ventuelles modifications et mises \\u00E0 jour, il est recommand\\u00E9 \\u00E0 l\\u2019Utilisateur de consulter les CGU r\\u00E9guli\\u00E8rement.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"13\\\">\\r\\n<li><b> SURVIVANCE<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Les stipulations des CGU qui par leur nature ou leur r\\u00E9daction ont vocation \\u00E0 continuer \\u00E0 s\\u2019appliquer apr\\u00E8s la cessation de l\\u2019utilisation de la Plateforme pour quelque cause que ce soit, ainsi que les stipulations des articles 11 \\u00AB Responsabilit\\u00E9 \\u00BB, 10 \\u00AB Protection de vos donn\\u00E9es \\u00E0 caract\\u00E8re personnel \\u00BB et 7 \\u00AB Droits propri\\u00E9t\\u00E9 intellectuelle \\u00BB resteront en vigueur pour la dur\\u00E9e n\\u00E9cessaire \\u00E0 l\\u2019ex\\u00E9cution de leur objet.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"14\\\">\\r\\n<li><b> NULLIT\\u00C9 \\u2013 TITRE<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Si une ou plusieurs stipulations des CGU sont tenues pour non valides ou d\\u00E9clar\\u00E9es telles en application d\'une loi, d\'un r\\u00E8glement ou \\u00E0 la suite d\'une d\\u00E9cision d\\u00E9finitive d\'une juridiction comp\\u00E9tente, les autres stipulations garderont toute leur force et port\\u00E9e.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">En cas de difficult\\u00E9s d\\u2019interpr\\u00E9tation entre l\\u2019un quelconque des titres figurant en t\\u00EAte des clauses et l\\u2019une quelconque des clauses, les titres seront \\u00E9cart\\u00E9s et le contenu de la clause concern\\u00E9e pr\\u00E9vaudra.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">\\u00A0<\\/span><\\/p>\\r\\n<ol start=\\\"15\\\">\\r\\n<li><b> DROIT APPLICABLE - ATTRIBUTION DE COMPETENCE<\\/b><\\/li>\\r\\n<\\/ol>\\r\\n<p><span style=\\\"font-weight: 400;\\\">Les pr\\u00E9sentes CGU et les documents auxquels elles font r\\u00E9f\\u00E9rence sont r\\u00E9gis par le droit fran\\u00E7ais. En cas de litige, l\\u2019Utilisateur s\\u2019engage \\u00E0 contacter en priorit\\u00E9 Skoda France afin de tenter de r\\u00E9soudre \\u00E0 l\\u2019amiable tout diff\\u00E9rend susceptible d\\u2019intervenir concernant les CGU.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-weight: 400;\\\">A D\\u00C9FAUT D\\u2019UN ACCORD AMIABLE DANS UN D\\u00C9LAI DE 30 JOURS SUIVANT LA LETTRE INITIANT UNE TELLE D\\u00C9MARCHE DE R\\u00C8GLEMENT AMIABLE, TOUT LITIGE RELATIF A L\'EXISTENCE, L\'INTERPRETATION, L\'EXECUTION OU LA RUPTURE DES CGU, MEME EN CAS DE PLURALITE DE DEFENDEURS, SERA SOUMIS (SAUF COMP\\u00C9TENCE EXCLUSIVE RECONNUE \\u00C0 UNE JURIDICTION DIFF\\u00C9RENTE, NOTAMMENT LE TRIBUNAL DE GRANDE INSTANCE DE ParIS EN MATI\\u00C8RE DE DROIT DE LA PROPRI\\u00C9T\\u00C9 INTELLECTUELLE) : (i) EN CAS DE LITIGE AVEC UN COMMER\\u00C7ANT, AU TRIBUNAL DE COMMERCE DE PARIS ; (ii) EN CAS DE LITIGE AVEC UN NON COMMER\\u00C7ANT, AU TRIBUNAL FRAN\\u00C7AIS TERRITORIALEMENT COMP\\u00C9TENT.<\\/span><\\/p>\\r\\n<h1><br \\/><br \\/><\\/h1>\\r\\n<\\/div>\\r\\n<div class=\\\"columns\\\">\\r\\n<div class=\\\"column main\\\">\\r\\n<div><\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\"}}]','condition-generales-d-utilisation','Condition Générales d\'Utilisation',NULL,NULL,'fr_FR'),(3,3,'Condition Générales d\'Utilisation','[{\"code\":\"sections.section_wysiwyg\",\"data\":{\"title\":null,\"wysiwyg\":\"<h2><b>CONDITIONS GÉNÉRALES D’UTILISATION PLATEFORME DE PRÉSENTATION DES ACCESSOIRES SKODA</b></h2><p>Dernière mise à jour le : <b>17/05/2018</b></p><h3>PREAMBULE</h3><p>Skoda France division de Volkswagen Group France, Société anonyme au capital de 198 502 510 euros, 11 avenue de Boursonne, 02600 Villers-Cotterêts Cedex France, immatriculée au RCS de Soissons sous le numéro 832 277 370 (ci-après « <a href=\\\"https://www.skoda.fr/informations/mentions-legales\\\">Skoda France</a> »), propose de multiples accessoires destinés aux véhicules qu’elle commercialise par l’intermédiaire son réseau de distribution agréé et fournit, via une plateforme dédiée et accessible en ligne par le réseau Internet à l’adresse suivante : http://accessoires.skoda.fr  (ci-après la « <b>Plateforme</b> »), la possibilité pour le Client de consulter l’ensemble des accessoires SKODA et d’être mis en relation avec un distributeur agréé Skoda France pour éventuellement acquérir un ou plusieurs accessoires présentés sur la Plateforme.</p><p><br></p><h3>1. ACCEPTATION DES CGU</h3><p>Par l’utilisation de la Plateforme, l’Utilisateur reconnaît avoir pris connaissance des présentes CGU et les accepter sans réserve, ainsi que tous documents s’y référant tels que la politique de protection de la vie privée et des données personnelles  et la politique d’utilisation des cookies.</p><p><br></p><h3>2. DÉFINITIONS</h3><p>Les termes définis ci-dessous commençant par des majuscules et utilisés au singulier ou au pluriel auront la signification suivante :</p><p><b>« Données » </b>: désignent les informations concernant l’Utilisateur, y compris ses Données à caractère personnel, fournies directement ou indirectement par cet Utilisateur, lorsqu’il utilise la Plateforme. L’Utilisateur garantit à Skoda France fournir des informations exactes et à jour en particulier son adresse mail.</p><p><b>« Données à Caractère Personnel »</b> désignent au regard de l\'article 2 de la Loi Informatique et Libertés « toute information relative à une personne physique identifiée ou qui peut être identifiée, directement ou indirectement, par référence à un numéro d\'identification ou à un ou plusieurs éléments qui lui sont propres» et l’article 4 du Règlement Européen sur la protection des données à caractère personnel « toute information se rapportant à une personne physique identifiée ou identifiable (ci-après dénommée «personne concernée»); est réputée être une «personne physique identifiable» une personne physique qui peut être identifiée, directement ou indirectement, notamment par référence à un identifiant, tel qu\'un nom, un numéro d\'identification, des données de localisation, un identifiant en ligne, ou à un ou plusieurs éléments spécifiques propres à son identité physique, physiologique, génétique, psychique, économique, culturelle ou sociale ». Sont notamment comprises dans les Données à Caractère personnel, les données relatives aux Utilisateurs de la Plateforme permettant leur identification.</p><p><b>&nbsp;« Services »</b> : désignent l’ensemble des actions proposées par la Plateforme qui sont accessibles aux Utilisateurs.&nbsp;</p><p><b>« Utilisateur » </b>: désigne toute personne physique accédant à la Plateforme, pour son compte ou pour le compte d’une personne morale, qu’elle soit simple visiteur ou client.</p><p><br></p><h3>3. OBJET</h3><p>&nbsp;Les présentes Conditions Générales d’Utilisation, ainsi que les documents auxquels elles font références, ont pour objet de définir les conditions, droits, obligations, responsabilités et limites applicables à toute utilisation de la Plateforme, par tout Utilisateur (ci-avant et ci-après les « <b>CGU</b> »).&nbsp;</p><p><br></p><h3>4. DESCRIPTION DES SERVICES</h3><p>&nbsp;La Plateforme permet aux Utilisateurs de consulter en ligne l’ensemble des accessoires commercialisés par SKODA, d’en faire une sélection, que l’Utilisateur peut ensuite recevoir à l’adresse mail qu’il renseigne, et d’être mis en relation avec un distributeur agréé SKODA pour réaliser l’achat d’un ou plusieurs accessoires.</p><p><br></p><h3>5. DISPONIBILITÉ DE LA PLATEFORME</h3><p>L’Utilisateur reconnaît et accepte qu’en l’état actuel de la technique, Skoda France ne puisse pas garantir une disponibilité continue de la Plateforme ni des Services.</p><p>Skoda France fera ses meilleurs efforts afin de rendre la Plateforme disponible de manière continue, sauf en cas d’opérations de maintenance, de mise à jour ou par suite d’évènements échappant à son contrôle pouvant créer des interruptions de services, en tout ou partie, des perturbations plus ou moins importantes. Dans de tels cas, Skoda France prendra les mesures raisonnables dont elle dispose pour traiter ces interruptions ou perturbations.&nbsp;</p><p><br></p><h3>6. COMPORTEMENT</h3><p>&nbsp;Chaque Utilisateur se doit d’utiliser la Plateforme de manière responsable, avec respect et courtoisie à l’égard des droits de Skoda France et de tout tiers.</p><p>En accédant à la Plateforme, l’Utilisateur s’engage et garantit notamment :</p><p>-      disposer des qualités et compétences requises pour utiliser la Plateforme ;</p><p>-      avoir un comportement conforme à l’ensemble des dispositions des présentes CGU et à respecter ces CGU ;</p><p>-      communiquer des données exactes, exhaustives et à jour ;</p><p>-      respecter les droits de propriété intellectuelle de Skoda France et des éventuels tiers ;</p><p>-      respecter toutes les lois en vigueur y compris celles du pays d’où il accède à la Plateforme ;</p><p>-      à utiliser la Plateforme dans la limite de ses fonctionnalités et de sa destination.</p><p><br></p><p>En outre, l’Utilisateur s’interdit, notamment :</p><p>-      d’utiliser les fonctionnalités de la Plateforme à des fins non prévues dans les CGU ou contraire à la destination de la Plateforme et/ou qui porteraient atteinte aux droits de Skoda France, d’un de ses partenaires ou de tout tiers ;</p><p>-      d’utiliser une fausse identité ou de tromper autrement qui que ce soit ;</p><p>-      de communiquer à Skoda France des coordonnées et informations fausses, usurpées ou erronées ;</p><p>-      de télécharger vers la Plateforme, afficher, rendre accessible ou transmettre par tout moyen et notamment par courrier électronique :</p><p><ul><li>des contenus qu’il n’aurait pas le droit de télécharger,</li><li>un contenu illégal, préjudiciable, menaçant, injurieux, harcelant, délictuel, diffamatoire, vulgaire, obscène, contraire aux bonnes mœurs, portant atteinte à la vie privée d\'une personne, odieux ou désobligeant ou choquant d\'un point de vue notamment racial, ethnique ou autre,</li><li>tout élément contenant des virus logiciels ou autres codes, fichiers ou programmes informatiques conçus pour interrompre, détruire ou limiter la fonctionnalité de tout logiciel ou matériel informatique ou de tout équipement de télécommunication ;</li></ul></p><p>-      perturber ou interrompre le fonctionnement de la Plateforme ou des serveurs ou réseaux connectés à la Plateforme, ou enfreindre les exigences, procédures, règles ou réglementations ;</p><p>-      accéder à des Données à caractère personnel qui ne lui sont pas destinées ou entrer dans un serveur ou une partie de la Plateforme auquel l’Utilisateur n’est pas autorisé à avoir accès ;</p><p>-      tenter de sonder, de scruter ou de tester la vulnérabilité d\'un système et notamment de la Plateforme, ou encore d’enfreindre les mesures de sécurité ou d\'authentification sans en avoir reçu l’autorisation ;</p><p>-      usurper ou tenter d’usurper l’identité d’un autre Utilisateur ou de tout tiers ;</p><p>-      nuire à une personne physique ou morale par le biais de la Plateforme ;</p><p>-      porter atteinte à la réputation de Skoda France, de la Plateforme, d’un ou plusieurs autres Utilisateurs ou de tout tiers.</p><p>L’Utilisateur s’engage également à ne pas divulguer des informations personnelles, professionnelles ou confidentielles diffusées au travers de la Plateforme ou dont il aurait connaissance de par l’utilisation de la Plateforme ou provenant de tiers. A fortiori, l’Utilisateur s’abstient de tout traitement de Données à caractère personnel obtenues sur la Plateforme ou par son biais et notamment de toute collecte ou de toute utilisation non autorisée ou détournée et de tout acte susceptible de porter atteinte à la vie privée et aux Données à caractère personnel ou à la réputation d’un ou plusieurs autre(s) Utilisateur(s) ou toute autre personne physique ou morale.</p><p>Les Utilisateurs sont invités à signaler à Skoda France toute utilisation frauduleuse de la Plateforme dont ils auraient connaissance et notamment tout contenu qui contreviendrait aux interdictions énoncées dans les CGU ou plus généralement aux lois et dispositions règlementaires en vigueur.</p><p><br></p><h3>7. DROITS DE PROPRIÉTÉ INTELLECTUELLE</h3><p>La Plateforme, en ce compris l’ensemble des éléments qui la compose, notamment les graphismes, images, photographies, animations, clips, textes, logos, logiciels et interfaces (ci-après le « <b>Contenu</b> ») sont protégés par des droits de propriété intellectuelle et propriété exclusive de Skoda France, à l’exception des marques, logos, images, photos et signes distinctifs appartenant à des sociétés tierces ou à des tiers.</p><p>Toutes utilisations, y compris toute reproduction, distribution, modification, retransmission ou publication du Contenu sont strictement interdites sans accord préalable écrit de Skoda France.</p><p>Il est en particulier interdit de (i) copier, modifier, créer une œuvre dérivée, assembler, décompiler (à l\'exception des cas prévus par la loi), vendre, attribuer, sous-licencier ou transférer de quelque manière que ce soit tout droit afférant au Contenu et de (ii) modifier tout ou partie du Contenu en vue notamment d\'obtenir un accès non autorisé à la Plateforme.</p><p>En conséquence, toute reproduction et/ou représentation, totale ou partielle, du Contenu, sans l’autorisation préalable et écrite de Skoda France, sont interdites et constitueraient une contrefaçon sanctionnée notamment par les dispositions du Code de la propriété intellectuelle.</p><p>Skoda France, ou tout autre titulaire de ces droits, pourra mettre en œuvre toute mesure ou action, y compris judiciaire, pour faire cesser une atteinte à ses droits, en particulier de propriété intellectuelle et se réserve le droit de demander des dommages et intérêts en cas d’une telle atteinte.</p><h3><b>8. COOKIES</b></h3><p>Les cookies sont des données stockées dans l’équipement terminal d’un internaute et utilisées par la Plateforme pour envoyer des informations au navigateur de l’internaute, permettant à ce navigateur de renvoyer des informations au site d’origine.</p><p>Skoda France utilise des cookies ; <a href=\\\"https://www.skoda.fr/informations/cookies\\\">la politique d’utilisation des cookies</a> informe les internautes sur cette utilisation.</p><p>L’Utilisateur dispose d’un droit d’accès, de rectification et d\'opposition sur ses Données à caractère personnel communiquées par le biais des cookies.</p><p>Le paramétrage du logiciel de navigation permet d’informer de la présence de cookies et de la refuser.</p><p>Cependant, certaines fonctionnalités de la Plateforme ne pourront plus être utilisées si l’Utilisateur refuse cette installation des cookies.</p><p><br></p><h3>9. LIENS HYPERTEXTES</h3><p>Toute création de liens vers la Plateforme, tout encadrement (framing) de la Plateforme et plus généralement toute utilisation d\'un élément composant la Plateforme sont soumis à l\'autorisation préalable et écrite de Skoda France, qui pourra être révoquée à tout moment à sa seule discrétion.</p><p>Skoda France n’est aucunement responsable du contenu des sites vers lesquels les liens hypertextes redirigent l’Utilisateur.&nbsp;</p><p><br></p><h3>10. PROTECTION DE VOS DONNEES A CARACTERE PERSONNEL</h3><p>Skoda France collecte des Données à caractère personnel des Utilisateurs, principalement l’adresse mail.</p><p>Skoda France s’engage à faire tous ses efforts pour que les Données des Utilisateurs, et en particulier les Données à caractère personnel, restent confidentielles. Skoda France s’autorise à les communiquer uniquement à ses partenaires et sous-traitants dans le respect de la règlementation applicable. Skoda France leur demande à ce titre de conserver confidentielles ces Données.</p><p>Pour plus d’informations concernant la protection de ses Données à caractère personnel, l’Utilisateur est invité à consulter la politique de protection de la vie privée et des données personnelles qui fait partie intégrante des présentes CGU.</p><p><br></p><h3>11.RESPONSABILITÉ</h3><p>L’Utilisateur reconnaît utiliser la Plateforme sous sa seule responsabilité. Il appartient notamment à l’Utilisateur de se prémunir contre les dangers de l’Internet et de prendre toutes les mesures nécessaires afin de protéger ses propres données (en ce y compris ses Données à caractère personnel) et/ou logiciels de la contamination par d\'éventuels virus qui pourraient affecter son ordinateur ou tout autre matériel informatique qu’il utilise ou qui est sous sa garde.</p><p>L’Utilisateur est seul responsable des moyens d’accès à Internet et à la Plateforme.</p><p>A l’exclusion des Données, Skoda France essaye de s’assurer au mieux de l’exactitude des informations accessibles sur la Plateforme, mais ne garantit pas que les informations fournies par tout tiers soient exactes, complètes ou à jour.</p><p>En outre, Skoda France décline toute responsabilité en cas d\'interruption de la Plateforme, de survenance de dysfonctionnement ou de tout dommage résultant d’acte frauduleux de tiers ou d’Utilisateur(s).</p><p>Par ailleurs, en aucun cas Skoda France ne peut être tenue pour responsable d\'un quelconque dommage, quelles qu\'en soient la cause, origine, nature et conséquence, découlant notamment de l’utilisation non conforme des présentes CGU par l’Utilisateur et de la consultation ou de l\'utilisation de la Plateforme par un tiers.</p><p>LA RESPONSABILITE DE SKODA FRANCE NE POURRA ETRE ENGAGEE POUR UNE CAUSE DONT LE FAIT GENERATEUR A POUR ORIGINE UN CAS DE FORCE MAJEURE, Y COMPRIS SI UN TEL CAS DE FORCE MAJEURE TOUCHE UN DE SES SOUS TRAITANTS, AINSI QUE TOUT EVENEMENT HORS DE SON CONTROLE EXCLUSIF.</p><p>De plus, Skoda France informe l’Utilisateur qu’il se réserve le droit, à tout moment et pour quelque raison que ce soit, de mettre en œuvre tout moyen permettant de suspendre ou supprimer, et ce, sans préavis, l’accès à tout ou partie de la Plateforme et, notamment, pour toute conduite, constatée ou présumée, comme étant en violation de tout ou partie des CGU (en ce y compris la politique de protection de la vie privée et des données personnelles) explicitement ou implicitement, sans préjudice de tout dommage et intérêt que Skoda France se réserve le droit de réclamer à l’Utilisateur en réparation du préjudice subi.</p><p><br></p><h3>12. MODIFICATION DES CGU</h3><p>Les CGU sont susceptibles de faire l’objet de mises à jour de la part de Skoda France. Les CGU précédentes sont alors résiliées de plein droit et remplacées par la nouvelle version qui est immédiatement opposable à l’Utilisateur et mentionnant la date de la dernière mise à jour indiquée en haut des présentes CGU. Pour être informé de ces éventuelles modifications et mises à jour, il est recommandé à l’Utilisateur de consulter les CGU régulièrement.</p><h3><br></h3><h3>13. SURVIVANCE</h3><p>Les stipulations des CGU qui par leur nature ou leur rédaction ont vocation à continuer à s’appliquer après la cessation de l’utilisation de la Plateforme pour quelque cause que ce soit, ainsi que les stipulations des articles 11 « Responsabilité », 10 « Protection de vos données à caractère personnel » et 7 « Droits propriété intellectuelle » resteront en vigueur pour la durée nécessaire à l’exécution de leur objet.</p><p><br></p><h3>14. NULLITÉ – TITRE</h3><p>Si une ou plusieurs stipulations des CGU sont tenues pour non valides ou déclarées telles en application d\'une loi, d\'un règlement ou à la suite d\'une décision définitive d\'une juridiction compétente, les autres stipulations garderont toute leur force et portée.</p><p>En cas de difficultés d’interprétation entre l’un quelconque des titres figurant en tête des clauses et l’une quelconque des clauses, les titres seront écartés et le contenu de la clause concernée prévaudra.</p><p><br></p><h3>15. DROIT APPLICABLE - ATTRIBUTION DE COMPETENCE</h3><p>Les présentes CGU et les documents auxquels elles font référence sont régis par le droit français. En cas de litige, l’Utilisateur s’engage à contacter en priorité Skoda France afin de tenter de résoudre à l’amiable tout différend susceptible d’intervenir concernant les CGU.</p><p>A DÉFAUT D’UN ACCORD AMIABLE DANS UN DÉLAI DE 30 JOURS SUIVANT LA LETTRE INITIANT UNE TELLE DÉMARCHE DE RÈGLEMENT AMIABLE, TOUT LITIGE RELATIF A L\'EXISTENCE, L\'INTERPRETATION, L\'EXECUTION OU LA RUPTURE DES CGU, MEME EN CAS DE PLURALITE DE DEFENDEURS, SERA SOUMIS (SAUF COMPÉTENCE EXCLUSIVE RECONNUE À UNE JURIDICTION DIFFÉRENTE, NOTAMMENT LE TRIBUNAL DE GRANDE INSTANCE DE ParIS EN MATIÈRE DE DROIT DE LA PROPRIÉTÉ INTELLECTUELLE) : (i) EN CAS DE LITIGE AVEC UN COMMERÇANT, AU TRIBUNAL DE COMMERCE DE PARIS ; (ii) EN CAS DE LITIGE AVEC UN NON COMMERÇANT, AU TRIBUNAL FRANÇAIS TERRITORIALEMENT COMPÉTENT.</p><p><br></p><p><br></p><p><br></p>\"}}]','cgu','Condition Générales d\'Utilisation',NULL,NULL,'fr_FR'),(4,4,'reinsurance','[{\"code\":\"sections.reinsurance\",\"data\":{\"blocks\":[{\"icon\":\"pin\",\"title\":\"<strong> Sélectionnez </strong> votre partenaire <strong>SEAT</strong> près de chez vous\"},{\"icon\":\"data-filled\",\"title\":\"<strong>Contactez-le  par téléphone.</strong> Faites lui part de votre liste d\'achats et demandez lui conseil si besoin.\"},{\"icon\":\"customers-center\",\"title\":\"<strong>Votre Partenaire SEAT </strong>vous conseille et vous renseigne sur la disponibilité de vos produits\"},{\"icon\":\"shopping-cart\",\"title\":\"<strong>Retirez </strong>vos achats chez votre partenaire <strong>SEAT</strong>\"}],\"title\":\"Validez votre commande\"}}]','reinsurance',NULL,NULL,NULL,'fr_FR');
