INSERT INTO `sylius_product_translation` (`id`, `translatable_id`, `name`, `slug`, `description`, `meta_keywords`, `meta_description`, `short_description`, `locale`) VALUES (1334,1334,'Base ISOFIX','base-isofix-000019230c','Votre instinct sauvage de protection s’est réveillé lorsque vous êtes devenu père. Cette base pour siège auto est connectée au châssis grâce aux crochets ISOFIX de la voiture, et présente un pied d’appui pour donner de la stabilité. Il est plus en sécurité, vous êtes plus tranquille. Il comprend des indicateurs qui confirment le bon positionnement du pied d’appui et l’encastrement ISOFIX. Les instructions de montage sont comprises.  Compatible avec tous les véhicules équipés d’ISOFIX. Accessoire conçu pour la Leon Cupra.',NULL,NULL,NULL,'fr_FR'),(1335,1335,'Siège sécurité KIDFIX 2S','siege-securite-kidfix-2-s-000019906s','Quoi de mieux que grandir en voyant des paysages depuis la fenêtre de la voiture de nos parents ? Eh bien, le faire depuis le siège confortable et sécurisé KIDFIX 2 S pour enfants de 3,5 à 12 ans (de 15 à 36 kg).  Avec son dossier en forme de V doté du système SICT réglage, le siège offre plus d’espace pour l’enfant à mesure qu’il grandit, mais également une excellente protection lors de chocs latéraux. De plus, lorsque l’enfant atteint la taille de 135 cm, il est possible de retirer le dossier et l’utiliser comme siège élévateur. Le système SecureGuard et la pince de la ceinture garantiront sa bonne utilisation.',NULL,NULL,NULL,'fr_FR'),(1336,1336,'Baby Safe Plus SHR II','baby-safe-plus-shr-ii-000019907b','Il est tellement confortable qu’il peut être utilisé comme transat à l’extérieur de votre SEAT, il inclut même un pare-soleil pour la tête de votre bébé. Spécialement conçu pour enfants jusqu’à 15 mois (ou 13 kg), il se fixe avec la ceinture de sécurité sur trois points d’ancrage. Il peut également être placé dos à la route sur le siège arrière ou le siège passager. Dans ce cas, il n’est pas compatible avec l’airbag avant du passager.',NULL,NULL,NULL,'fr_FR'),(1337,1337,'DUO PLUS','duo-plus-000019909g','Dans ce siège DUO PLUS polyvalent, conçu pour les bébés de 9 mois à 4 ans (9-18 kg), votre enfant passera de siestes placides à l’envie de chanter encore et encore son refrain préféré. Inclinable en 3 positions pour offrir un confort maximal et avec un harnais d’ancrage 5 points pour réduire le mouvement en cas d’accident.',NULL,NULL,NULL,'fr_FR'),(1338,1338,'Câble 3 en 1 de charge et données','cable-3-en-1-de-charge-et-donnees-000051444an','Profitez de voyage pour recharger vos dispositifs ou transférer vos données en même temps avec ce câble au design 3 en 1, avec trois types de câbles USB différents : USB-C, micro-USB et câbles Lightning (Apple). Votre SEAT est compatible avec votre monde : iPhone XS / XS Max / XR / X / 8/8 Plus / 7/7 Plus / 6/6 Plus, iPad Pro 12.9, 10.5, iPad de 4e génération, iPad mini, mini 2, mini 4.',NULL,NULL,NULL,'fr_FR'),(1339,1339,'Boîte d’ampoules H1 + H3 + H7','boite-dampoules-h-1-h-3-h-7-000052001b','La route n’est jamais un bon moment pour passer inaperçu. Emportez toujours cette boîte d’ampoules avec vous et voyagez en toute tranquillité : halogène H1 route, halogène H3 brouillard, halogène H7 feux de croisement, position W5w, position et frein PY21w, clignotant R10w, plaque d’immatriculation C5w, marche arrière P21w, fusible 10 mA, fusible 15 mA, fusible 20 mA, fusible 25 mA et fusible 30 mA.',NULL,NULL,NULL,'fr_FR'),(1340,1340,'Boîte d’ampoules H4','boite-dampoules-h-4-000052004c','Un bon éclairage rend les routes plus sûres. Voyagez en toute tranquillité avec cette boîte d’ampoules : halogène H4 route, position et frein PY21w, clignotant R10w, plaque d’immatriculation C5w, marche arrière P21w, fusible 10 mA, fusible 15 mA, fusible 20 mA, fusible 25 mA et fusible 30 mA.',NULL,NULL,NULL,'fr_FR'),(1341,1341,'Boîte d’ampoules H7','boite-dampoules-h-7-000052007b','La journée ne se termine pas lorsque la nuit tombe. Avec la boîte d’ampoules H7, vous serez toujours prêt à continuer. Comprend : Halogène H7 croisement, position W5w, position et frein PY21w, clignotant R10w, plaque d’immatriculation C5w, marche arrière P21w, fusible 10 mA, fusible 15 mA, fusible 20 mA, fusible 25 mA et fusible 30 mA.',NULL,NULL,NULL,'fr_FR'),(1342,1342,'Help flash','help-flash-000052122a','Ne laissez pas une urgence se transformer en quelque chose de pire. En cas de panne ou d’accident, fixez la lampe Help Flash sur le toit de votre SEAT et elle s’allumera automatiquement pour avertir les autres conducteurs de votre situation. Entièrement conforme aux règles de sécurité routière.',NULL,NULL,NULL,'fr_FR'),(1343,1343,'Système de caméra de recul pour autoradios Gén.2 et Gén.3','systeme-de-camera-de-recul-pour-autoradios-gen-2-et-gen-3-000054731e','Kit complet de caméra de recul et câblage Plug & Play, pour MIB2 et MIB3 avec pose dans la zone de la plaque d’immatriculation Seat.  . Connexion Plug & Play. Câble de 6 mètres de long . \nLignes statiques ON / OFF. Réglages à partir de l’unité principale. Angle de vision 170°  Compatibilité MIB3 : Compatible avec PR 8AR. NON compatible avec PR I8C et I8Q.  Compatibilité MIB2 : Compatible avec PR I8E, I8F et I8H. NON compatible avec I7E, I7Y, I8B et I8C.',NULL,NULL,NULL,'fr_FR'),(1344,1344,'Cintre chromé','cintre-chrome-000061127e','Les vêtements élégants ont besoin d’un cintre. Et votre SEAT le sait. Avec ce cintre chromé avec pièces de fixation et bandes antidérapantes noires, vos vestes arriveront impeccables, quelle que soit la distance parcourue. Se monte facilement sur l’appui-tête avant.',NULL,NULL,NULL,'fr_FR'),(1345,1345,'Support smartphone','support-smartphone-000061129f','Support universel à fixer sur la grille de ventilation, avec système de fixation magnétique.',NULL,NULL,NULL,'fr_FR'),(1346,1346,'Housse de protection de siège pour chiens','housse-de-protection-de-siege-pour-chiens-000061609c','Improvisez une sortie avec votre animal sans avoir à nettoyer la voiture à chaque fois après. Cette housse complète pour siège arrière, avec 4 sangles à attacher à l’appui-tête, prendra soin de vos sièges de voiture et évitera les rayures, les poils et les humidités. Profitez du temps passé ensemble sans penser à autre chose.',NULL,NULL,NULL,'fr_FR'),(1347,1347,'Housse de siège : convient aux systèmes de fixation Isofix','housse-de-siege-convient-aux-systemes-de-fixation-isofix-000061680a','Oubliez les taches ! Cette housse pratique protégera la tapisserie de la banquette sous le siège auto de votre enfant. Antidérapante et lavable, elle vous aidera à garder la tapisserie toujours propre. En outre, elle s’adapte à tous les sièges pour enfants et permettra à votre enfant de mettre à l’abri les trésors qu’il a emportés avec lui.',NULL,NULL,NULL,'fr_FR'),(1348,1348,'Sac multicompartiments','sac-multicompartiments-000061680b','Passez au niveau supérieur en matière d’ordre et de rangement. Créez un nouvel espace de rangement dans votre SEAT et gardez à portée de main tous les objets que vous y placerez. Facile à retirer et à ranger lorsque vous ne l’utilisez pas. Remarque : pour déposer l’appuie-tête, consulter les instructions de montage sur ELSA.',NULL,NULL,NULL,'fr_FR'),(1349,1349,'Coussin pour ceinture','coussin-pour-ceinture-000069629b','Il y a des plaisirs qui ne conviennent qu’aux copilotes. Avec ce coussin de ceinture moelleux, vous pouvez vous adosser confortablement et vous reposer pendant votre voyage. Il est également parfait pour les plus petits.',NULL,NULL,NULL,'fr_FR'),(1350,1350,'Porte-surf','porte-surf-000071120ha','Si vous aimez les vagues, il y a toujours un nouveau spot à découvrir. Avec ce porte-surf, vous pouvez transporter jusqu’à 2 planches avec leurs mâts et vous reposer l’esprit tranquille après avoir surfé, grâce à son système antivol indépendant. Accessoire est compatible avec la Leon Cupra.  Incompatible avec les versions avec toit panoramique.',NULL,NULL,NULL,'fr_FR'),(1351,1351,'Porte-vélos avec attelage de remorque.','porte-velos-avec-attelage-de-remorque-000071128h','Apprenez-leur à explorer le monde sur deux roues. Avec ce porte-vélos monté sur l’attelage de la remorque, vous pouvez transporter jusqu’à 3 vélos. Facile à utiliser et rapide à installer Poids maximal de 15 kg par vélo. Vitesse maximale de conduite avec le porte-vélos : 130 km/h  Le support de plaque d’immatriculation n’est pas inclus.',NULL,NULL,NULL,'fr_FR'),(1352,1352,'Porte-vélos avec attelage de remorque.','porte-velos-avec-attelage-de-remorque-000071128k','Le vélo électrique est une grande invention, tout comme ce porte-vélo spécial pour vélos électriques. Empattement jusqu’à 1 300 mm, revêtement en caoutchouc pour une meilleure protection du cadre et capacité à transporter 2 vélos. Pliage facile, charge utile de 60 kg, verrouillage individuel sur simple pression d’un bouton et mécanisme de pivotement pour un accès facile au coffre du véhicule. Cet accessoire n’est pas compatible avec la Leon Cupra.  Non compatible avec les extensions pour 3e vélo réf 000071128C.',NULL,NULL,NULL,'fr_FR'),(1353,1353,'Porte-skis et snowboards extensible','porte-skis-et-snowboards-extensible-000071129r','Se lever tôt pour profiter de la neige vierge est inévitable, mais se pencher sur le toit de la voiture pour charger et décharger son matériel ne l’est pas. Avec ce porte-skis et snowboards extensible, nous vous facilitons la tâche. Possibilité de charger jusqu’à 5 paires de ski ou 2 snowboards. Coussinets en caoutchouc souple pour protéger les skis pendant le transport.  Incompatible avec les versions avec toit panoramique.',NULL,NULL,NULL,'fr_FR'),(1354,1354,'Porte-skis et snowboards','porte-skis-et-snowboards-000071129s','Plutôt ski ou snowboard ? Pas besoin de choisir, il y a de la place pour tout dans votre SEAT. Permet de transporter confortablement jusqu’à 4 paires de skis ou jusqu’à 2 snowboards. Facile à ouvrir et compatible avec la plupart des galeries.  Aucun outil supplémentaire n’est nécessaire pour le montage.  Clés incluses.   Incompatible avec les versions avec toit panoramique.',NULL,NULL,NULL,'fr_FR'),(1355,1355,'Porte-skis et snowboards 6 paires','porte-skis-et-snowboards-6-paires-000071129t','Interdiction de rester au bar ! Ce porte-skis et snowboards peut contenir jusqu’à 6 paires de skis ou 4 snowboards. Compatible avec la plupart des galeries de toit, montage sans outils supplémentaires et ouverture facile.  Clés incluses.',NULL,NULL,NULL,'fr_FR'),(1356,1356,'Sac pour barres de toit SEAT','sac-pour-barres-de-toit-seat-000071156c','Entre deux escapades, rangez vos barres de toit SEAT dans ce sac pratique qui les protégera de la poussière et de la saleté lorsque vous ne les utilisez pas. Confortable et facile à transporter, avec 2 poignées pratiques et le logo SEAT sur le côté.  Matériau durable avec une poche supplémentaire pour ranger les instructions et les vis. Compatible uniquement avec les barres de toit originales de SEAT.',NULL,NULL,NULL,'fr_FR'),(1357,1357,'Malle porte-bagages 450 litres','malle-porte-bagages-450-litres-000071180a','Il n’y a jamais trop de bagages si vous avez de la place.  Avec cette malle à bagages, vous aurez 450 l de capacité supplémentaire pour vos essentiels. De plus, ses lignes aérodynamiques sont élégantes et ses doubles parois en plastique sont résistantes aux intempéries.  Poids : 18kg Charge maximale : 50 kg  Dimensions en mm : longueur 1 600 x largeur 1 000 x hauteur 440.  Non compatible avec les toits solaires.',NULL,NULL,NULL,'fr_FR'),(1358,1358,'Malle porte-bagages 420 litres SEAT','malle-porte-bagages-420-litres-seat-000071200ab','Porte-bagages d’une capacité de 420 l pour contenir tous vos « et si ? ». Et s’il pleut ? Et s’il n’y a pas de serviettes?... Coloris :noir. Doubles parois en plastique résistantes aux intempéries. Charge maximale : 50 kg. Dimensions en cm : longueur 196 x largeur 78 x hauteur 43. Non compatible avec le toit ouvrant (sauf pour Alhambra, Exeo, Exeo ST, Leon Sportstourer ST et Ateca en combinaison avec les barres de toit SEAT d’origine). Non compatible avec la Leon Cupra.',NULL,NULL,NULL,'fr_FR'),(1359,1359,'Malle porte-bagages 460 litres SEAT','malle-porte-bagages-460-litres-seat-000071200ag','Si cela tient dans 460 litres, vous pouvez le transporter dans votre SEAT. Coffre à bagages en matériaux robustes et antichocs, très résistant aux UV et adapté aux skis (8-9 paires, longueur maximale 2,20 m). Noir brillant. Compatible avec les barres de toit d’origine SEAT. Dimensions : Longueur x largeur x hauteur (226 x 94 x 32 cm).  Incompatible avec les versions avec toit panoramique.',NULL,NULL,NULL,'fr_FR'),(1360,1360,'Malle porte-bagages 400 litres SEAT','malle-porte-bagages-400-litres-seat-000071200t','Qu’il fasse froid, qu’il pleuve ou que le soleil brille, cette malle gardera votre chargement intact. Avec des doubles parois en plastique résistant aux intempéries, une capacité de 400 litres et une charge maximale de 50 kg.  Utilisé en conjonction avec les barres de toit, de couleur noire et avec le logo SEAT.  Non compatible avec le toit ouvrant (sauf pour Alhambra, Exeo, Exeo ST, Leon Sportstourer ST et Ateca en combinaison avec les barres de toit SEAT d’origine). Cet accessoire est applicable à la Leon Cupra.',NULL,NULL,NULL,'fr_FR'),(1361,1361,'Sac de transport pour chien','sac-de-transport-pour-chien-000071253b','Comme une niche miniature pour chien. Avec ce sac de transport pour chien doté d’une ouverture à glissière supérieure et latérale, votre animal peut voyager confortablement et être bien protégé, grâce à la sangle d’ancrage. Dimensions : 48 x 30 x 30cm.',NULL,NULL,NULL,'fr_FR'),(1362,1362,'Jeu de vis antivol','jeu-de-vis-antivol-000071510a','Jeu de vis antivol pour tous modèles Seat',NULL,NULL,NULL,'fr_FR'),(1363,1363,'Housse de pneus','housse-de-pneus-000071770c','Tout peut être plus beau. Même la roue de secours de votre voiture. Couvrez-la avec cette housse en nylon spécial pour SEAT, plastifiée à l’intérieur et avec des fermetures en plastique, et elle restera comme au premier jour. Cela vous évitera également de salir le coffre si vous l’avez utilisée.  Non valide pour jantes de 19\".\"',NULL,NULL,NULL,'fr_FR'),(1364,1364,'Kit de collage pour les éléments aérodynamiques','kit-de-collage-pour-les-elements-aerodynamiques-000071781b','L’esprit sportif, c’est votre truc. Profilez votre SEAT à votre guise avec ce kit de collage d’éléments aérodynamiques. Il offre une excellente adhérence sur divers matériaux tels que le PUR, le polypropylène, l’ABS et bien d’autres encore, obtenant ainsi une grande résistance à la surface du véhicule.  Éléments du kit :  Colle Teroson (310 ml) avec embout applicateur Spatule Bombe d’apprêt Teroson (25ml) 6 lingettes de prétraitement Manuel d’instructions',NULL,NULL,NULL,'fr_FR'),(1365,1365,'Nettoyant 2 en 1 pour écrans','nettoyant-2-en-1-pour-ecrans-000071783a','Nettoyant 2 en 1 pour écrans, fourni avec chiffon de nettoyage haute qualité au design moderne et minimaliste. Produit 2 en 1 permettant le nettoyage en profondeur de l’écran et de le conserver impeccable.  Le liquide nettoyant et le chiffon microfibre garantissent l’élimination totale de la saleté et des empreintes tactiles gênantes.  Versez l’agent de nettoyage uniformément sur l’écran, puis nettoyez l’écran à l’aide du chiffon microfibre fourni avec le récipient.  Bien agiter avant utilisation.  Transportable et rechargeable, chaque récipient peut contenir environ 70 à 80 ml. *  Contenu du kit : Agent nettoyant fourni dans son emballage spécialement conçu (50 g), chiffon microfibre, instructions d’utilisation.',NULL,NULL,NULL,'fr_FR'),(1366,1366,'Kit entretien hiver','kit-entretien-hiver-000071980bpada','L’hiver est enfin là ! Préparez-vous pour partir à l’aventure avec ce kit qui comprend un nettoyant pour jantes, un essuie-glace, un dégivreur, un grattoir à glace et un essuie-tout en coton. Plus de neige, s’il vous plait !',NULL,NULL,NULL,'fr_FR'),(1367,1367,'Sac de transport de roues','sac-de-transport-de-roues-000073900h','Sac protecteur de roue de vélo adaptée aux roues de route et montage de 26” à 29”.  Sac rembourré et renforcé sur la partie du moyeu.  Inclut une poche intérieure.',NULL,NULL,NULL,'fr_FR'),(1368,1368,'Harnais de sécurité pour chien - Taille XL','harnais-de-securite-pour-chien-taille-xl-000084310b','Il occupe une grande partie de votre vie… et de votre voiture. Ce harnais SEAT pour chiens de 25 à 40 kg rendra les trajets plus sûrs pour votre animal et pour tout le monde.  Fourni avec une sangle supplémentaire à attacher à la ceinture de sécurité et au harnais, et des crochets métalliques.  Le dossier est en maille de polyester et la mousse intérieure offre plus de confort pour l’animal.  Obligatoire lorsque le harnais est utilisé à l’intérieur de la voiture.  Taille XL :  Poitrine : 640 à 820 mm / Cou : 440 à 600 mm / Longueur : 330 mm',NULL,NULL,NULL,'fr_FR'),(1369,1369,'Harnais de sécurité pour chien - Taille L','harnais-de-securite-pour-chien-taille-l-000084310c','Pour que vos balades en voiture soient aussi sereines que vos promenades dans le quartier. Ce harnais SEAT pour chiens de 15 à 25 kg vous permettra de conduire l’esprit tranquille tout en protégeant votre animal.  Fourni avec une sangle supplémentaire à attacher à la ceinture de sécurité et au harnais, et des crochets métalliques.  Le dossier est en maille de polyester et la mousse intérieure offre plus de confort pour l’animal.  Obligatoire lorsque le harnais est utilisé à l’intérieur de la voiture.  Taille L :  Poitrine : 490 à 620 mm / Cou : 340 à 480 mm / Longueur : 280 mm.',NULL,NULL,NULL,'fr_FR'),(1370,1370,'Harnais de sécurité pour chien - Taille M','harnais-de-securite-pour-chien-taille-m-000084310d','Protégez-le aussi bien qu’il vous protège avec ce harnais de sécurité pour chiens de 5 à 15 kg. Fourni avec une sangle supplémentaire à attacher à la ceinture de sécurité et au harnais, et des crochets métalliques. Le dossier est en maille de polyester et la mousse intérieure offre plus de confort pour l’animal. Obligatoire lorsque le harnais est utilisé à l’intérieur de la voiture. Taille M : Poitrine : 430 à 520 mm / Cou : 260 à 370 mm / Longueur : 230 mm.',NULL,NULL,NULL,'fr_FR'),(1371,1371,'Harnais de sécurité pour chien - Taille S','harnais-de-securite-pour-chien-taille-s-000084310e','Nous savons combien d’énergie ont certains petits chiens. Protégez votre chien avec ce harnais de sécurité SEAT et profitez de vos trajets en voiture.  Fourni avec une sangle supplémentaire à attacher à la ceinture de sécurité et au harnais, et des crochets métalliques.  Le dossier est en maille de polyester et la mousse intérieure offre plus de confort pour l’animal.  Obligatoire lorsque le harnais est utilisé à l’intérieur de la voiture.  Taille S :  Poitrine : 390 à 450 mm / Cou : 210 à 270 mm / Longueur : 170 mm  Recommandée pour les chiens de 2 à 5 kg',NULL,NULL,NULL,'fr_FR'),(1372,1372,'Rétroviseur intérieur supplémentaire','retroviseur-interieur-supplementaire-000084418a','Gardez un œil sur vos enfants. Plus rien ne vous échappera. Avec ce rétroviseur supplémentaire, vous pourrez voir tout ce qui se passe sur la banquette arrière. Mais il sera également très utile pour avoir une meilleure vue sur la circulation à l’arrière et lorsque vous vous garez. Il se fixe à l’aide d’une ventouse qui l’empêchera de bouger.',NULL,NULL,NULL,'fr_FR'),(1373,1373,'Décoration clé - FR','decoration-cle-fr-000087013ae','Coque décorative pour la clé du véhicule. Composée de 2 pièces adhésives sur la clé, avec le design FR',NULL,NULL,NULL,'fr_FR'),(1374,1374,'LOGO SEAT – Revêtement de clé','logo-seat-revetement-de-cle-000087013af','Revêtement décoratif pour clé de voiture. Set de deux pièces attachées aux clés, conception logo SEAT  Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1375,1375,'Revêtement décoratif de clé CUPRA','revetement-decoratif-de-cle-cupra-000087013aj','Revêtement de clé fabriqué avec des matériaux de haute qualité qui assurent la protection de la clé. Il s\'adapte parfaitement à la clé d\'origine. Design décoratif avec motif CUPRA Fixation par ruban adhésif. Instructions de montage incluses.',NULL,NULL,NULL,'fr_FR'),(1376,1376,'Tracker de clés','tracker-de-cles-000087013bb','Tracker de clés connecté avec portée de 50 M',NULL,NULL,NULL,'fr_FR'),(1377,1377,'Revêtement décoratif de clé Ecomotive','revetement-decoratif-de-cle-ecomotive-000087013j','Revêtement de clé fabriqué avec des matériaux de haute qualité qui assurent la protection de la clé. Il s\'adapte parfaitement à la clé d\'origine. Design décoratif avec motif Ecomotive Non valable pour Exeo, Exeo ST et Alhambra avec portes électriques Fixation par un ruban adhésif. Instructions de montage incluses.',NULL,NULL,NULL,'fr_FR'),(1378,1378,'Revêtement décoratif de clé TOLEDO','revetement-decoratif-de-cle-toledo-000087013s','Revêtement de clé fabriqué avec des matériaux de haute qualité qui assurent la protection de la clé. Il s\'adapte parfaitement à la clé d\'origine. Design décoratif assorti au modèle de la voiture (TOLEDO). Fixation par ruban adhésif. Instructions de montage incluses.',NULL,NULL,NULL,'fr_FR'),(1379,1379,'LEON - Revêtement de clé','leon-revetement-de-cle-000087013t','Revêtement décoratif pour clé de voiture. Set de deux pièces attachées aux clés, conception LEON  Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1380,1380,'Kit de nettoyage Click Box','kit-de-nettoyage-click-box-000087700ba','En matière de nettoyage aussi, il y a des niveaux. Si vous êtes soigneux et aimez garder vos affaires comme neuves, vous avez besoin de produits adaptés. Ce kit professionnel est spécialisé en... tout. Il contient un shampoing à la cire, un produit d’entretien des plastiques, un produit d’entretien du cuir, de la cire à polir, un produit de polissage des surfaces vitrées et une éponge. Amusez-vous',NULL,NULL,NULL,'fr_FR'),(1381,1381,'Nettoyant multisurface 500ml','nettoyant-multisurface-500-ml-000087700cg','Produit de nettoyage multiusage à haut rendement et fort pouvoir dégraissant, très facile à utiliser, pour le nettoyage et la désinfection de tous types de surfaces. 500ml.',NULL,NULL,NULL,'fr_FR'),(1382,1382,'Chaîne à neige pneu 215/45R16 - 215/40R -','chaine-a-neige-pneu-21545-r-16-21540-r-000091301a','Améliore l´adhérence sur glace ou sur neige. Produit fabriqué 100 % textile. Montage et démontage faciles et rapides. Léger et facile à ranger. Présentation en sac plastique avec table d´application. Lavable et réutilisable. Certifié TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1383,1383,'Chaîne à neige pneu 215/45R17 - 225/40R18','chaine-a-neige-pneu-21545-r-17-22540-r-18-000091301b','Si vous êtes à l’aise sur la neige, votre SEAT se doit de l’être aussi. Avec ces chaînes neige 100% textile, vous améliorerez l’adhérence de vos pneus sur le verglas et la neige. Légères, faciles à utiliser, lavables et réutilisables. Et avec un sac pratique qui comprend aussi les instructions. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1384,1384,'Chaîne à neige pneu 165/70R14','chaine-a-neige-pneu-16570-r-14-000091303a','Pour espaces réduits, installation très facile, démontage instantané avec une seule main. Réglage automatique de tension pendant la conduite. Taille de maillon de 9 mm pour s\'adapter aux passages de roue de petite taille. Chaîne en X pour une meilleure adhérence. Tapis et gants inclus.',NULL,NULL,NULL,'fr_FR'),(1385,1385,'Chaîne à neige pneu 175/70R14','chaine-a-neige-pneu-17570-r-14-000091303b','Pour espaces réduits, grande facilité d\'installation, dépose instantanée à une main. Réglage automatique de la tension durant la conduite. Taille de maillon de 9 mm pour s\'adapter aux passages de roue de petite taille. Chaîne en X pour plus d\'adhérence. Tapis et gants compris.',NULL,NULL,NULL,'fr_FR'),(1386,1386,'Chaîne à neige pneu 185/60R15  195/55R15','chaine-a-neige-pneu-18560-r-15-19555-r-15-000091303c','Pour espaces réduits, installation très facile, démontage instantané avec une seule main. Réglage automatique de tension pendant la conduite. Taille de maillon de 9 mm pour s\'adapter aux passages de roue de petite taille. Chaîne en X pour une meilleure adhérence. Tapis et gants inclus.',NULL,NULL,NULL,'fr_FR'),(1387,1387,'Chaîne neige pour pneu 165/65R15 - 185/65R15 - 215/40R17','chaine-neige-pour-pneu-16565-r-15-18565-r-15-21540-r-17-000091303d','Qui a dit que mettre les chaînes était compliqué ? Cette chaîne en forme de X, pour une meilleure adhérence, ajuste automatiquement la tension pendant que vous roulez et se démonte d’une seule main. Taille de maillon de 9 mm pour s’adapter à des passages de roues réduits. Tapis et gants compris. Compatible avec la Leon Cupra.',NULL,NULL,NULL,'fr_FR'),(1388,1388,'Chaîne à neige pneu 205/55R16 - 215/45R17 - 215/40R18','chaine-a-neige-pneu-20555-r-16-21545-r-17-21540-r-18-000091303e','Pour espaces réduits, grande facilité de montage, démontage instantané à une seule main. Réglage automatique de la tension pendant la conduite. Maillons de 9 mm pour adaptation aux garde-boue de taille réduite. Chaîne en X pour une meilleure adhésion. Tapis et gants inclus. Cet accessoire est applicable à la Leon Cupra / Ibiza FR.',NULL,NULL,NULL,'fr_FR'),(1389,1389,'Chaîne à neige pneus 165/70R14 - 175/65R14 - 185/55R15 - 185/50R16 - 175/7','chaine-a-neige-pneus-16570-r-14-17565-r-14-18555-r-15-18550-r-16-1757-000091375aa','Améliore l\'adhérence sur gel ou neige. Produit fabriqué 100 % textile. Facile et rapide à monter et démonter. Léger et facile à ranger. Présenté dans un sac plastique avec tableau d\'application. Lavable et réutilisable. Doté de la certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1390,1390,'Chaîne neige pour les pneus 235/35R19 - 225/50R17 - 205/60R16 - 215/60R16','chaine-neige-pour-les-pneus-23535-r-19-22550-r-17-20560-r-16-21560-r-16-000091375ac','Conduisez aussi loin que la route vous mène, même lorsque celle-ci se transforme en un tapis blanc. Ces chaînes 100% textile améliorent l’adhérence sur la neige et la glace. Faciles et rapides à monter et à démonter, elles sont livrées avec un sac pratique pour le rangement, contenant les instructions. Lavable et réutilisable. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1391,1391,'Chaîne neige pour pneus 235/50R19 - 235/55R19','chaine-neige-pour-pneus-23550-r-19-23555-r-19-000091375ad','Est-ce que j’ai pris assez de pulls ? C’est la seule chose dont vous aurez à vous soucier lors de votre prochaine escapade à la neige. Avec cette chaîne pour pneus conçue pour améliorer l’adhérence sur le verglas ou la neige et qui se monte et se démonte facilement, vous oublierez tout le reste. Lavable et réutilisable, elle est livrée dans un sac avec des instructions. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1392,1392,'Chaîne neige pour les pneus 185/70R14 - 185/65R15 - 195/55R16','chaine-neige-pour-les-pneus-18570-r-14-18565-r-15-19555-r-16-000091375ae','Parfois, il suffit de traverser un tunnel pour passer de l’asphalte au verglas. Lorsque le paysage change aussi vite, vous serez vous aussi en mesure de mettre et d’enlever vos chaînes en un clin d’œil. Lavables, réutilisables, légères et accompagnées d’un sac pratique avec instructions pour un rangement facile. 100 % textile. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1393,1393,'Chaîne neige pour pneus 215/55R17 - 225/60 R16','chaine-neige-pour-pneus-21555-r-17-22560-r-16-000091375dk','Profitez des montagnes, de l’air frais et de la sensation du froid sur votre visage, et oubliez tout le reste. Ces chaînes peu encombrantes sont si faciles à monter et à démonter que vous pourrez le faire d’une seule main. De plus, elles disposent d’un réglage automatique de la tension pendant la conduite. Taille de maillon : 9 mm. Tapis et gants compris.',NULL,NULL,NULL,'fr_FR'),(1394,1394,'Chaîne à neige pneu 175/65R14 - 175/70R14 - 185/55R15','chaine-a-neige-pneu-17565-r-14-17570-r-14-18555-r-15-000091375dm','Formé de maillons métalliques qui garantissent une conduite précise et une traction maximale compatible avec les systèmes ABS et ESP. Aucun bruit ni vibration produit. Conseillés pour les véhicules à espace de roue réduit. Ils sont dotés d\'un système réfléchissant pour améliorer la visibilité lors de la conduite nocturne.',NULL,NULL,NULL,'fr_FR'),(1395,1395,'Chaîne neige pour pneu 225/45R19','chaine-neige-pour-pneu-22545-r-19-000091375eh','Snowboard ou ski ? Telle est la question. Au moins, pour équiper les roues de votre SEAT, vous ne vous poserez pas de question. Ces chaînes 100% textile sont la meilleure option. Facile et rapide à monter et à démonter, et avec un sac pratique pour le rangement qui inclut les instructions d’utilisation. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1396,1396,'Chaîne neige pour pneus 215/55R17 - 225/60 R16','chaine-neige-pour-pneus-21555-r-17-22560-r-16-000091375ej','Conduire sur la neige et le verglas sera votre nouveau passe-temps. Avec cette chaîne composée de maillons métalliques, la conduite sera si fluide et silencieuse que vous l’apprécierez comme jamais auparavant. Traction et précision maximales, compatible avec les systèmes ABS et ESP et recommandée pour les véhicules à garde au sol réduite. Munie d’un système réfléchissant pour améliorer la visibilité lors de la conduite nocturne.',NULL,NULL,NULL,'fr_FR'),(1397,1397,'Chaîne neige pour pneu 225/60R16','chaine-neige-pour-pneu-22560-r-16-000091375ek','Chut ! Ne les réveillez pas... Cette chaîne composée de maillons métalliques garantit une conduite précise et une traction maximale sans bruit ni vibration, idéale pour les passagers qui profitent du voyage pour faire une sieste. Recommandée pour les véhicules à espace de roue réduit, compatible avec les systèmes ABS et ESP et avec un système réfléchissant qui améliore la visibilité lors de la conduite de nuit.',NULL,NULL,NULL,'fr_FR'),(1398,1398,'Chaîne neige pour pneu 225/55R17','chaine-neige-pour-pneu-22555-r-17-000091375el','Découvrez le calme et la tranquillité de la conduite sur le verglas et la neige. Avec cette chaîne composée de maillons métalliques, vous bénéficierez d’une conduite précise et d’une traction maximale sans bruit ni vibration. Recommandée pour les véhicules à espace de roue réduit, compatible avec les systèmes ABS et ESP et avec un système réfléchissant pour améliorer la visibilité lors de la conduite de nuit.',NULL,NULL,NULL,'fr_FR'),(1399,1399,'Pneu 195/55R16','pneu-19555-r-16-000091375em','Améliore l\'adhérence sur gel ou neige. Produit fabriqué 100 % textile. Facile et rapide à monter et démonter. Léger et facile à ranger. Présenté dans un sac plastique avec tableau d\'application. Lavable et réutilisable. Doté de la certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1400,1400,'Pneu 185/65R15','pneu-18565-r-15-000091375g','Améliore l\'adhérence sur gel ou neige. Produit fabriqué 100 % textile. Facile et rapide à monter et démonter. Léger et facile à ranger. Présenté dans un sac plastique avec tableau d\'application. Lavable et réutilisable. Doté de la certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1401,1401,'Pneu 185/70R14','pneu-18570-r-14-000091375h','Améliore l\'adhérence sur gel ou neige. Produit fabriqué 100 % textile. Facile et rapide à monter et démonter. Léger et facile à ranger. Présenté dans un sac plastique avec tableau d\'application. Lavable et réutilisable. Doté de la certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1402,1402,'Chaîne à neige pneu 215/55R16 - 225/45R17','chaine-a-neige-pneu-21555-r-16-22545-r-17-000091375j','Les chaînons métalliques assurent une conduite précise et la meilleure traction ; Compatible avec les systèmes ABS et ESP. Ne génère aucun bruit ni aucune vibration. Recommandé pour les véhicules à espacement de roue réduit. Comprend un système réfléchissant pour améliorer la visibilité en conduite de nuit.',NULL,NULL,NULL,'fr_FR'),(1403,1403,'Chaîne à neige pneu 215/40R17','chaine-a-neige-pneu-21540-r-17-000091375m','Les chaînons métalliques assurent une conduite précise et la meilleure traction ; Compatible avec les systèmes ABS et ESP. Ne génère aucun bruit ni aucune vibration. Recommandé pour les véhicules à espacement de roue réduit. Comprend un système réfléchissant pour améliorer la visibilité en conduite de nuit.',NULL,NULL,NULL,'fr_FR'),(1404,1404,'Pneu 175/65R14; 185/60R14','pneu-17565-r-14-18560-r-14-000091375p','Formé de maillons métalliques qui garantissent une conduite précise et une traction maximale compatible avec les systèmes ABS et ESP. Aucun bruit ni vibration produit. Conseillés pour les véhicules à espace de roue réduit. Ils sont dotés d\'un système réfléchissant pour améliorer la visibilité lors de la conduite nocturne.',NULL,NULL,NULL,'fr_FR'),(1405,1405,'Chaîne à neige pneu 185/60R15 195/55R15','chaine-a-neige-pneu-18560-r-15-19555-r-15-000091375q','Formés de maillons métalliques qui garantissent une conduite précise et une traction maximale, Compatibles avec les systèmes ABS et ESP. Aucun bruit ni vibration produit. Conseillés pour les véhicules à espace de roue réduit. Ils sont dotés d\'un système réfléchissant pour améliorer la visibilité lors de la conduite nocturne.',NULL,NULL,NULL,'fr_FR'),(1406,1406,'Chaîne neige pour pneu 205/60R16 - 205/55R17 - 215/45R18 - 215/45R16 - 225','chaine-neige-pour-pneu-20560-r-16-20555-r-17-21545-r-18-21545-r-16-225-000091375s','3, 2, 1… Roulez ! Ces chaînes neige sont si faciles à installer et à retirer que vous pouvez le faire d’une seule main. Et elles disposent également d’un réglage automatique de la tension pendant la conduite. Des chaînes pour les roues à faible écartement : roues à maillons de 9 mm et chaîne en X pour une meilleure adhérence Tapis et gants inclus.',NULL,NULL,NULL,'fr_FR'),(1407,1407,'Désodorisant Limoncello rechargeable','desodorisant-limoncello-rechargeable-000091500b','Transformez chaque voyage en un moment de plaisir avec le désodorisant parfumé « Limoncello ». Son parfum naturel contribue au bien-être physique et émotionnel en créant une ambiance agréable, détendue et sûre pour voyager. Rechargeable avec 2 tablettes de la même senteur ou en combinant 2 tablettes différentes.',NULL,NULL,NULL,'fr_FR'),(1408,1408,'Désodorisant Insilver Limoncello rechargeable','desodorisant-insilver-limoncello-rechargeable-000091500d','Commencez vos matinées du bon pied avec le désodorisant « Insilver Limoncello » pour l’intérieur de votre SEAT. Un parfum naturel qui contribue au bien-être physique et émotionnel. Rechargeable avec 2 tablettes de la même senteur ou en combinant 2 tablettes différentes.',NULL,NULL,NULL,'fr_FR'),(1409,1409,'Recharge pour diffuseur Insilver Passion','recharge-pour-diffuseur-insilver-passion-000091500e','Il y a des souvenirs qui ont leur propre parfum. Pourquoi ne pas en faire l’expérience dans votre SEAT ? Le désodorisant « Insilver Passion » remplira l’intérieur de votre véhicule d’un parfum naturel et agréable pour que vous profitiez d’un environnement de conduite sûr. Rechargeable avec 2 tablettes de la même senteur ou en combinant 2 tablettes différentes.',NULL,NULL,NULL,'fr_FR'),(1410,1410,'Recharge diffuseur Elegance','recharge-diffuseur-elegance-000091500el','Créez une atmosphère agréable, détendue et sûre à chaque voyage avec le désodorisant « Elegance ». Un parfum naturel qui contribue au bien-être physique et émotionnel. Rechargeable avec 2 tablettes de la même senteur ou en combinant 2 tablettes différentes.',NULL,NULL,NULL,'fr_FR'),(1411,1411,'Recharge désodorisant Fruits mixtes','recharge-desodorisant-fruits-mixtes-000091500fm','Découvrez les bienfaits des fruits même dans votre SEAT. Avec le désodorisant au parfum naturel « Fruits mixtes », vous stimulerez votre bien-être physique et émotionnel. En outre, son arôme contribue à créer une atmosphère détendue, idéale pour les voyages. Rechargeable avec 2 tablettes de la même senteur ou en combinant 2 tablettes différentes.',NULL,NULL,NULL,'fr_FR'),(1412,1412,'Recharge désodorisant Fruits rouges','recharge-desodorisant-fruits-rouges-000091500fr','Nous savons que vous vivez la vie avec passion, alors votre SEAT ne pouvait pas être en reste. Emplissez vos voyages d’émotion avec le désodorisant « Fruits rouges », un parfum naturel qui vous aidera à améliorer votre bien-être physique et émotionnel. Rechargeable avec 2 tablettes de la même senteur ou en combinant 2 tablettes différentes.',NULL,NULL,NULL,'fr_FR'),(1413,1413,'Recharge pour désodorisant Herbal léger','recharge-pour-desodorisant-herbal-leger-000091500hs','Ce désodorisant au parfum « Herbal léger » apportera une touche de zen à l’atmosphère de votre véhicule. Une façon de vous aider à vivre les inévitables bouchons matinaux de manière plus sereine. Son parfum naturel contribue au bien-être physique et émotionnel et aide à créer une atmosphère agréable et détendue. Rechargeable avec 2 tablettes de la même senteur ou en combinant 2 tablettes différentes. \"\"',NULL,NULL,NULL,'fr_FR'),(1414,1414,'Désodorisant senteur Alize','desodorisant-senteur-alize-000091500l','Quelle est l’odeur de votre SEAT ? Avec le parfum Alize, elle sentira la vanille du Pacifique Sud. Mais seulement quand vous en avez envie. Car grâce au système qui préserve le parfum, vous pouvez profiter de cet arôme quand vous le souhaitez et gardez-le lorsque vous ne l’utilisez pas. Présenté sous blister de 15 unités.',NULL,NULL,NULL,'fr_FR'),(1415,1415,'Désodorisant senteur Calima','desodorisant-senteur-calima-000091500m','Quand quelque chose nous plaît, nous avons toujours envie qu’il dure un peu plus longtemps. C’est pourquoi le désodorisant Calima au parfum de poivre rose est doté d’un système breveté qui préserve le parfum : profitez-en quand vous en avez envie et gardez-le quand vous ne l’utilisez pas. Présenté sous blister de 15 unités.',NULL,NULL,NULL,'fr_FR'),(1416,1416,'Désodorisant senteur Mistral','desodorisant-senteur-mistral-000091500n','Système breveté préservant le parfum : décidez quand l\'utiliser, choisissez la senteur et rangez celle que vous n\'utilisez pas. Parfum Mistral avec senteur cocktail tropical. Présenté sous blister de 15 unités',NULL,NULL,NULL,'fr_FR'),(1417,1417,'Recharge diffuseur Ocean','recharge-diffuseur-ocean-000091500oc','Le grand large toute l’année. Avec le désodorisant « Ocean », les senteurs des embruns parfumeront l’habitacle de votre SEAT. En outre, cette fragrance naturelle favorise le bien-être physique et émotionnel, créant ainsi un environnement idéal pour les voyages. Rechargeable avec 2 tablettes de la même senteur ou en combinant 2 tablettes différentes. \"\"',NULL,NULL,NULL,'fr_FR'),(1418,1418,'Désodorisant senteur Zephyros','desodorisant-senteur-zephyros-000091500q','Donnez une touche exotique à vos voyages avec le désodorisant Zephyros à l’arôme de coriandre et d’épices orientales, et faites-le durer encore plus longtemps avec son système breveté qui préserve le parfum. Présenté sous blister de 15 unités.',NULL,NULL,NULL,'fr_FR'),(1419,1419,'Capuchon de valves','capuchon-de-valves-000092782a','Ce sont ces petits détails qui donnent une finition de qualité à votre voiture. Ce set de 5 capuchons pour vos roues est fabriqué en aluminium avec le logo SEAT en résine. Les capuchons se vissent sur les valves.',NULL,NULL,NULL,'fr_FR'),(1420,1420,'Triangle de sécurité','triangle-de-securite-000093056a','Sur la route, sentez-vous protégé même lorsque vous devez sortir de votre SEAT. Avec ce triangle réfléchissant avec système catadioptre et pieds pliants de grande stabilité, vous serez toujours visible pour les autres voitures. Il est également pliable et livré avec un sac pour le ranger facilement.',NULL,NULL,NULL,'fr_FR'),(1421,1421,'Gilet de sécurité','gilet-de-securite-000093056j','Il y a des vêtements qui sauvent des vies. Comme ce gilet de haute qualité fait d’un matériau ultraléger et d’une luminosité maximale. Ses bandes réfléchissantes 3M™ Scotchlite™ vous rendront visible où que vous soyez. Avec fermeture velcro pour plus de commodité. Parce que dans les situations délicates, chaque petit geste compte.',NULL,NULL,NULL,'fr_FR'),(1422,1422,'Kit anticrevaison automatique','kit-anticrevaison-automatique-000093059ae','Une crevaison ? Pas de problème. Avec ce kit de crevaison automatique, vous ne serez jamais hors de course. Grâce à son produit d’étanchéité en caoutchouc naturel, vous pourrez réparer la roue et rouler jusqu’à 200 km à 80 km/h. Comprend une bouteille de 450 ml et un compresseur, et est conforme aux normes de sécurité CE.',NULL,NULL,NULL,'fr_FR'),(1423,1423,'Triangle de présignalisation','triangle-de-presignalisation-000093600b','Sur la route, sentez-vous protégé même lorsque vous devez sortir de votre SEAT. Avec ce triangle réfléchissant avec système catadioptre et pieds pliants de grande stabilité, vous serez toujours visible pour les autres voitures. Il est également pliable et livré avec un sac pour le ranger facilement.',NULL,NULL,NULL,'fr_FR'),(1424,1424,'Lot Triangles de présignalisation','lot-triangles-de-presignalisation-000093600c','Vous avez une flotte de véhicules ? Munissez-les tous avec le triangle de sécurité réfléchissant avec système catadioptrique qui protège aussi bien le conducteur que le véhicule. Ils sont dotés de pieds pliants très stables et d’une housse. Commande minimum de 150 unités.',NULL,NULL,NULL,'fr_FR'),(1425,1425,'Jeu 3 en 1 - Boîte à outils','jeu-3-en-1-boite-a-outils-000093860b','Dans une mallette à outils professionnelle, le numéro de tournevis dont vous avez besoin ne manque jamais. Ce set multi-usages de 42 pièces ne vous laissera jamais tomber. Les outils sont dotés d’une fonction de cliquet et de tournevis articulés et de trois positions à des angles de 45°, 90° et 180°, ce qui permet un réglage dans les endroits difficiles d’accès. Fabriqué en acier au chrome-vanadium.  Pièces : 1 Cliquet-Tournevis, 1 Rallonge 1/4´´x 100 mm, 1 adaptateur d’embout 1/4´´, 9 douilles 1/4´´ multifonctions : 5-6-7-8-9-10-12-11-13 mm, 30 embouts 1/4´´ 25 mm: TORX : T10-T15-T20-T25-T27-T30-T40, PLATES : 3-4-5-6-7, HEXAGONALE : 2-2.5-3-4-5-6 , PHILIPS : PH1 (2 u.), PH2 (2 u.), PH3 (2 u.), POZIDRIVE : PZ1 (2 u.), PZ2 (2 u.), PZ3 (2 u.) et mallette de transport.',NULL,NULL,NULL,'fr_FR'),(1426,1426,'Gilet réfléchissant jaune','gilet-reflechissant-jaune-000093900sa','Les contretemps ne préviennent pas. C’est pourquoi ce gilet réfléchissant est tout aussi utile de jour que de nuit. Grâce à ses bandes réfléchissantes fabriquées par 3M™ et à sa couleur jaune, il est à la fois fluorescent et rétroréfléchissant, ce qui vous permet d’être vu où que vous soyez.',NULL,NULL,NULL,'fr_FR'),(1427,1427,'Gilet réfléchissant jaune (commande minimum 300 unités)','gilet-reflechissant-jaune-commande-minimum-300-unites-000093901id','Ce gilet de sécurité est très visible de jour comme de nuit, grâce à sa matière fluorescente associée à des bandes réfléchissantes fabriquées par 3M™. Et si c’est un must pour le coffre de votre SEAT, c’est un must pour toute votre flotte de véhicules. Équipez-vous ! Commande minimum 50 unités.',NULL,NULL,NULL,'fr_FR'),(1428,1428,'Pack de sécurité (triangle + gilet + trousse de secours + ampoules H1+H3+H','pack-de-securite-triangle-gilet-trousse-de-secours-ampoules-h-1-h-3-h-000093990ab','Vous et votre SEAT formez une équipe, même dans les moments difficiles. Ce kit de sécurité comprend un gilet réfléchissant, un triangle de présignalisation, une trousse de premiers secours et une boîte d’ampoules H1 + H3 + H7, pour vous aider à vous remettre de tout incident, où que vous soyez.',NULL,NULL,NULL,'fr_FR'),(1429,1429,'Kit de sécurité SEAT','kit-de-securite-seat-000093990bc','Nouveau kit de sécurité SEAT : 1 gilet, 1 triangle et une trousse de secours',NULL,NULL,NULL,'fr_FR'),(1430,1430,'Pack sécurité (triangles + gilet)','pack-securite-triangles-gilet-000093990r','Kit de deux triangles de signalisation d\'urgence. Gilet réfléchissant de couleur jaune. Matériel fourni directement à partir de 50 unités.',NULL,NULL,NULL,'fr_FR'),(1431,1431,'Pack de sécurité (triangle + gilet + trousse de 