es sport','pedales-sport-3r0071700','Kit pédales en aluminium (frein, embrayage, accélérateur) avec caoutchouc noir et kit de ponts de fixation. Antidérapant. Amélioration des pédales pour une conduite sportive. Confère un fort caractère sportif à l´habitacle. Comprend des instructions de montage et des éléments de fixation. Non applicable aux véhicules ayant une boîte de vitesses automatique et le volant à droite.',NULL,NULL,NULL,'fr_FR'),(1591,1591,'Repose-pieds','repose-pieds-3r0071750','Améliore l´adhérence du repose-pieds pour la conduite sportive. Fabrication en aluminium et caoutchouc pour une meilleure adhérence. Renforce le caractère sportif de l´intérieur du véhicule. Comprend des instructions de montage et des éléments de fixation.',NULL,NULL,NULL,'fr_FR'),(1592,1592,'Kit électrique 13 pôles sans prééquipement GI','kit-electrique-13-poles-sans-preequipement-gi-3r1055204','Kit d\'installation électrique à 13 bornes pour attache de remorque, véhicules sans prééquipement d\'origine et avec le volant à gauche. Intègre tous les éléments nécessaires à sa pose. Monté avec l\'attache de remorque. Si la remorque porte des LED qui ne fonctionnent pas correctement, il est nécessaire de compléter les kits avec les pièces suivantes : Support pour centrale Réf. 8E0 907 297 B 2 écrous Réf. N 901 362.02',NULL,NULL,NULL,'fr_FR'),(1593,1593,'Pare-chocs arrière Kit aérodynamique','pare-chocs-arriere-kit-aerodynamique-3r9071061','Pare-chocs arrière design sport ; comprend diffuseurs d´air, spoiler inférieur et kit de fixation avec instructions. Si le véhicule est doté, de série, des capteurs d´aide au garage, pour installation sur le pare-chocs avant ou sur le pare-chocs arrière du kit aérodynamique, il est nécessaire de commander 2 x 4 supports en plastique pour adaptation aux capteurs. Les références nécessaires sont indiquées dans les instructions de montage. Pièces préparées pour peinture.',NULL,NULL,NULL,'fr_FR'),(1594,1594,'Film protecteur pare-chocs arrière','film-protecteur-pare-chocs-arriere-3r9071363','Feuille adhésive transparente adaptée à la forme du pare-chocs arrière pour protéger la zone de chargement.',NULL,NULL,NULL,'fr_FR'),(1595,1595,'Kit électrique 13 pôles','kit-electrique-13-poles-3r9071650','Kit électrique 13 pôles pour attache de remorque sur les voitures sans prééquipement. Câblage intérieur (à partir de la centrale) uniquement. Appareil de commande non inclus, le demander via les pièces de rechange (ETKA-ET2000). Non valable pour l\'option 1M7 / 1D8.',NULL,NULL,NULL,'fr_FR'),(1596,1596,'Faisceau attelage sans prééquipement','faisceau-attelage-sans-preequipement-575055204a','Faisceau électrique 13 broches pour ATECA sans pré-équipement attelage',NULL,NULL,NULL,'fr_FR'),(1597,1597,'Moulure de protection du coffre','moulure-de-protection-du-coffre-575061155','Prenez soin de votre voiture dans les moindres détails grâce à cette moulure de protection métallique, adhésive et couleur inox, qui vous permettra de charger tout ce que vous voulez dans votre coffre sans avoir à vous inquiéter d’éventuels chocs ou frottements.',NULL,NULL,NULL,'fr_FR'),(1598,1598,'Plateau protecteur de coffre (semi-rigide) - Double fond','plateau-protecteur-de-coffre-semi-rigide-double-fond-575061201','Valises, caisses, meubles... Chamboulez votre monde autant que vous le souhaitez. Avec cette pièce de protection en plastique flexible pour la base du coffre, aucune charge ne vous résistera. Accessoire applicable aux combinaisons suivantes : PR : - 1X0+3GN : Transmission avant et double plancher, 1X1+3GN : Transmission 4x4 et double plancher  - 1X1+1G9+3GA : transmission 4x4, roue de secours, sans plancher de charge - 1X1+1G9+3GE : transmission 4x4, roue de secours et plancher de charge surélevé.',NULL,NULL,NULL,'fr_FR'),(1599,1599,'Tapis de coffre réversible','tapis-de-coffre-reversible-575061201a','Plateau adapté aux dimensions du plancher du coffre. Ce plateau est en moquette sur une face et en surface plastique sur l\'autre, ce qui lui permet de s\'adapter à tous vos besoins, esthétique identique à l\'état de la série et il permet également de transporter des objets humides et sales sans endommager le coffre. S\'adapte au coffre de l\'ATECA avec motorisation Front et 4x4 avec pack tyrefit.  Applicable uniquement dans les combinaisons de PR suivantes :  - 1X0+3GA: Traction avant et sans plancher de charge - 1X0+3GE: Tracción delantera y piso de carga elevado - 1X1+1G8+3GA: tracción 4x4, paquete para averías y sin piso de carga - 1X1+1G8+3GE: tracción 4x4, paquete para averías y piso de carga elevado',NULL,NULL,NULL,'fr_FR'),(1600,1600,'Plateau de protection du coffre (semi-rigide)','plateau-de-protection-du-coffre-semi-rigide-575061201b','Pièce de protection en plastique souple à placer sur la base du coffre. S\'adapte au coffre de l\'ATECA avec motorisation Front et 4x4 avec pack tyrefit.   Applicable uniquement dans les combinaisons de PR suivantes :  - 1X0+3GA: Traction avant et sans plancher de charge - 1X0+3GE: Traction avant et plancher de charge surélevé  - 1X1+1G8+3GA : transmission 4x4, pack anomalies et sans plancher de charge  - 1X1+1G8+3GE : transmission 4x4, pack anomalies et plancher de charge surélevé',NULL,NULL,NULL,'fr_FR'),(1601,1601,'Plateau de protection du coffre à bords relevés','plateau-de-protection-du-coffre-a-bords-releves-575061201c','Pièce de protection en plastique à bords relevés à placer sur la base du coffre. Résistant et imperméable, facile à nettoyer et présentant de grandes rainures évitant le déplacement du chargement. S\'adapte au coffre de l\'ATECA avec motorisation Front et 4x4 avec pack tyrefit   Applicable uniquement dans les combinaisons de PR suivantes :  - 1X0+3GA: Traction avant et sans plancher de charge - 1X0+3GE: Traction avant et plancher de charge surélevé - 1X1+1G8+3GA : transmission 4x4, pack anomalies et sans plancher de charge  - 1X1+1G8+3GE : transmission 4x4, pack anomalies et plancher de charge surélevé',NULL,NULL,NULL,'fr_FR'),(1602,1602,'Plateau de protection du coffre (mousse)','plateau-de-protection-du-coffre-mousse-575061201d','Pièce de protection en mousse à placer sur la base du coffre. S\'adapte au coffre de l\'ATECA avec motorisation Front et 4x4 avec pack tyrefit.   Applicable uniquement dans les combinaisons de PR suivantes :  - 1X0+3GA: Traction avant et sans plancher de charge - 1X0+3GE: Traction avant et plancher de charge surélevé  - 1X1+1G8+3GA : transmission 4x4, pack anomalies et sans plancher de charge - 1X1+1G8+3GE : transmission 4x4, pack anomalies et plancher de charge surélevé',NULL,NULL,NULL,'fr_FR'),(1603,1603,'Plateau protecteur de coffre (en mousse) - Double fond','plateau-protecteur-de-coffre-en-mousse-double-fond-575061201e','Pièce de protection en mousse à placer sur la base du coffre. Il s\'adapte au plancher supérieur du coffre de l\'ATECA avec option de double fond (PR=3GN) ou avec la motorisation 4x4 et notrad.  Applicable uniquement dans les combinaisons de PR suivantes :  - 1X0+3GN: Traction avant et double fond - 1X1+3GN: Transmission 4x4 et double fond   - 1X1+1G9+3GA: transmission 4x4, roue de secours et sans plancher de charge  - 1X1+1G9+3GE: transmission 4x4, roue de secours et plancher de charge surélevé',NULL,NULL,NULL,'fr_FR'),(1604,1604,'Plateau protecteur de coffre (semi-rigide) - Double fond','plateau-protecteur-de-coffre-semi-rigide-double-fond-575061201g','Valises, caisses, meubles... Chamboulez votre monde autant que vous le souhaitez. Avec ce plateau de protection flexible pour la base du coffre, aucune charge ne vous résistera.  Il s’adapte et s’applique au plancher supérieur du coffre avec option de double fond (PR=3GN) ou avec la motorisation 4x4 et Notrad (roue de secours plate).  Logo et design de la nouvelle ATECA.',NULL,NULL,NULL,'fr_FR'),(1605,1605,'Plateau de protection du coffre à bords relevés','plateau-de-protection-du-coffre-a-bords-releves-575061201h','Pièce de protection en plastique à bords relevés à placer sur la base du coffre. Résistant et imperméable, facile à nettoyer et présentant de grandes rainures évitant le déplacement du chargement. S’adapte au coffre de l’ATECA avec motorisation Front et 4Drive (4X4) avec pack Tyrefit.',NULL,NULL,NULL,'fr_FR'),(1606,1606,'Filet de séparation du coffre','filet-de-separation-du-coffre-575061205','Votre animal de compagnie fait partie de la famille. Protégez-le durant tous vos déplacements grâce à ce filet de séparation qui divise le coffre en deux habitacles pour une sécurité renforcée. Vous pouvez monter et démonter la grille facilement quand vous le souhaitez.',NULL,NULL,NULL,'fr_FR'),(1607,1607,'Organisateur de coffre','organisateur-de-coffre-575061205a','Séparateur en aluminium permettant de diviser l\'espace dans le coffre du véhicule de manière flexible et de garantir l\'immobilité du chargement.  Il est possible de placer le séparateur le long du bord extérieur de la surface de charge avec des colliers de serrage, alors que la barre télescopique du module amovible du coffre garantit une fixation sûre Ne s\'applique qu\'aux véhicules équipés d\'un coffre à double fond.',NULL,NULL,NULL,'fr_FR'),(1608,1608,'Tapis en caoutchouc','tapis-en-caoutchouc-575061500--041','Jeu de 4 tapis en caoutchouc ATECA',NULL,NULL,NULL,'fr_FR'),(1609,1609,'Tapis en caoutchouc TPE (volant à gauche)','tapis-en-caoutchouc-tpe-volant-a-gauche-575061500041','Tapis en caoutchouc pour une protection accrue contre la saleté et les liquides. Jeu de 4 pièces. Pour véhicule avec volant à gauche (LHD). Les tapis conducteur et passager disposent d\'un système de fixation.',NULL,NULL,NULL,'fr_FR'),(1610,1610,'Housse voiture rouge','housse-voiture-rouge-575061701','Bien que votre voiture dorme au garage, elle apprécierait bien une protection supplémentaire. Avec cette housse textile d’intérieur, de couleur rouge et rehaussée du logo SEAT sur le capot, vous obtiendrez plus de tranquillité.',NULL,NULL,NULL,'fr_FR'),(1611,1611,'Pommeau off-road rouge Emoción 6v','pommeau-off-road-rouge-emocion-6-v-575064230amar','Pommeau 6 vitesses original SEAT avec design off-road qui combine aluminium et cuir, avec anneaux décoratifs rouge Emoción. Remplace le pommeau de série en utilisant la même finition que la voiture. Embout d\'installation inclus.',NULL,NULL,NULL,'fr_FR'),(1612,1612,'Pommeau off-road orange Samoa 6v','pommeau-off-road-orange-samoa-6-v-575064230ax2u','Pommeau 6 vitesses original SEAT avec design off-road qui combine aluminium et cuir, avec anneaux décoratifs orange Samoa. Remplace le pommeau de série en utilisant la même finition que la voiture. Embout d\'installation inclus.',NULL,NULL,NULL,'fr_FR'),(1613,1613,'Pommeau off-road chromé 6v','pommeau-off-road-chrome-6-v-575064230az76','Pommeau 6 vitesses original SEAT avec design off-road qui combine aluminium et cuir, avec anneaux décoratifs chromés. Remplace le pommeau de série en utilisant la même finition que la voiture. Embout d\'installation inclus.',NULL,NULL,NULL,'fr_FR'),(1614,1614,'Pare-soleil arrière','pare-soleil-arriere-575064365','Profitez des journées ensoleillées sans souffrir des fortes températures. Avec les rideaux de protection solaire pour la fenêtre du hayon, vous contrôlerez beaucoup mieux les conditions climatiques de votre voiture. Exclusives pour ce modèle.',NULL,NULL,NULL,'fr_FR'),(1615,1615,'Rideaux solaires latéraux','rideaux-solaires-lateraux-575064365a','Rideaux de protection pour fenêtres latérales, à la fois pour les portes et glaces de custode arrière, exclusifs sur ce modèle. Les rideaux offrent une protection contre le soleil dans la zone des passagers arrière, tout en améliorant les conditions climatiques du véhicule. Ensemble composé de 4 rideaux',NULL,NULL,NULL,'fr_FR'),(1616,1616,'Décoration console centrale rouge Emoción avec Kessy (volant à gauche)','decoration-console-centrale-rouge-emocion-avec-kessy-volant-a-gauche-575064740amar','Décoration console centrale rouge Emoción avec Kessy (volant à gauche). Tout inclus pour la pose.',NULL,NULL,NULL,'fr_FR')