 Crossover Silver, réalisé en ABS. Il faut également commander un pot de nettoyant avant peinture SEAT (réf. D 195850A1) et un pot de primaire (réf. D 822150A1).',NULL,NULL,NULL,'fr_FR'),(1640,1640,'Moulure avant de grille','moulure-avant-de-grille-575071005','Ces petites touches que l’on ne perçoit pas mais qui font la différence. Cette moulure avant couvre le périmètre de la grille frontale inférieure tout en apportant élégance et robustesse. En couleur Crossover Silver et réalisée en ABS. Il faut aussi commander un pot de nettoyant avant peinture SEAT (réf. D 195850A1) et un pot de primaire (réf. D 822150A1). Accessoire non compatible avec le modèle ATECA FR.',NULL,NULL,NULL,'fr_FR'),(1641,1641,'Barres de toit','barres-de-toit-575071151','Planche de surf ou skis ? Votre SEAT s’adapte à votre façon de vivre. Posez cet ensemble de barres de toit avant et arrière et allez où vous le souhaitez.  Grâce au système antivol intégré, plus d’inquiétudes à avoir. Accessoire adapté uniquement aux véhicules équipés de barres latérales de série (y compris les versions équipées de toit en verre). Charge maximale transportable 75 kg.',NULL,NULL,NULL,'fr_FR'),(1642,1642,'Feuille pour seuil de porte','feuille-pour-seuil-de-porte-575071310','Feuille adhésive noire, avec le nom du modèle, adaptée à la forme du seuil de porte pour protéger les zones d\'accès des passagers. Instructions et éléments de montage inclus.',NULL,NULL,NULL,'fr_FR'),(1643,1643,'Kit adhésif extérieur avec bande bleu Connect','kit-adhesif-exterieur-avec-bande-bleu-connect-575071316up7','Ensemble d\'adhésifs décoratifs extérieurs composé de : 2 pièces sur le capot, 2 lignes de chaque côté des portes et sur le hayon, vinyle de couleur anthracite avec une bande inférieure bleu Connect. L\'ensemble inclut les instructions, une spatule et un sachet de savon pour procéder à la pose avec de l\'eau.',NULL,NULL,NULL,'fr_FR'),(1644,1644,'Kit adhésif extérieur avec bande orange Samoa','kit-adhesif-exterieur-avec-bande-orange-samoa-575071316x2u','Ensemble d\'adhésifs décoratifs extérieurs composé de : 2 pièces sur le capot, 2 lignes de chaque côté des portes et sur le hayon, vinyle de couleur anthracite avec une bande inférieure orange Samoa. L\'ensemble inclut les instructions, une spatule et un sachet de savon pour procéder à la pose avec de l\'eau.',NULL,NULL,NULL,'fr_FR'),(1645,1645,'Kit adhésif extérieur avec bande argentée','kit-adhesif-exterieur-avec-bande-argentee-575071316z76','Ensemble d\'adhésifs décoratifs extérieurs composé de : 2 pièces sur le capot, 2 lignes de chaque côté des portes et sur le hayon, vinyle de couleur anthracite avec une bande inférieure argentée. L\'ensemble inclut les instructions, une spatule et un sachet de savon pour procéder à la pose avec de l\'eau.',NULL,NULL,NULL,'fr_FR'),(1646,1646,'Moulure latérale de porte','moulure-laterale-de-porte-575071328z76','Moulure latérale composée de 2 jeux de 2 pièces à poser au bas des portes. Peintes couleur silver.  Réalisées en ABS, elles apportent de la robustesse et une touche design à la zone latérale  1 pot de cleaner Seat, référence D  195850A1, ainsi qu’un pot de primer Seat, référence D  822150A1, doivent être commandés séparément',NULL,NULL,NULL,'fr_FR'),(1647,1647,'Moulure hayon','moulure-hayon-575071360','Soulignez le design de l’arrière de votre SEAT Ateca. Cette moulure adhésive pour le hayon couleur Crossover Silver en rehaussera les lignes. Un pot de nettoyant avant peinture SEAT (réf. D 195850A1) doit être commandé séparément.',NULL,NULL,NULL,'fr_FR'),(1648,1648,'Insert décoratif pare-chocs arrière couleur argent Crossover','insert-decoratif-pare-chocs-arriere-couleur-argent-crossover-575071365az76','Insert décoratif en plastique couleur argent Crossover à poser sur le cache décoratif du pare-chocs arrière. Instructions de pose incluses.',NULL,NULL,NULL,'fr_FR'),(1649,1649,'Insert décoratif pare-chocs avant couleur Mystery Blue','insert-decoratif-pare-chocs-avant-couleur-mystery-blue-575071365u