lut pas les pneus.',NULL,NULL,NULL,'fr_FR'),(1656,1656,'Jante en alliage 19\'\' ANETO Diamantée Silver','jante-en-alliage-19-aneto-diamantee-silver-575071499e1bc','Jante en alliage 19\'\'. Dimensions : 8J x 19”, ET45, 5 x 112 mm. Couleur : Diamantée Silver.  Il est recommandé de poser des pneus avec rebord de protection de jante (FSL) Prix à l’unité, n’inclut pas les pneus.',NULL,NULL,NULL,'fr_FR'),(1657,1657,'Jante en alliage 19” couleur noir mat','jante-en-alliage-19-couleur-noir-mat-575071499na5','Jante en alliage diamantée de 19\" et couleur noire mate de conception exclusive SEAT. Ses dimensions sont 8J x 19\", ET45, 5 x 112 mm. Il est recommandé de poser des pneus avec rebord de protection de jante (FSL).  Prix à l’unité, n’inclut pas les pneus ni les enjoliveurs.',NULL,NULL,NULL,'fr_FR'),(1658,1658,'Jante en alliage 19\" ANETO Diamantée rouge émotion','jante-en-alliage-19-aneto-diamantee-rouge-emotion-575071499s3h','Jante en alliage 19\'\'. Dimensions : 8J x 19”, ET45, 5 x 112 mm. Couleur : Diamantée rouge émotion  Il est recommandé de poser des pneus avec rebord de protection de jante (FSL) Prix à l’unité, n’inclut pas les pneus.',NULL,NULL,NULL,'fr_FR'),(1659,1659,'Jante alliage 19\" ANETO couleur diamantée Mystery Blue','jante-alliage-19-aneto-couleur-diamantee-mystery-blue-575071499sr5','Jante en alliage 19\'\'. Dimensions : 8J x 19”, ET45, 5 x 112 mm. Couleur : Diamantée Mystery Blue.  Il est recommandé de poser des pneus avec rebord de protection de jante (FSL) Prix à l’unité, n’inclut pas les pneus.',NULL,NULL,NULL,'fr_FR'),(1660,1660,'Décoration pare-chocs avant (cache)','decoration-pare-chocs-avant-cache-575071617','Décoration pour pare-chocs avant avec design off-road PUR imprimé et peint (cuir décoratif, caches, système de fixation complet et support interne 575071756 inclus) ; instructions de montage incluses.  La pose supplémentaire de l\'insert de couleur est nécessaire pour offrir le contraste souhaité.  Le kit de collage doit être commandé séparément Réf. 000071781B  575071365  UP7  -  Insert pour décoration de pare-chocs avant couleur Mystery Blue  575071365  Z76  -  Insert pour décoration de pare-chocs avant couleur Crossover Silver  575071365  S3H  - Insert pour décoration de pare-chocs avant couleur Emoción Red  575071365  X2U  - Insert pour décoration de pare-chocs avant couleur Samoa Orange  ATTENTION : pour l’Ateca XCellence à partir de MY18 réviser les instructions de montage disponibles sur Oparts.  Cet accessoire n’est pas compatible avec Ateca FR',NULL,NULL,NULL,'fr_FR'),(1661,1661,'Décoration pare-chocs arrière (tuyau d\'échappement invisible) - cache','decoration-pare-chocs-arriere-tuyau-dechappement-invisible-cache-575071617a','Décoration pour pare-chocs arrière avec design off-road PUR imprimé et peint. Cache pour attache de remorque Réf. 575071720 inclus. Instructions de pose incluses. La pose supplémentaire de l\'insert de couleur est nécessaire pour offrir le contraste souhaité.     575071365A  UP7 -    Insert décoratif pare-chocs arrière couleur bleu Connect      575071365A  Z76 -    Insert décoratif pare-chocs arrière couleur argent Crossover      575071365A  S3H -    Insert décoratif pare-chocs arrière couleur rouge Emoción      575071365A  X2U -    Insert décoratif pare-chocs arrière couleur orange Samoa',NULL,NULL,NULL,'fr_FR'),(1662,1662,'Décoration pare-chocs arrière (double tuyau d\'échappement) - cache','decoration-pare-chocs-arriere-double-tuyau-dechappement-cache-575071617b','Décoration pour pare-chocs arrière avec design off-road PUR imprimé et peint. Instructions de pose incluses. La pose supplémentaire de l\'insert de couleur est nécessaire pour offrir le contraste souhaité.     575071365A  UP7 -    Insert décoratif pare-chocs arrière couleur bleu Connect      575071365A  Z76 -    Insert décoratif pare-chocs arrière couleur argent Crossover      575071365A  S3H -    Insert décoratif pare-chocs arrière couleur rouge Emoción      575071365A  X2U -    Insert décoratif pare-chocs arrière couleur orange Samoa',NULL,NULL,NULL,'fr_FR'),(1663,1663,'Décoration pare-chocs arrière (tuyau d\'échappement simple, 2 orifices) - c','decoration-pare-chocs-arriere-tuyau-dechappement-simple-2-orifices-c-575071617c','Décoration pour pare-chocs arrière avec design off-road PUR imprimé et peint.  Instructions de pose incluses. Incompatible avec la pédale virtuelle. La pose supplémentaire de l\'insert de couleur est nécessaire pour offrir le contraste souhaité.    575071365A  UP7 - Insert décoratif pare-chocs arrière couleur bleu Mystery    575071365A  Z76 - Insert décoratif pare-chocs arrière couleur argent Crossover    575071365A  S3H - Insert décoratif pare-chocs arrière couleur rouge Emoción    575071365A  X2U - Insert décoratif pare-chocs arrière couleur orange Samoa    Le système de double tuyau d’échappement ne s’applique pas aux motorisations 4DRIVE (transmission intégrale).    Cet accessoire n’est pas compatible avec Ateca FR.',NULL,NULL,NULL,'fr_FR'),(1664,1664,'Seuil de porte inox','seuil-de-porte-inox-575071691','Seuil de porte en acier inoxydable placé sur la zone d\'entrée des portes avant par un ruban adhésif. Rainure décorative peinte en noire et logo de la voiture inclus.',NULL,NULL,NULL,'fr_FR'),(1665,1665,'Seuils de portes éclairés','seuils-de-portes-eclaires-575071691a','Set de deux seuils de porte pour la zone d\'accès, avec le nom du modèle éclairé.  L\'éclairage s\'active pendant 40 secondes lors de l\'ouverture de la porte et reste éteint lorsque la porte est fermée.  Sans installation électrique.',NULL,NULL,NULL,'fr_FR'),(1666,1666,'Tuyau d\'échappement Sport 1,6 l tdi 85 kW / 1,0 l tsi 85 kW','tuyau-dechappement-sport-16-l-tdi-85-k-w-10-l-tsi-85-k-w-575072000','Le double échappement pour Styling Kit Ateca ne peut pas être monté sur les véhicules fabriqués à partir de MY19 (Depuis le 31/07/2018).  Troisième section d\'échappement formée de : marmite, supports, tuyaux d\'échappement, 2 sorties finition polie et kit de pose. Instructions incluses. Valable pour les versions 1,6 l TDI 85 kW et 1,0 l TSI 85 kW.    Le système de double tuyau d\'échappement ne s\'applique pas aux motorisations 4DRIVE (transmission intégrale) ni à la pédale virtuelle.  Il n\'est pas possible de poser le tuyau d\'échappement Sport sans le combiner au Styling Kit arrière. Il faut également commander la référence 575071617C.',NULL,NULL,NULL,'fr_FR'),(1667,1667,'Tuyau d\'échappement Sport 1,4 l ACT 110 kW','tuyau-dechappement-sport-14-l-act-110-k-w-575072000b','Le double échappement pour Styling Kit Ateca ne peut pas être monté sur les véhicules fabriqués à partir de MY19 (Depuis le 31/07/2018).  Troisième section d\'échappement formée de : marmite, supports, tuyaux d\'échappement, 2 sorties finition polie et kit de pose. Instructions incluses. Valable pour la version 1.4 l ACT 110 kW. Le système de double tuyau d\'échappement ne s\'applique pas aux motorisations 4DRIVE (transmission intégrale) ni à la pédale virtuelle.  Il n\'est pas possible de poser le tuyau d\'échappement Sport sans le combiner au Styling Kit arrière. Il faut également commander la référence 575071617C.',NULL,NULL,NULL,'fr_FR'),(1668,1668,'Décoration du volant cuir rouge Emoción','decoration-du-volant-cuir-rouge-emocion-575072390as3h','Décoration du volant peinte en couleur rouge Emoción pour la version cuir du volant. Elle remplace la pièce d\'origine.  Non valable pour la version FR.',NULL,NULL,NULL,'fr_FR'),(1669,1669,'Décoration du volant cuir bleu Connect','decoration-du-volant-cuir-bleu-connect-575072390aup7','Décoration du volant peinte en couleur bleu Connect pour la version cuir du volant. Elle remplace la pièce d\'origine.  Non valable pour la version FR.',NULL,NULL,NULL,'fr_FR'),(1670,1670,'Décoration du volant cuir orange Samoa','decoration-du-volant-cuir-orange-samoa-575072390ax2u','Décoration du volant peinte en couleur orange Samoa pour la version cuir du volant. Elle remplace la pièce d\'origine.  Non valable pour la version FR.',NULL,NULL,NULL,'fr_FR'),(1671,1671,'Décoration du volant argent','decoration-du-volant-argent-575072390az76','Décoration du volant peinte en couleur argent Crossover pour la version cuir du volant. Elle remplace la pièce d\'origine.  Non valable pour la version FR.',NULL,NULL,NULL,'fr_FR'),(1672,1672,'Décoration volant rouge Emotion','decoration-volant-rouge-emotion-575072390s3h','Décoration du volant peinte en couleur rouge Emotion pour la version PUR du volant. Elle remplace la pièce d\'origine.      Non valable pour la version FR.',NULL,NULL,NULL,'fr_FR'),(1673,1673,'Décoration volant orange Samoa','decoration-volant-orange-samoa-575072390x2u','Décoration du volant peinte en couleur orange Samoa pour la version PUR du volant. Elle remplace la pièce d\'origine.      Non valable pour la version FR.',NULL,NULL,NULL,'fr_FR'),(1674,1674,'Décoration du volant argent Crossover','decoration-du-volant-argent-crossover-575072390z76','Décoration du volant peinte en couleur argent Crossover pour la version PUR du volant. Elle remplace la pièce d\'origine.    Non valable pour la version FR.',NULL,NULL,NULL,'fr_FR'),(1675,1675,'Rétroviseur extérieur orange Samoa','retroviseur-exterieur-orange-samoa-575072530x2u','Boîtier du rétroviseur extérieur peint en couleur orange Samoa. Le pack des deux pièces est fourni. Il remplace la pièce d\'origine',NULL,NULL,NULL,'fr_FR'),(1676,1676,'Rétroviseur extérieur argent','retroviseur-exterieur-argent-575072530z76','Boîtier du rétroviseur extérieur peint en couleur argent Crossover. Le pack des deux pièces est fourni. Il remplace la pièce d\'origine',NULL,NULL,NULL,'fr_FR'),(1677,1677,'Bavettes garde-boue arrière','bavettes-garde-boue-arriere-575075101','Jeu de bavettes garde-boue arrière. Protègent le pare-chocs arrière de matériaux projetés par les roues arrière pendant la marche.  Ne s\'applique pas à Ateca FR.',NULL,NULL,NULL,'fr_FR'),(1678,1678,'Bavettes garde-boue arrière FR','bavettes-garde-boue-arriere-fr-575075101a','Jeu de bavettes garde-boue arrière. Protègent le pare-chocs arrière de matériaux projetés par les roues arrière pendant la marche. Ne s’appliquent qu’à l’Ateca FR.',NULL,NULL,NULL,'fr_FR'),(1679,1679,'Bavettes garde-boue avant','bavettes-garde-boue-avant-575075111','Chaque centimètre de votre Ateca compte. Ce jeu de bavettes pare-boue avant protègera la carrosserie contre d’éventuelles projections de matériaux par les roues pendant la conduite. Accessoire non disponible pour l’Ateca FR.',NULL,NULL,NULL,'fr_FR'),(1680,1680,'Bavettes garde-boue avant FR','bavettes-garde-boue-avant-fr-575075111a','Jeu de bavettes garde-boue avant. Protègent la carrosserie de matériaux projetés par les roues avant pendant la marche. Compatible uniquement avec les finitions FR et X-Perience',NULL,NULL,NULL,'fr_FR'),(1681,1681,'Attache de remorque - Pour véhicules fabriqués jusqu\'à s. 48/2018','attache-de-remorque-pour-vehicules-fabriques-jusqua-s-482018-575092160b','Pas applicable sur les CUPRA Ateca (575092160C).  Pour véhicules fabriqués jusqu\'à s. 48/2018  Attache de remorque pliante manuelle et amovible électrique. Pour véhicules sans prééquipement, accessoire à combiner avec :  - Kit électrique (575055204A) - Centrale électrique (référence selon date de fabrication du véhicule)  Pour poser l\'attache, il faut remplacer le revêtement côté passager comme suit :   - Pour coffre confort (PR 5A2) ou coffre confort avec cache de service (PR 5A7), le revêtement latéral 575867428 CA9 doit être remplacé par les références :   Revêtement latéral : 575867428B CA9  Cache interrupteur : 5G0868345 81U  Interrupteur : 3G0959511A WHS   - Pour coffre avec rangement (PR 5A5), le revêtement latéral 575867428A DXO doit être remplacé par les références :  Revêtement latéral : 575867428C DXO  Cache interrupteur : 5G0868345 81U  Interrupteur : 3G0959511A WHS   Pour tous les véhicules équipés de préinstallation (PR 1D8), il faut exécuter le code 3446F pour passer au PR #D8 (Rééquipement dispositif d\'attelage rigide) et que la BCM reconnaisse le crochet.',NULL,NULL,NULL,'fr_FR'),(1682,1682,'Attelage de remorque','attelage-de-remorque-575092160c','Attelage de remorque rétractable manuel et amovible électrique pour ATECA PA.  Le revêtement latéral et l’interrupteur doivent être commandés séparément.  En combinaison avec : Kit électrique pour véhicules sans prééquipement et centrale électrique pour véhicules sans prééquipement VOIR ETKA',NULL,NULL,NULL,'fr_FR'),(1683,1683,'Attache de remorque - Pour véhicules fabriqués à partir de s. 48/2018','attache-de-remorque-pour-vehicules-fabriques-a-partir-de-s-482018-575092160d','Not applicable to CUPRA Ateca (575092160C).  Attache de remorque pliante manuelle et amovible électrique. Pour véhicules sans prééquipement, accessoire à combiner avec :  - Kit électrique (575055204A) - Centrale électrique (référence selon date de fabrication du véhicule)  Pour poser l\'attache, il faut remplacer le revêtement côté passager comme suit :   - Pour coffre confort (PR 5A2) ou coffre confort avec cache de service (PR 5A7), le revêtement latéral 575867428 CA9 doit être remplacé par les références :   Revêtement latéral : 575867428B CA9  Cache interrupteur : 5G0868345 81U  Interrupteur : 3G0959511A WHS   - Pour coffre avec rangement (PR 5A5), le revêtement latéral 575867428A DXO doit être remplacé par les références :  Revêtement latéral : 575867428C DXO  Cache interrupteur : 5G0868345 81U  Interrupteur : 3G0959511A WHS   Pour tous les véhicules équipés de préinstallation (PR 1D8), il faut exécuter le code 3446F pour passer au PR #D8 (Rééquipement dispositif d\'attelage rigide) et que la BCM reconnaisse le crochet.',NULL,NULL,NULL,'fr_FR'),(1684,1684,'Tapis en tissu (volant à gauche)','tapis-en-tissu-volant-a-gauche-575863011loe','Moquette de série avec face inférieure antidérapante. Jeu de 4 pièces. Pour véhicule avec volant à gauche (LHD). Tapis conducteur et passager dotés d\'un système de fixation.',NULL,NULL,NULL,'fr_FR'),(1685,1685,'Tapis Velpic (volant à gauche)','tapis-velpic-volant-a-gauche-576061675c041','Moquette haute densité avec face inférieure en caoutchouc. Jeu de 4 pièces. Pour véhicule avec volant à gauche (LHD). Tapis conducteur et passager disposant d\'un système de fixation.',NULL,NULL,NULL,'fr_FR'),(1686,1686,'Filet entre les sièges','filet-entre-les-sieges-5f0017221a','Filet élastique avec différents séparateurs pour le stockage. Il se fixe entre les sièges avants. Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1687,1687,'Clignotants des rétroviseurs extérieurs LED dynamiques','clignotants-des-retroviseurs-exterieurs-led-dynamiques-5f0052215','Jeu de clignotants dynamiques complets.  Les clignotants dynamiques offrent un aspect moderne et attireront les regards vers votre SEAT.  Technologie LED très intense à votre disposition pour permettre une visibilité à la fois sécurisée et attrayante durant la conduite.  Les feux LED s’allument successivement de l’intérieur vers l’extérieur dans la direction dans laquelle vous tournez. Cela créée un effet d’optique spécial, offrant un aspect sportif à votre véhicule.  Équipement simple, permettant une installation facile et rapide.',NULL,NULL,NULL,'fr_FR'),(1688,1688,'Kit de détecteurs arrière d\'aide au stationnement - 4 capteurs','kit-de-detecteurs-arriere-daide-au-stationnement-4-capteurs-5f0054752b','Système électronique anti-collision, installé dans le pare-choc arrière et composé de 4 capteurs, câblage, unité centrale, avertisseur, supports et un tube de colle. Instructions de montage comprises. Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1689,1689,'SEAT FULL LINK','seat-full-link-5f0054830','Non valide pour les autoradios MIB Gen.3 (MIB3).  Connectez votre mobile à votre SEAT grâce au système Full Link et faites de votre voiture votre meilleur compagnon de voyage. Accédez à toute votre musique, votre agenda, vos cartes et aux applications que vous utilisez le plus. Il fonctionne aussi bien sous Android que sous iOS grâce aux technologies MirrorLink™, Android Auto™ et Apple CarPlay™.  Pour activer le système Full Link, veuillez contacter le service agréé SEAT.  Cette fonctionnalité est activée via les codes d’activation indiqués dans le manuel d’instructions.   Compatible avec les systèmes d’infodivertissement suivants à partir de la semaine 22/15 (MY2016) : « Radio Standard (Gen2 GP) » - PR : I8F « Radio Standard (Gen2) » - PR : I8E   « Radio Entry Plus / Basic (Gen2 GP) » - PR : I8C « Radio High (Gen2) » - PR : I8H « Radio Entry Plus / Basic (Gen2) » - PR : I8B  Pièces supplémentaires non incluses, à solliciter dans les cas suivants : IBIZA NF 2017 : Aucune pièce supplémentaire nécessaire. LEON PA : Aucune pièce supplémentaire nécessaire. ATECA : Aucune pièce supplémentaire nécessaire. LEON SE37X : Connecteur (5G0 035 222E) + Cache (8V0 035 750D). TOLEDO : Aucune pièce supplémentaire nécessaire. IBIZA : Connecteur (5G0 035 222E) + Cache (8V0 035 750D). ALHAMBRA (JUSQU’À cw45/15) : Connecteur (1Q0 035 346B) + Cache (4E0 035 750F).  ALHAMBRA (À PARTIR de cw45/15) : Connecteur (5G0 035 222E) + Cache (8V0 035 750D). MII : Full Link non disponible. TARRACO : Aucune pièce supplémentaire nécessaire.  Ces références ne font pas partie des accessoires et doivent être commandées séparément.   IBIZA/ARONA à partir de la semaine 18/2018 ; également valable pour la version Media System Color (Entry Plus).  Fonctionnalité Apple Car Play soumise à disponibilité sur les marchés.',NULL,NULL,NULL,'fr_FR'),(1690,1690,'Kit électronique 13 bornes sans prééquipement - pour véhicules fabriqués j','kit-electronique-13-bornes-sans-preequipement-pour-vehicules-fabriques-j-5f0055204a','Kit électrique 13 bornes pour attache de remorque pour véhicules sans prééquipement. Appareil de commande non inclus, À commander en option (voir informations dans l\'ETKA Pièces de rechange Page texte 945-XX) Incompatible avec l\'option 1M5 (à partir de la sem. 45/13). Pour véhicules fabriqués jusqu\'à s. 22/2014. Cet accessoire n\'est pas applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1691,1691,'Kit électronique 13 bornes avec prééquipement (PR 1D8) - pour véhicules fa','kit-electronique-13-bornes-avec-preequipement-pr-1-d-8-pour-vehicules-fa-5f0055204b','Kit électrique d\'origine 13 bornes pour attache de remorque pour véhicules avec prééquipement électrique (PR 1D8). Non compatible avec la finition Cupra. Pour véhicules fabriqués jusqu\'à s. 22/2014.',NULL,NULL,NULL,'fr_FR'),(1692,1692,'Kit électronique 13 bornes sans prééquipement - pour véhicules fabriqués j','kit-electronique-13-bornes-sans-preequipement-pour-vehicules-fabriques-j-5f0055204c','Kit électrique 13 bornes pour attache de remorque pour véhicules sans prééquipement. Appareil de commande non compris Demande l\'activation (voir l\'information dans ETKA Pièces de rechange, page texte 945-XX). Non compatible avec l\'option 1D8. Non compatible avec la finition Cupra. Pour véhicules fabriqués jusqu\'à s. 22/2014.',NULL,NULL,NULL,'fr_FR'),(1693,1693,'Kit électronique 13 bornes avec prééquipement (PR 1M5) - pour véhicules fa','kit-electronique-13-bornes-avec-preequipement-pr-1-m-5-pour-vehicules-fa-5f0055204d','Installation électrique de 13 pôles en combinaison avec l\'attache remorque pour véhicules prééquipés en usine PR – 1M5 (à partir de la sem. 45/13). Appareil de commande non compris Demande l\'activation (voir l\'information dans ETKA Pièces de rechange, page texte 945-XX). Non compatible avec la finition Cupra. - Kit électrique pour véhicules fabriqués à partir de s. 22/2014. À partir de VSSZZZ5FZFR000001',NULL,NULL,NULL,'fr_FR'),(1694,1694,'Kit électronique 13 bornes sans prééquipement - pour véhicules fabriqués à','kit-electronique-13-bornes-sans-preequipement-pour-vehicules-fabriques-a-5f0055204e','Kit électrique 13 bornes pour attache de remorque pour véhicules sans prééquipement. Appareil de commande non inclus, À commander en option (voir informations dans l\'ETKA Pièces de rechange Page texte 945-XX) Non compatible avec l\'option 1M5 à partir de la sem. 45/13 Cet accessoire n\'est pas applicable à la Leon Cupra. - Kit électrique pour véhicules fabriqués à partir de s. 22/2014. À partir de VSSZZZ5FZFR000001',NULL,NULL,NULL,'fr_FR'),(1695,1695,'Kit électronique 13 bornes avec prééquipement (PR 1D8) - pour véhicules fa','kit-electronique-13-bornes-avec-preequipement-pr-1-d-8-pour-vehicules-fa-5f0055204f','Kit électrique d\'origine 13 bornes pour attache de remorque pour véhicules avec prééquipement électrique (PR 1D8). Non compatible avec la finition Cupra. - Kit électrique pour véhicules fabriqués à partir de s. 22/2014. À partir de VSSZZZ5FZFR000001',NULL,NULL,NULL,'fr_FR'),(1696,1696,'Kit électronique 13 bornes sans prééquipement - pour véhicules fabriqués à','kit-electronique-13-bornes-sans-preequipement-pour-vehicules-fabriques-a-5f0055204g','Kit électrique 13 bornes pour attache de remorque pour véhicules sans prééquipement. Appareil de commande non compris Demande l\'activation (voir l\'information dans ETKA Pièces de rechange, page texte 945-XX). Non compatible avec l\'option 1D8. Non compatible avec la finition Cupra. - Kit électrique pour véhicules fabriqués à partir de s. 22/2014. À partir de VSSZZZ5FZFR000001  Pour les véhicules fabriqués à partir de Juin 2016, il faut également demander le câble 5F0055712 afin de pouvoir connecter correctement le boîtier de fusibles.',NULL,NULL,NULL,'fr_FR'),(1697,1697,'Seat Media System Standard Mib2 row1 (V6)','seat-media-system-standard-mib-2-row-1-v-6-5f0060884bd','Ce produit contient une carte SD avec les données de navigation Multi-région 1 et les codes de la licence d\'activation des données pour votre véhicule SEAT.  Les données contiennent les régions suivantes : Région 1 : Turquie* Région 2 : Brunei*, Indonésie*, Malaisie*, Philippines*, Singapour*, Thaïlande* Région 3 : Inde, Région 4 : Chili* * partiellement  Non valable pour le Tarraco FR',NULL,NULL,NULL,'fr_FR'),(1698,1698,'Seat Media System Standard Mib2 row2 (V6)','seat-media-system-standard-mib-2-row-2-v-6-5f0060884be','Ce produit contient une carte SD avec les données de navigation Multi-région 1 et les codes de la licence d\'activation des données pour votre véhicule SEAT. Les données contiennent les régions suivantes : Région 1 : Australie, Nouvelle-Zélande Région 2 : Israël Région 3 : Botswana*, Lesotho*, Mozambique*, Namibie*, Réunion*, Swaziland*, Afrique du Sud* Région 4 : Argentine*, Brésil*, Mexique* Région 5 : Bahreïn, Jordanie, Qatar, Koweït, Oman, Arabie Saoudite, Émirats Arabes Unis  * partiellement  Non valable pour le Tarraco FR',NULL,NULL,NULL,'fr_FR'),(1699,1699,'Seat Navigation System Standard Mib2 Europa (V8)','seat-navigation-system-standard-mib-2-europa-v-8-5f0060884cm','Ce produit contient une carte SD avec les données de navigation Europe (version 8 cartes semaine 48/20) et les codes de la licence d’activation des données pour votre véhicule SEAT.   La cartographie comprend 6,3 millions d\'entrées d\'information avec des hôtels, des restaurants, des parkings publics, des postes à essence, des aéroports, des gares, des monuments et d\'autres lieux d\'intérêt.   Les données présentes dans le matériel d’informations incluent, en plus des cartes de navigation, des données relatives aux canaux d’information sur l’état de la circulation, ou canaux TMC (Traffic Message Channel), pour l’Albanie*, l’Allemagne, Andorre, l’Autriche, la Belgique, la Biélorussie*, la Bosnie-Herzégovine*, la Bulgarie*, la Cité du Vatican, la Croatie, le Danemark, la Slovaquie*, la Slovénie*, l’Espagne, l’Estonie*, la Finlande, la France, Gibraltar, la Grèce, la Hongrie, l’Irlande, l’Islande, l’Italie, le Kosovo*, la Lettonie*, le Liechtenstein, la Lituanie*, le Luxembourg, Malte*, la Macédoine*, la Moldavie*, Monaco, le Monténégro*, la Norvège, les Pays-Bas, la Pologne*, le Portugal, le Royaume-Uni, la République Tchèque, la Roumanie  Non valable pour le Tarraco FR.',NULL,NULL,NULL,'fr_FR'),(1700,1700,'Film protecteur pour pare-chocs arrière','film-protecteur-pour-pare-chocs-arriere-5f0061197','Feuille adhésive transparente adaptée à la forme du pare-chocs arrière pour protéger la zone de chargement. 0\" Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1701,1701,'Plateau de protection du coffre','plateau-de-protection-du-coffre-5f0061205f','Pièce de protection en caoutchouc souple à placer sur la base du coffre. Il s\'adapte parfaitement aux dimensions du coffre Pratique et résistant Le plateau pour coffre protège de la saleté et des fuites de liquides grâce à son périmètre important. Résistant aux acides, lavable et antidérapant. Cet accessoire est applicable à la Leon Cupra mais ne s\'applique pas aux véhicules avec motorisation au gaz naturel GNV et/ou avec double plancher de coffre de série.   Uniquement valable pour les véhicules de la semaine 22/2015',NULL,NULL,NULL,'fr_FR'),(1702,1702,'Plateau de protection du coffre FOAM','plateau-de-protection-du-coffre-foam-5f0061205g','Plateau de protection FOAM pratique et résistant. Il s\'adapte parfaitement au coffre et le protège de la saleté et des liquides pouvant s\'y renverser au cours du transport. Cet accessoire est applicable à la Leon Cupra mais ne s\'applique pas aux véhicules avec motorisation au gaz naturel GNV et/ou avec double plancher de coffre de série. Uniquement valable pour les véhicules de la semaine 22/2015',NULL,NULL,NULL,'fr_FR'),(1703,1703,'Tapis en caoutchouc','tapis-en-caoutchouc-5f0061500--041','Jeu de 4 tapis caoutchouc LEON 5P/ST PA',NULL,NULL,NULL,'fr_FR'),(1704,1704,'Jeu de tapis en caoutchouc noir','jeu-de-tapis-en-caoutchouc-noir-5f0061500041','Tapis en caoutchouc pour une protection accrue contre la saleté et les liquides. Fabriqué en caoutchouc avec bords de 10 mm. Kit composé de 4 pièces (deux avant et deux arrière) de couleur noire. Système de fixation d\'origine SEAT, qui évite leur déplacement en cours de route. Cet accessoire est applicable à la Leon Cupra. Valide uniquement pour les véhicules avec volant à gauche (LHD).',NULL,NULL,NULL,'fr_FR'),(1705,1705,'Jeu de tapis en caoutchouc noir','jeu-de-tapis-en-caoutchouc-noir-5f0061500a041','Housse tissu élastique en polyester avec fil protecteur contre les torsions et les froissements. Couleur rouge avec impression du logo SEAT sur la face avant.',NULL,NULL,NULL,'fr_FR'),(1706,1706,'Jeu de tapis Velpic noir','jeu-de-tapis-velpic-noir-5f0061675041','Tapis en caoutchouc pour une protection accrue contre la saleté et les liquides. Fabriqués en caoutchouc avec bords de 10 mm. Kit composé de 4 pièces (deux avant et deux arrière) de couleur noire.  Système de fixation d\'origine SEAT, qui évite leur déplacement en cours de route  Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1707,1707,'Housse voiture rouge','housse-voiture-rouge-5f0061701','Housse tissu élastique en polyester avec fil protecteur contre les torsions et les froissements. Couleur rouge avec impression du logo SEAT sur la face avant. Elle s\'adapte parfaitement à la forme de la voiture. Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1708,1708,'Housse voiture noire','housse-voiture-noire-5f0061701a','Housse tissu élastique en polyester avec fil protecteur contre les torsions et les froissements. Housse noire avec bordures et rétroviseurs de couleur grise, le logo de SEAT est sérigraphié à l\'avant et le nom du modèle sur la partie arrière. Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1709,1709,'Housse voiture grise','housse-voiture-grise-5f0061701b','Housse tissu élastique en polyester avec fil protecteur contre les torsions et les froissements. Housse noire avec bordures et rétroviseurs de couleur noire, le logo de SEAT est sérigraphié à l\'avant et le nom du modèle sur la partie arrière. Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1710,1710,'Pédales sport','pedales-sport-5f0064200','Découvrez une