icable sur les versions Ecomotive Ce pare-choc avant n\'est pas applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1723,1723,'Barres de toit','barres-de-toit-5f0071100','Ensemble de barres. Également valable pour les versions avec toit panoramique. Les barres se fixent sur le toit du véhicule et disposent d\'un système antivol.  En combinaison avec : Porte-vélos réf. 5F9071128 Porte-surf réf. 000071120HA Malle porte-bagages 450 l réf. 000071180A Malle porte-bagages 420 l réf. 000071200S Malle porte-bagages 400 l réf. 000071200R  Cet accessoire est applicable à la Leon Cupra.',NULL,NULL,NULL,'fr_FR'),(1724,1724,'Barres de toit','barres-de-toit-5f0071100a','Ensemble de barres de transport avant et arrière. Également valable pour les versions avec toit panoramique. Les barres se fixent sur le toit du véhicule et disposent d\'un système antivol. En combinaison avec : Porte-vélo réf. 5F9071128 Porte-surf réf. 000071120HA Compatibles avec : Malle porte-bagages 450 l réf. 000071180A Malle porte-bagages 420 l réf. 000071200S Malle porte-bagages 400 l réf. 000071200R Cet accessoire est applicable à la Leon Cupra.',NULL,NULL,NULL,'fr_FR'),(1725,1725,'Feuille seuil de porte 5 portes','feuille-seuil-de-porte-5-portes-5f0071310','Feuille adhésive noire adaptée à la forme du seuil de porte pour protéger les zones d\'accès des passagers.  Personnalisée selon le modèle du véhicule   Inclut les instructions et les éléments de montage.   Cet accessoire n\'est pas applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1726,1726,'Jante en alliage 18\" Noir','jante-en-alliage-18-noir-5f0071490041','Du fait de la norme WLTP, pour les voitures fabriquées à partir de MY19, cette jante ne peut être posée que sur la version FR.  Jante en alliage 18\" Couleur : noir Dimensions : 7,5x18\'\' Ancrage : 5x112 mm ET51  Inclut un cache-moyeu avec logo SEAT  Cet accessoire ne s\'applique pas à la Leon Cupra   Prix à l’unité, n’inclut pas les pneus.',NULL,NULL,NULL,'fr_FR'),(1727,1727,'Jante en allia