','Ensemble de barres de transport transversales avant et arrière comprenant un système antivol. Se fixe de chaque côté du toit du véhicule. NE convient PAS aux modèles équipés de toit panoramique. Charge maximale sur le toit de 60 kg.',NULL,NULL,NULL,'fr_FR'),(1774,1774,'Kit capteurs de stationnement arrière - 4 capteurs','kit-capteurs-de-stationnement-arriere-4-capteurs-5f9054752','Gardez votre carrosserie et vos proches intacts. Le nouveau système électronique de détection arrière vous permet de surveiller ce qui se passe derrière votre voiture. Montés sur les pare-chocs, ils passent inaperçus et fournissent des informations acoustiques sur votre environnement.  Cet accessoire se compose de 2, 3 ou 4 capteurs numériques, selon votre choix, et est compatible avec tous les modèles et moteurs SEAT.  Comprend le câblage, le tableau de distribution, le haut-parleur, les supports et la peinture.',NULL,NULL,NULL,'fr_FR'),(1775,1775,'Kit capteur de stationnement avant - 4 capteurs','kit-capteur-de-stationnement-avant-4-capteurs-5f9054752a','Trouvez toujours la place de parking idéale. Le nouveau système de capteurs électroniques avant vous permet de surveiller ce qui se passe devant votre voiture et de manœuvrer avec agilité. Montés sur les pare-chocs, ils passent inaperçus et fournissent des informations acoustiques sur votre environnement.  Cet accessoire se compose de 2, 3 ou 4 capteurs numériques, selon votre choix, et est compatible avec tous les modèles et moteurs SEAT.  Comprend le câblage, le tableau de distribution, le haut-parleur, les supports et la peinture.',NULL,NULL,NULL,'fr_FR'),(1776,1776,'Film protecteur du pare-choc arrière','film-protecteur-du-pare-choc-arriere-5f9061197','Film adhésif transparent adapté à la forme du pare-choc arrière pour protéger la zone de chargement.   Cet accessoire n\'est pas applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1777,1777,'Plateau de protection du coffre SEMI-RIGIDE','plateau-de-protection-du-coffre-semi-rigide-5f9061205','Plateau de protection pratique et résistant en caoutchouc flexible. Il s\'adapte parfaitement au coffre et le protège de la saleté et des liquides pouvant s\'y renverser au cours du transport. Seulement applicable sur le plancher supérieur. Cet accessoire ne s\'applique pas à la Leon Cupra ni aux véhicules avec motorisation au gaz naturel GNV',NULL,NULL,NULL,'fr_FR'),(1778,1778,'Plateau de protection du coffre FOAM','plateau-de-protection-du-coffre-foam-5f9061205a','Plateau de protection FOAM pratique et résistant. Il s\'adapte parfaitement au coffre et le protège de la saleté et des liquides pouvant s\'y renverser au cours du transport. Seulement applicable sur le plancher supérieur. Cet accessoire ne s\'applique pas à la Leon Cupra ni aux véhicules avec motorisation au gaz naturel GNV',NULL,NULL,NULL,'fr_FR'),(1779,1779,'Grille de séparation','grille-de-separation-5f9061205b','« Grille métallique pour protéger les passager contre les déplacements du chargement ou pour transporter des animaux. Non applicable aux véhicules avec toit panoramique ou option de filet de séparation (PR:3CX).» Cet accessoire n\'est pas applicable à la Leon Cupra  Il n\'est pas applicable aux véhicules équipés de motorisation à gaz CNG   La grille de protection du chargement n\'est pas homologuée pour les véhicules de catégorie N1 (voitures commerciales).',NULL,NULL,NULL,'fr_FR'),(1780,1780,'Housse de voiture rouge','housse-de-voiture-rouge-5f9061701','Housse en tissu rouge pour protéger votre véhicule. Avec logo SEAT argenté sur le dessus. Parfaitement adaptée à la forme du véhicule.  Cet accessoire n\'est pas applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1781,1781,'Housse de voiture noire','housse-de-voiture-noire-5f9061701a','Housse en tissu noir pour protéger votre véhicule. Avec logo SEAT gris à l\'avant, rétroviseurs gris et nom du modèle à l\'arrière. Parfaitement adaptée à la forme du véhicule.  Cet accessoire n\'est pas applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1782,1782,'Housse de voiture grise','housse-de-voiture-grise-5f9061701b','Housse en tissu gris pour protéger votre véhicule. Avec logo SEAT noir à l\'avant, rétroviseurs noirs et nom du modèle à l\'arrière. Parfaitement adaptée à la forme du véhicule.  Cet accessoire n\'est pas applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(1783,1783,'Barres de toit d\'origine','barres-de-toit-dorigine-5f9071101','Ensemble de barres d\'origine avec logo SEAT pour véhicules avec dachrelling, système antivol compris. Elles se fixent aux barres latérales du toit. Valable pour les versions avec toit panoramique. Les barres transversales sont équipées de barres de toit en aluminium que sont montées sur les dachrelling avec une base en acier rigide. La barre transversale se fixe facilement aux rails avec une base élégante. Charge maximale : 75 kg Cet accessoire est applicable à la Leon Sportstourer ST Cupra. Compatible avec : Porte-vélos réf. 5F9071128 Porte-surf réf. 000071120HA Malle porte-bagages 450 l réf. 000071180A Malle porte-bagages 400 l réf. 000071200T Malle porte-bagages 420 l réf. 000071200AB',NULL,NULL,NULL,'fr_FR'),(1784,1784,'Porte-vélos Thule','porte-velos-thule-5f9071128','Si votre passion, c’est le vélo, pour votre SEAT, cela le sera aussi. Cette galerie de toit a été conçue exclusivement pour s’adapter à votre vélo et garantir qu’il reste en parfait état. Le vélo se positionne automatiquement lors de l’ajustement grâce au design exclusif du bras de fixation de cadre et du support de roues. La pression est répartie grâce à des pinces à mâchoires à la fois larges et douces qui s’adaptent aux tubes du cadre du vélo, réduisant au minimum le risque de dommages du cadre. Le montage est rapide et facile, aucun outil n’est nécessaire pour faire passer le porte-vélos d’un côté à l’autre du véhicule. Le poids maximal autorisé est de 20 kg. Des adaptateurs pour les rails en T (20x20 mm) sont inclus. Répond aux normes CityCrash. Incompatible avec les versions avec toit panoramique.',NULL,NULL,NULL,'fr_FR'),(1785,1785,'Barres de toit THULE','barres-de-toit-thule-5f9071151','Ensemble de barres de transport transversales avant et arrière avec système antivol inclus. Elles se fixent aux barres latérales du toit du véhicule. Également valable pour les versions avec toit panoramique. Charge maximale des barres : 75 kg. Se combine avec : Coffre de toit 450 l réf. 000071180A Coffre de toit 400 l réf. 000071200T Coffre de toit 420 l réf. 000071200AB  Non compatible avec : -Porte-vélos réf. 5F9071128 -Porte-skis 4/6 paires réf. 000071129S /   000071129T -Porte-surf réf. 000071120HA',NULL,NULL,NULL,'fr_FR'),(1786,1786,'Jante en alliage 18\" X-perience couleur diamantée noire','jante-en-alliage-18-x-perience-couleur-diamantee-noire-5f9071498kt2','Jante en alliage couleur diamantée sur fond noir 7,5J x 18”, ET45, 5 x 112 mm. Exclusivité du modèle X-perience. Prix à l’unité, n’inclut pas les pneus.',NULL,NULL,NULL,'fr_FR'),(1787,1787,'Attache de remorque','attache-de-remorque-5f9803881d','Attache de remorque démontable avec dispositif de sécurité. Un système d\'indication par couleurs simplifie l\'installation de l\'attache. Réf. caches pour attache de remorque  Reference/Style/Entry : 5F9803595 FR :  5F9807117 X-PERIENCE : 5F9807568D Z76 (Embouts cachés) 5F9807568E Z76 (Embouts visibles 1 voie) 5F9807568F Z76 (Embouts visibles 2 voies)  À poser en combinaison avec la centrale d\'attache de remorque et le kit électrique : Voir l\'information dans ETKA Pièces de rechange Page de texte 945-XX Il est conseillé de demander le pré-équipement en usine de l\'attache de remorque. Consulter le manuel de réparation : Manuel de conduite avec remorque disponible dans ELSA, Groupe de réparation 00 : Données techniques.  Cet accessoire n\'est pas applicable à la Leon Cupra.  Pour X-PERIENCE se reporter aux instructions de montage 3.0.  Compatible avec les moteurs CNG.  Remarque importante : La Leon PA n\'a besoin d\'aucun cache pour l\'attache de remorque.',NULL,NULL,NULL,'fr_FR'),(1788,1788,'Tapis leon X-PERIENCE','tapis-leon-x-perience-5f9863011loe','Tapis de sol personnalisé avec le design X-PERIENCE. Liseré noir avec couture couleur orange et étiquette Xperience. Jeu de 4 pièces avec la partie inférieure antidérapante. Pour véhicule avec volant à gauche (LHD). Les tapis conducteur et passager disposent d\'un système de fixation.',NULL,NULL,NULL,'fr_FR'),(1789,1789,'Kit électrique (sans prééquipement)','kit-electrique-sans-preequipement-5fa055204','Kit électrique 13 bornes pour attache de remorque sur les véhicules sans prééquipement. Câblage intérieur uniquement (à partir de BCM)  Unité de commande non incluse, en faire la demande via le service de pièces de rechange (ETKA-ET2000). Non compatible avec l’option 1M7',NULL,NULL,NULL,'fr_FR'),(1790,1790,'Moulure de protection du coffre','moulure-de-protection-du-coffre-5fa061155','Votre SEAT est lui aussi prêt pour les travaux les plus difficiles. Cette moulure de protection du coffre vous aidera les jours où vous devrez transporter des charges plus lourdes. Vous pourrez prendre appui  dessus sans craindre de rayer la peinture de la voiture.',NULL,NULL,NULL,'fr_FR'),(1791,1791,'Plateau de protection du coffre (mousse)','plateau-de-protection-du-coffre-mousse-5fa061201','Accordez un traitement spécial à vos bagages. Avec ce plateau pratique en mousse, chargez vos objets les plus précieux dans le coffre  avec la certitude qu’ils voyageront en toute sécurité. Le plateau protégera également l’espace de la saleté et de l’humidité éventuelle. Plateau adapté au coffre sans double plancher, et non valable pour les moteurs PHEV ou CNG.',NULL,NULL,NULL,'fr_FR'),(1792,1792,'Tapis de coffre réversible','tapis-de-coffre-reversible-5fa061201a','Parce qu’il y a un jour pour tout, le coffre de votre Léon s’adapte à votre emploi du temps. Ce tapis a un côté moquette qui est en harmonie avec l’esthétique standard du reste du véhicule, et si la journée prend une tournure plus mouvementée, vous pouvez le retourner pour transporter des objets humides ou sales sans endommager le coffre. Ne convient pas aux motorisations PHEV et CNG.',NULL,NULL,NULL,'fr_FR'),(1793,1793,'Plateau de protection du coffre (semi-rigide)','plateau-de-protection-du-coffre-semi-rigide-5fa061201b','Si vous ne posez pas de limites à vos projets, votre coffre ne doit pas en avoir non plus. Avec ce plateau semi-rigide pratique, vous protégerez le coffre de votre SEAT de la saleté et de l’humidité. Plateau adapté au coffre sans double plancher, et non valable pour les moteurs PHEV ou CNG.',NULL,NULL,NULL,'fr_FR'),(1794,1794,'Plateau de protection du coffre à bords relevés','plateau-de-protection-du-coffre-a-bords-releves-5fa061201c','Montrez-moi votre coffre et je vous dirai qui vous êtes. Ce plateau pratique et robuste avec un bord relevé protégera votre SEAT de tout ce que vous pouvez y ranger. Il est lavable et porte le monogramme de votre León. Plateau adapté au coffre sans double plancher, et non valable pour les moteurs PHEV ou CNG.',NULL,NULL,NULL,'fr_FR'),(1795,1795,'Housse véhicule 5P','housse-vehicule-5-p-5fa061701','Protégez votre SEAT comme un véritable trésor. Recouvrez-la de cette housse en tissu noir avec impression du logo, qui s’adapte parfaitement à la forme de votre voiture, et protégez-la de la saleté, de la poussière et de l’humidité. Chaque fois que vous la découvrirez, elle aura l’air comme neuve.',NULL,NULL,NULL,'fr_FR'),(1796,1796,'Pédales Inox version manuelle','pedales-inox-version-manuelle-5fa0642003q7','Non seulement cela renforce le caractère sportif de votre SEAT, mais les pédales en aluminium ont une surface en caoutchouc pour offrir une adhérence supplémentaire et améliorer la sensation de conduite sportive.',NULL,NULL,NULL,'fr_FR'),(1797,1797,'Repose-pieds en acier inoxydable','repose-pieds-en-acier-inoxydable-5fa0642053q7','Optimisez le style sportif de votre voiture. Ce repose-pieds en aluminium, avec une surface en caoutchouc pour améliorer l\'adhérence, complète l\'ensemble sportif du véhicule. Modèles à conduite à gauche uniquement.',NULL,NULL,NULL,'fr_FR'),(1798,1798,'Moulure avant','moulure-avant-5fa071005','S’il y a une chose dont le design de la nouvelle SEAT Léon regorge, c’est la personnalité. Mais vous pouvez quand même ajouter une touche personnelle et élégante à la partie avant avec cette garniture chromée mate.',NULL,NULL,NULL,'fr_FR'),(1799,1799,'Barre de toit','barre-de-toit-5fa071151','Vous ne savez pas encore quel sera votre prochain passe-temps, mais vous pouvez être sûr qu’il aura sa place dans votre SEAT León. Avec ces barres de toit, vous pouvez transporter n’importe quoi, des coffres de toit aux vélos, en passant par les planches de surf, ou tout ce que vous envisagez d’essayer. Elles se fixent sur les côtés du toit et supportent une charge maximale de 50 kg. Sûres, résistantes, et comme chaque centimètre de votre León, élégantes.  Incompatible avec les versions avec toit panoramique.',NULL,NULL,NULL,'fr_FR'),(1800,1800,'Film protecteur pare-chocs arrière','film-protecteur-pare-chocs-arriere-5fa071363','Vous vous remplissez d’expériences, et votre SEAT, d’objets de toutes sortes. Renforcez l’arrière du coffre avec ce film de protection qui empêche les rayures typiques de la zone de chargement et de déchargement. Préparez-le à une vie intense.',NULL,NULL,NULL,'fr_FR'),(1801,1801,'Becquet de toit en fibre de carbone','becquet-de-toit-en-fibre-de-carbone-5fa071606a','Extension pour le becquet standard en fibre de carbone fixé avec une colle spéciale et un ruban adhésif double face. Instructions de montage incluses.   Le kit de colle doit être commandé séparément, réf. 000071781B (une unité est nécessaire pour monter le becquet).   Uniquement pour la version 5 portes.',NULL,NULL,NULL,'fr_FR'),(1802,1802,'Becquet de toit en fibre de carbone cuivre','becquet-de-toit-en-fibre-de-carbone-cuivre-5fa071640b','Extension pour le becquet standard en fibre de carbone avec fil de cuivre. Fixation avec une colle spéciale et un ruban adhésif double face. Instructions de montage incluses. Colle spéciale non comprise. Compatible uniquement avec la version 5 portes, incompatible avec la version SP.  Le kit de colle doit être commandé séparément, réf. 000071781B (une unité est nécessaire pour monter le becquet).',NULL,NULL,NULL,'fr_FR'),(1803,1803,'Seuils de porte','seuils-de-porte-5fa071685gru','Complétez les lignes fluides de votre nouvelle SEAT León avec ces seuils. PUR imprimé. Instructions de pose incluses.',NULL,NULL,NULL,'fr_FR'),(1804,1804,'Bavettes garde-boue arrière','bavettes-garde-boue-arriere-5fa075101a','Quand vous étiez enfant, vous sautiez dans les flaques de boue, maintenant vous les traversez allègrement avec votre SEAT. Avec ces bavettes arrière conçues spécialement pour votre SEAT Leon, vous pouvez protéger votre dessous de caisse et votre pare-chocs de la saleté, des impacts de gravier et des éclaboussures.',NULL,NULL,NULL,'fr_FR'),(1805,1805,'Bavettes garde-boue avant','bavettes-garde-boue-avant-5fa075111a','Bavettes SEAT garde-boue spécialement conçues pour votre SEAT Leon. Leur design protège efficacement le soubassement et le pare-chocs contre la saleté importante. En outre, elles réduisent énormément les impacts dangereux provoqués par les graviers et la dispersion d’eau.',NULL,NULL,NULL,'fr_FR'),(1806,1806,'Attache de remorque','attache-de-remorque-5fa092160d','Pour transporter des remorques, il est essentiel que le véhicule tracteur soit équipé d’une attache offrant toutes les garanties.  Les attelages de remorque SEAT sont réalisées sur mesure et s’intègrent aux systèmes de sécurité et de confort du véhicule pour garantir un fonctionnement parfait. Homologué conformément à la norme E13 55R 01 2886 (certificat joint). Veuillez respecter les instructions de la notice (jointe) pour le montage.   L’attelage de remorque est pliant, manuel et amovible. Il inclut les composants électriques nécessaires et offre un niveau de sécurité et de contrôle supérieur sur la remorque. Ces attaches sont prévues pour le transport de remorques, de remorques basculantes et de caravanes, vous permettant ainsi d’emporter tout ce dont vous avez besoin, de manière sûre et pratique, où que vous alliez.   Pour les véhicules ne disposant pas de l’option de préinstallation d’attelage de série (PR 1M7), en plus du kit électrique (5FA055204), les composants suivants devront être commandés (pour plus d’informations, veuillez vous adresser à ETKA) Appareil de commande : 5H2907383 (s\'adresser à ETKA pour vérifier de nouvelles versions) Visserie : 2xN90915901; 2x 811807577F Actionneur + cadre : 5TA959511; 5G0868345  Couleur : Noir Matériau : fer haute qualité Poids / dimensions (approx.) : 22,5 kg / 1050 mm x 600 mm x 300 mm Limitations : Cette version ne s’applique pas aux motorisations PHEV / CNG. Incompatible avec CUPRA LEON 5P Incompatible avec CUPRA LEON SP Produits associés : Adaptateur de 13 à 7 pôles, référence de pièce 3R0055300 Pour un bon rééquipement et une bonne reconnaissance de l’attelage, l’atelier agréé doit coder et adapter le logiciel du véhicule via ODIS/SVM/code: 3446F.',NULL,NULL,NULL,'fr_FR'),(1807,1807,'Attache de remorque PHEV','attache-de-remorque-phev-5fa092160e','Attache de remorque pour versions PHEV  Pour transporter des remorques, il est essentiel que le véhicule tracteur soit équipé d’une attache offrant toutes les garanties.   Les attaches de remorque SEAT sont réalisées sur mesure et s’intègrent aux systèmes de sécurité et de confort du véhicule pour garantir un fonctionnement parfait. Elles sont homologuées par la norme E1 55R 01 3096.   Veuillez les poser conformément au manuel d’instructions (voir l’onglet Documents).  Attache de remorque pliante manuelle et amovible.   Elle inclut les composants électriques nécessaires et offre un niveau de sécurité et de contrôle supérieur sur la remorque.  Ces attaches sont prévues pour le transport de chariots, de remorques basculantes et de caravanes, vous permettant ainsi d’emporter tout ce dont vous avez besoin, de manière sûre et pratique, où que vous alliez.   Sur les véhicules ne disposant pas de la pré-installation en option de l’attache de série (PR 1M7), vous devrez solliciter les composants suivants en plus du kit électrique (5FA055204) (pour plus d’informations, contacter ETKA) Appareil de commande : 5H2907383 (contacter ETKA pour obtenir de nouvelles versions) Visserie : 2xN90915901 ; 2x 811807577F Actionneur + cadre : 5TA959511 ; 5G0868345  Coloris : Noir Matériau : fer haute qualité  Poids / dimensions (environ) : 22,5 kg / 1 050 mm x 600 mm x 300 mm Limitations : Non compatible avec CUPRA LEON 5P Compatible avec CUPRA LEON SP Produits associés : Adaptateur de 13 à 7 pôles, numéro de pièce 3R0055300 Pour un remplacement et une identification corrects de l’attache, l’atelier agréé doit coder et adapter le logiciel du véhicule à travers ODIS/SVM/code : 3446F.  Non compatible avec PR - PTC pour la Leon SP PHEV avec n’importe quelle finition, Cupra incluse. Non compatible avec PR - PTC pour la Leon 5D PHEV Cupra. Non compatible avec les versions CNG.',NULL,NULL,NULL,'fr_FR'),(1808,1808,'Tapis en caoutchouc','tapis-en-caoutchouc-5fb061500--041','Jeu de 4 tapis caoutchouc Nouvelle Leon / Leon SP',NULL,NULL,NULL,'fr_FR'),(1809,1809,'Tapis en caoutchouc TPE (LHD)','tapis-en-caoutchouc-tpe-lhd-5fb061500041','Cela ne vous dérangera pas si toutes vos aventures se terminent à l’intérieur de votre SEAT. Avec ce lot de 4 tapis en caoutchouc, vous bénéficiez d’une protection supplémentaire contre la saleté et les liquides. Compatible avec les véhicules ayant le volant à gauche (LHD).  Incompatible avec les versions MHEV.',NULL,NULL,NULL,'fr_FR'),(1810,1810,'Tapis Trail (LHD)','tapis-trail-lhd-5fb061675041','Affichez votre signature. Avec ce jeu de 4 tapis de sol, vous pouvez personnaliser l’intérieur de votre SEAT avec le nom de votre concessionnaire ou avec le nom du modèle. Dessous antidérapant, avec protection supplémentaire pour le pilote, tapis de 450 g/m2 et conçu pour les véhicules ayant le volant à gauche (LHD). Incompatible avec les versions MHEV.',NULL,NULL,NULL,'fr_FR'),(1811,1811,'Tapis TPE capitonné','tapis-tpe-capitonne-5fb061675a041','Moquette haute densité avec face inférieure en caoutchouc. Jeu de 4 pièces. Pour véhicules ayant le volant à gauche (LHD).  Non compatible pour les versions MHEV.',NULL,NULL,NULL,'fr_FR'),(1812,1812,'Tapis en tissu Xcellence (GI)','tapis-en-tissu-xcellence-gi-5fb863011aloe','Moquette de série avec partie inférieure antidérapante, personnalisée avec la finition XCELLENCE, moquette de couleur. Jeu de 4 pièces. Pour véhicules ayant le volant à gauche (LHD).  Non compatible pour les versions MHEV.',NULL,NULL,NULL,'fr_FR'),(1813,1813,'Tapis en tissu FR (LHD)','tapis-en-tissu-fr-lhd-5fb863011bloe','Moquette de série avec partie inférieure antidérapante, personnalisée avec la finition FR, moquette de couleur. Jeu de 4 pièces. Pour véhicules ayant le volant à gauche (LHD).  Non compatible pour les versions MHEV.',NULL,NULL,NULL,'fr_FR'),(1814,1814,'Jeu de tapis mHEV (LHD)','jeu-de-tapis-m-hev-lhd-5fb863011cloe','Moquette de série avec partie inférieure antidérapante, personnalisée avec les lettres Leon, géométrie spécifique pour les variantes mHEV. Jeu de 4 pièces. Pour véhicules ayant le volant à gauche (LHD). Le tapis conducteur dispose d\'un système de fixation.',NULL,NULL,NULL,'fr_FR'),(1815,1815,'Tapis en tissu (LHD)','tapis-en-tissu-lhd-5fb863011loe','Moquette de série avec partie inférieure antidérapante. Jeu de 4 pièces. Pour véhicules ayant le volant à gauche (LHD).  Non compatible pour les versions MHEV.',NULL,NULL,NULL,'fr_FR'),(1816,1816,'Filet de séparation du coffre pour les animaux domestiques','filet-de-separation-du-coffre-pour-les-animaux-domestiques-5fe017221','Votre animal de compagnie fait partie de la famille. Protégez-le durant tous vos déplacements grâce à ce filet de séparation qui divise le coffre en deux habitacles pour une sécurité renforcée. Vous pouvez monter et démonter le filet facilement quand vous le souhaitez. Ce filet n’est pas homologué pour les véhicules commerciaux.',NULL,NULL,NULL,'fr_FR'),(1817,1817,'Plateau de protection du coffre (mousse)','plateau-de-protection-du-coffre-mousse-5fe061201','Les plateaux de coffre de SEAT sont pratiques et permettent de protéger cet espace contre la saleté et l’humidité grâce à leur design en mousse. Ces Accessoires d’origine SEAT permettent de profiter d’un voyage confortable et sûr, tout en offrant la protection adéquate au coffre quel que soit le besoin.   Ce plateau convient à la position haute du plancher double.  Valable pour les moteurs PHEV. Non valable pour les moteurs CNG.',NULL,NULL,NULL,'fr_FR'),(1818,1818,'Tapis de coffre réversible','tapis-de-coffre-reversible-5fe061201a','Tapis adapté aux dimensions du plancher du coffre. Ce tapis est constitué de moquette sur une face et d’une surface plastique sur l\'autre, ce qui lui permet de s\'adapter à tous vos besoins. Son esthétique correspond aux lignes de série ; le plateau permet également de transporter des objets humides et sales sans endommager le coffre.   Convient à la fois pour le plancher supérieur et inférieur.  Valable pour les moteurs PHEV. Non valable pour les moteurs CNG.',NULL,NULL,NULL,'fr_FR'),(1819,1819,'Plateau de protection du coffre (semi-rigide)','plateau-de-protection-du-coffre-semi-rigide-5fe061201b','Les plateaux de coffre de SEAT sont pratiques et permettent de protéger cet espace contre la saleté et l’humidité grâce à leur design en plastique souple qui les rend robustes et résistants. Ces Accessoires d’origine SEAT permettent de profiter d’un voyage confortable et sûr, tout en offrant la protection adéquate au coffre quel que soit le besoin.  Ce plateau convient à la position haute du plancher double.  Valable pour les moteurs PHEV. Non valable pour les moteurs CNG.',NULL,NULL,NULL,'fr_FR'),(1820,1820,'Plateau de protection du coffre à bords relevés','plateau-de-protection-du-coffre-a-bords-releves-5fe061201c','Plateau pratique et robuste qui s’intègre parfaitement et dont le bord relevé protège de la saleté et des liquides pouvant se renverser. Lavable.  Comporte une inscription LEON, qui apporte une touche visuelle spéciale.   Ce plateau convient à la position haute du plancher double.  Valable pour les moteurs PHEV. Non valable pour les moteurs CNG.',NULL,NULL,NULL,'fr_FR'),(1821,1821,'Housse véhicule 5P','housse-vehicule-5-p-5fe061701','Housse textile intérieure pour la protection et l’esthétique du véhicule. De couleur noire, elle s\'adapte parfaitement à la forme de la voiture avec le logo SEAT imprimé sur le capot.',NULL,NULL,NULL,'fr_FR'),(1822,1822,'Barres de toit','barres-de-toit-5fe071151','Grâce à nos barres de toit SEAT Leon, vous pouvez partir à l’aventure avec la tranquillité d’emporter tout ce que vous voulez. En combinaison avec d’autres produits, nos barres de toit servent également de base pour transporter du matériel supplémentaire, comme des vélos, des skis, des planches de surf ou des galeries porte-bagages pour vivre vos passions. Quel que soit le complément que vous choisissez pour votre véhicule, vous pouvez être certain d’acheter les barres de toit les plus sûres, les plus résistantes et les plus élégantes du marché, avec leur fixation sur les côtés du toit du véhicule. Elles sont également valables pour les versions avec toit panoramique et supportent une charge maximale sur le toit de 50 kg. Testées au-delà des limites, des barres de toit SEAT sont synonymes de qualité dans tous leurs aspects',NULL,NULL,NULL,'fr_FR'),(1823,1823,'Film protecteur pare-chocs arrière','film-protecteur-pare-chocs-arriere-5fe071363a','Film de protection transparent permettant d’éviter les petites rayures sur la zone de chargement et déchargement du coffre, et conserver votre voiture comme au premier jour.',NULL,NULL,NULL,'fr_FR'),(1824,1824,'Garniture diffuseur postérieur','garniture-diffuseur-posterieur-5fe0716113q7','Diffuseur postérieur design sport Garniture en plastique en trois parties : deux parties décoratives de type échappement et une bande centrale.  Comprend toutes les fixations et les instructions nécessaires au montage.  Couleur : Chromé mat',NULL,NULL,NULL,'fr_FR'),(1825,1825,'Bavettes garde-boue arrière','bavettes-garde-boue-arriere-5fe075101','Bavettes SEAT garde-boue spécialement conçues pour votre SEAT Leon. Leur design protège efficacement le soubassement et le pare-chocs contre la saleté importante. En outre, elles réduisent énormément les impacts dangereux provoqués par les graviers et la dispersion d’eau.',NULL,NULL,NULL,'fr_FR'),(1826,1826,'Kit électrique sans prééquipement','kit-electrique-sans-preequipement-5fj055204','Kit électrique 13 bornes pour attache de remorque sur les véhicules sans prééquipement.  Câblage intérieur uniquement (à partir de BCM). Unité de commande non incluse, en faire la demande via le service de pièces de rechange (ETKA-ET2000). Non compatible avec l\'option 1M7 / 1D8.',NULL,NULL,NULL,'fr_FR'),(1827,1827,'Moulure de protection de pare-chocs arrière','moulure-de-protection-de-pare-chocs-arriere-5fj061155','Moulure arrière monobloc métallique collée sur la zone supérieure du pare-chocs arrière afin de le protéger des frottements et des coups lors du chargement du coffre.  Couleur inox.',NULL,NULL,NULL,'fr_FR'),(1828,1828,'Film pare-chocs','film-pare-chocs-5fj061197','Feuille adhésive transparente adaptée à la forme du pare-chocs arrière pour protéger la zone de chargement.',NULL,NULL,NULL,'fr_FR'),(1829,1829,'Plateau de coffre (5 places)','plateau-de-coffre-5-places-5fj061201','Une housse pratique pour coffre SEAT, qui protège contre tous types de saleté et empêche le déplacement des objets transportés.',NULL,NULL,NULL,'fr_FR'),(1830,1830,'Plateau de coffre avec rebord','plateau-de-coffre-avec-rebord-5fj061201a','Un plateau pratique pour le coffre de votre SEAT. Élément d’ajustage précis muni d’un rebord élevé permettant de protéger le coffre contre la saleté et les écoulements de liquide. Lavable et antidérapant. . Comporte une inscription TARRACO, qui apporte une touche visuelle spéciale.',NULL,NULL,NULL,'fr_FR'),(1831,1831,'Tapis de coffre réversible','tapis-de-coffre-reversible-5fj061201b','Plateau en moquette d\'un côté et en caoutchouc de l\'autre. Il s\'adapte parfaitement au coffre et le protège de la saleté et des liquides pouvant s\'y renverser au cours du transport.',NULL,NULL,NULL,'fr_FR'),(1832,1832,'Plateau semi-rigide (5 places)','plateau-semi-rigide-5-places-5fj061201c','Pièce de protection en plastique souple à placer sur la base du coffre.  Adapté aux dimensions du coffre. Spécialement conçu pour le transport de marchandises en évitant les problèmes d’humidité ou de saleté.',NULL,NULL,NULL,'fr_FR'),(1833,1833,'Plateau semi-rigide (7 places)','plateau-semi-rigide-7-places-5fj061201e','Plateau adapté aux dimensions du plancher du coffre.  Ce plateau est constitué de moquette sur une face et d’une surface plastique sur l\'autre, ce qui lui permet de s\'adapter à tous vos besoins. Son esthétique correspond aux lignes de série ; le plateau permet également de transporter des objets humides et sales sans endommager le coffre.  Non valable pour le Tarraco FR',NULL,NULL,NULL,'fr_FR'),(1834,1834,'Plateau de protection du coffre','plateau-de-protection-du-coffre-5fj061201g','Plateau pratique pour le coffre de votre SEAT. Nouveau design avec inscription « Tarraco » en lettrage à main levée.  à fixer au fond du coffre pour protéger votre voiture de la saleté et des liquides renversés. Lavable et antidérapant. Comporte une inscription Tarraco pour une touche unique.  Compatible uniquement avec le modèle à 5 places.',NULL,NULL,NULL,'fr_FR'),(1835,1835,'Plateau de protection à bords relevés - Nouveau design','plateau-de-protection-a-bords-releves-nouveau-design-5fj061201h','Plateau à bords relevés pratique pour le coffre de votre SEAT. Nouveau design avec inscription 