s. Les barres de toit sont entièrement prémontées et peuvent être posées facilement et sans problème sur les barres de toit longitudinales de votre SEAT. Les barres de toit sont protégées contre le vol. Le profilé aérodynamique, facile à monter et doté d\'une surface structurée, minimise le bruit du vent. Les barres sont personnalisées et exclusives au modèle Tarraco.',NULL,NULL,NULL,'fr_FR'),(1841,1841,'Moulures latérales de porte finition argent','moulures-laterales-de-porte-finition-argent-5fj071328','Jeu de moulures latérales composé de deux pièces à coller sur la partie inférieure de la porte. Inclut le côté droit et le gauche en finition argent.  Non valable pour le Tarraco FR',NULL,NULL,NULL,'fr_FR'),(1842,1842,'Moulure de hayon argent mat','moulure-de-hayon-argent-mat-5fj071360a','Moulure de hayon composée d\'une pièce à coller sur le hayon en finition argent mat.',NULL,NULL,NULL,'fr_FR'),(1843,1843,'Étrier latéral','etrier-lateral-5fj071691','Les étriers soulignent le caractère SUV de votre véhicule tout en facilitant l’accès à celui-ci et le chargement sur le toit.  Les étriers sont fabriqués en aluminium argenté anodisé et sont fermés, de chaque côté, par des embouts de finition en plastique noir.  Les surfaces d’appui sont réalisées avec un revêtement en plastique noir antidérapant, garantissant un accès sûr au véhicule.  Compatible avec les bavettes garde-boue.   Résumé de caractéristiques uniques :  -Inclut toutes les pièces de fixation nécessaires  -Revêtement anticorrosion  -200 kg de charge sur chaque étrier  -Respecte les exigences lors des chocs latéraux   Non compatible avec les versions PHEV.',NULL,NULL,NULL,'fr_FR'),(1844,1844,'Bavettes garde-boue arrière','bavettes-garde-boue-arriere-5fj075101','Jeu de bavettes garde-boue arrière. Protège le pare-chocs arrière contre les matériaux projetés par les roues arrière pendant la marche.  Non valable pour le Tarraco FR. Non valable pour le Tarraco PHEV.',NULL,NULL,NULL,'fr_FR'),(1845,1845,'Bavettes garde-boue avant','bavettes-garde-boue-avant-5fj075111','Jeu de bavettes garde-boue avant. Protège la carrosserie de matériaux projetés par les roues avant pendant la marche.  Non valable pour le Tarraco FR. Non valable pour le Tarraco PHEV.',NULL,NULL,NULL,'fr_FR'),(1846,1846,'Décoration clé graphique','decoration-cle-graphique-5fj087013a','Coque décorative pour la clé du véhicule. Composée de deux parties, elle se fixe grâce à un adhésif.',NULL,NULL,NULL,'fr_FR'),(1847,1847,'Décoration clé graphique','decoration-cle-graphique-5fj087013b','Coque décorative pour la clé du véhicule. Composée de deux parties, elle se fixe grâce à un adhésif.',NULL,NULL,NULL,'fr_FR'),(1848,1848,'Attelage de remorque','attelage-de-remorque-5fj092160a','Attelage de remorque pliant manuel et amovible électrique.  Fabriqué avec des matériaux haute qualité éprouvés par des tests de sécurité et de qualité de SEAT. L’attelage de remorque est homologué conformément à la norme 55R - 01 4706 (certificat joint).  Veuillez procéder à l’installation en suivant la notice fournie (jointe).  Pour l’installation, les composants suivants doivent être demandés par le département de pièces de rechange. Voir ETKA. 2 x N 905 369 01 1 x 5NA 803 973A 1 x 5NA 803 974A 8 x N 102 400 03 Sur les véhicules ne disposant pas de l’option de préinstallation du crochet de série (PR 1M7), en plus du kit électrique (5FJ055204), les composants suivants devront être demandés (pour plus d’informations, s\'adresser à ETKA) Appareil de commande : 5Q09073383N (s’adresser à ETKA pour vérifier de nouvelles versions) Visserie : 2xN91137101; 2x N91074201 Actionneur + cadre : 5TA959511; 5G0868345  Couleur : Noir Matériel : fer haute qualité  Poids / dimensions (approx.) : 27,7 Kg / 1400mmx650mmx200mm Produits associés : Adaptateur de 13 à 7 pôles, référence 3R0055300  Pour un bon rééquipement et une bonne reconnaissance du crochet, l’atelier agréé doit coder et adapter le logiciel du véhicule via ODIS/SVM/code: 3446F.',NULL,NULL,NULL,'fr_FR'),(1849,1849,'Attelage de remorque','attelage-de-remorque-5fj092160b','Attelage de remorque pliant manuel et amovible électrique.  Fabriqué avec des matériaux haute qualité éprouvés par des tests de sécurité et de qualité de SEAT. L’attelage de remorque est homologué conformément à la norme E13 55R 01 4021 (certificat joint).  Veuillez procéder à l’installation en suivant la notice fournie (jointe).  Pour l’installation, les composants suivants doivent être demandés par le département de pièces de rechange. Voir ETKA. 2 x N 905 369 01 Sur les véhicules ne disposant pas de l’option de préinstallation du crochet de série (PR 1M7), en plus du kit électrique (5FJ055204), les composants suivants devront être demandés (pour plus d’informations, s\'adresser à ETKA) Appareil de commande : 5Q09073383N (s’adresser à ETKA pour vérifier de nouvelles versions) Visserie : 2xN91137101; 2x N91074201 Actionneur + cadre : 5TA959511; 5G0868345  Couleur : Noir Matériel : fer haute qualité  Poids / dimensions (approx.) : 14,9 kg / 1 080 mm x 590 mm x 195 mm Limitations : Cette version n’est pas applicable au PHEV TARRACO.  Produits associés : Adaptateur de 13 à 7 pôles, référence 3R0055300  Pour un bon rééquipement et une bonne reconnaissance du crochet, l’atelier agréé doit coder et adapter le logiciel du véhicule via ODIS/SVM/code: 3446F.  ref. 5FJ092160A. CW 22/21',NULL,NULL,NULL,'fr_FR'),(1850,1850,'Tapis textile 3e rangée','tapis-textile-3-e-rangee-5fj863011aloe','Moquette de série avec partie inférieure antidérapante. Détail de l’ensemble de tapis de la troisième rangée de sièges dans la version 7 places. Valable pour les véhicules avec volant à gauche et à droite.   Non valable pour le Tarraco PHEV',NULL,NULL,NULL,'fr_FR'),(1851,1851,'Tapis premium marron Tarraco (Volant à gauche)','tapis-premium-marron-tarraco-volant-a-gauche-5fj863011dloe','Moquette marron avec dos antidérapant, inserts en PVC et LOGO métallique. Pour véhicules ayant le volant à gauche (LHD). Dos antidé