'),(1871,1871,'SEAT DataPlug','seat-data-plug-6f0051629','SEAT DataPlug consulte les données en temps réel du véhicule vers le smartphone relié par Bluetooth à travers le poste OBD2.   En combinaison avec l’app MySEATApp sur le smartphone, il est possible d’évaluer et de visualiser un grand nombre de données en transformant votre voiture actuelle en une voiture connectée. Il est branché à l’interface OBD2 du véhicule sans avoir recours à aucune source d’alimentation indépendante.  De cette façon, le conducteur du véhicule restera informé à tout moment et dans le détail de l’état du véhicule, et il sera averti de tout problème éventuel.  Vous pourrez gagner du temps en prenant rendez-vous chez votre concessionnaire et en trouvant où vous avez garé votre véhicule.  Les app. compatibles sont disponibles au téléchargement gratuitement depuis l’App Store d’Apple et Google Play-Store.  Nous vous recommandons avant tout de consulter la compatibilité avec votre véhicule auprès d’un Service Agréé SEAT et/ou à travers le lien suivant :  https://www.seat.com/owners/my-seat/my-seat-app.html  Applicabilité uniquement sur les marchés suivants : Espagne République Tchèque Mexique Roumanie Portugal France Grèce',NULL,NULL,NULL,'fr_FR'),(1872,1872,'Kit électrique 13 bornes (volant à gauche et à droite)','kit-electrique-13-bornes-volant-a-gauche-et-a-droite-6f0055204','Kit électrique 13 bornes pour attache de remorque sur les véhicules avec prééquipement d’usine PR-1D8. Comprend le câblage entre la centrale remorque et l’attache',NULL,NULL,NULL,'fr_FR'),(1873,1873,'Accoudoir en tissu noir','accoudoir-en-tissu-noir-6f0061123li8','Accoudoir équipé d\'un compartiment interne très utile et pratique pour ranger de petits objets.  Fourni avec toutes les pièces nécessaires pour l\'installation.  Revêtement en tissu noir titane.',NULL,NULL,NULL,'fr_FR'),(1874,1874,'Accoudoir en cuir noir','accoudoir-en-cuir-noir-6f0061123xu2','Accoudoir équipé d\'un compartiment interne très utile et pratique pour ranger de petits objets. Fourni avec toutes les pièces nécessaires pour l\'installation.  Revêtement en cuir synthétique noir titane.',NULL,NULL,NULL,'fr_FR'),(1875,1875,'Ensemble de tapis pour console centrale','ensemble-de-tapis-pour-console-centrale-6f0061169','Tapis en caoutchouc pour le logement avant et pour l’intérieur des porte-gobelets situés sur la console centrale. Avec design des rues de Barcelone. Uniquement pour les versions sans chargeur inductif. Ensemble de 4 pièces',NULL,NULL,NULL,'fr_FR'),(1876,1876,'Tapis console centrale','tapis-console-centrale-6f0061169a','Tapis en caoutchouc pour l’intérieur des porte-gobelets situés sur la console centrale.  Avec design des rues de Barcelone. Ensemble de 3 pièces.   Compatible avec les versions avec et sans chargeur à induction.',NULL,NULL,NULL,'fr_FR'),(1877,1877,'Plateau de protection du coffre (mousse)','plateau-de-protection-du-coffre-mousse-6f0061180','Pièce de protection en mousse à placer sur la base du coffre. Compatible avec le coffre de l’IBIZA sans double fond.  Non compatible avec les moteurs CNG.',NULL,NULL,NULL,'fr_FR'),(1878,1878,'Plateau de protection du coffre (semi-rigide)','plateau-de-protection-du-coffre-semi-rigide-6f0061180a','Pièce de protection en plastique souple à placer sur la base du coffre. Compatible avec le coffre de l’IBIZA sans double fond.  Non compatible avec les moteurs CNG.',NULL,NULL,NULL,'fr_FR'),(1879,1879,'Plateau de protection du coffre à bords relevés','plateau-de-protection-du-coffre-a-bords-releves-6f0061201','Pièce de protection en plastique à bords relevés à placer sur la base du coffre. Résistant, imperméable, facile à nettoyer et présentant de grandes rainures évitant le déplacement du chargement. Compatible avec le coffre de l’Ibiza sans double fond.  Non compatible avec les moteurs CNG.',NULL,NULL,NULL,'fr_FR'),(1880,1880,'Plateau de protection du coffre avec nouveau design.','plateau-de-protection-du-coffre-avec-nouveau-design-6f0061201b','Nouveau pl