 le kit aérodynamique, améliore les prestations aérodynamiques en réduisant la résistance à l\'air tout en accentuant l\'aspect sport de la partie arrière. *Produit non homologué pour version Ecomotive',NULL,NULL,NULL,'fr_FR'),(2014,2014,'Décoration extérieure Ecomotive','decoration-exterieure-ecomotive-6j3072525b','Décoration extérieure modèle Ecomotive Fabrication en feuilles de vinyle haute qualité, homologuées par SEAT spécialement pour usage sur voitures. Des tests d’installation ont été menés et les instructions ont été revues pour garantir une parfaite adaptation de l’adhésif à la carrosserie, sans aucun risque d’endommagement de la peinture. Le matériel résiste au tunnel de lavage et aux produits de nettoyage, ne se décolle pas et ne perd pas sa couleur d’origine, même en cas de longues expositions au soleil. Design exclusif SEAT',NULL,NULL,NULL,'fr_FR'),(2015,2015,'Décoration de portière apparence carbone 5D','decoration-de-portiere-apparence-carbone-5-d-6j4071062','Garnitures décoratives pour les poignées intérieures des portières. Finitions carbone.',NULL,NULL,NULL,'fr_FR'),(2016,2016,'Plateau protection coffre','plateau-protection-coffre-6j8061201','Pièce protection en mousse souple à installer dans le coffre. Instructions de montage fournies.',NULL,NULL,NULL,'fr_FR'),(2017,2017,'Barres de toit d\'origine','barres-de-toit-dorigine-6j8071100','Barres de toit d\'origine SEAT pour véhicules avec rambardes de toit. Les barres se fixent sur les rambardes du véhicule et disposent d\'un système antivol. Les nouvelles barres portantes d\'origine SEAT permettent de transporter tout ce que vous souhaitez sur le toit de votre IBIZA ST, une malle porte-bagages, un porte-skis ou un porte-vélos. Les barres possèdent un profil en aluminium aérodynamique pour réduire le bruit. La base possède une fixation sûre et stable avec un design élégant. -Charge maximale : 75 kg -Profil en aluminium anodisé avec une forme aérodynamique -Couleur argent anodisé -Caches de protection -Instructions de pose En combinaison avec: Malle porte-bagages 450 l réf. 000071180A Malle porte-bagages 420 l réf. 000071200AB Malle porte-bagages 400 l réf. 000071200T',NULL,NULL,NULL,'fr_FR'),(2018,2018,'Moulure hayon chromée','moulure-hayon-chromee-6j8071350','Fabrication en ABS, avec finition chromé haute brillance. Pour donner un style unique à votre voiture. Montage facile sur hayon de coffre.',NULL,NULL,NULL,'fr_FR'),(2019,2019,'Accoudoir central','accoudoir-central-6ja061100','Accoudoir central avec garnitures de couleur noire. Équipé d\'un compartiment utile et pratique pour emmener de petits objets. Il est fourni avec tous les éléments nécessaires pour son montage',NULL,NULL,NULL,'fr_FR'),(2020,2020,'Filets de coffre','filets-de-coffre-6ja061170c','Jeu de trois filets pour l\'organisation du coffre. Le filet est de couleur noire flexible pour assurer correctement le bagage. Facile à installer avec quatre points de fixation. Composants : 5JA867689, 5JA867689A, 5JA867689B Instructions de pose disponibles dans ELSA Pro.',NULL,NULL,NULL,'fr_FR'),(2021,2021,'Housse voiture rouge','housse-voiture-rouge-6ja061701','Housse tissu élastique en polyester avec fil protecteur contre les torsions et les froissements. Couleur rouge avec impression du logo SEAT sur la face avant. Elle s\'adapte parfaitement à la forme de la voiture.',NULL,NULL,NULL,'fr_FR'),(2022,2022,'Barres de toit','barres-de-toit-6ja071151','Ensemble de barres de transport avant et arrière. Également valable pour les versions avec toit panoramique. Les barres se fixent sur le toit du véhicule et disposent d\'un système antivol. En combinaison avec : Le porte-vélos réf. 6L0071128A Le porte-skis 4/6 paires réf. 3B0071129F / G Le porte-surf réf. 000071120HA Malle porte-bagages 450 l réf. 000071180A',NULL,NULL,NULL,'fr_FR'),(2023,2023,'Film protecteur pour pare-chocs arrière','film-protecteur-pour-pare-chocs-arriere-6ja071363','Feuille adhésive transparente adaptée à la forme du pare-chocs arrière pour 