,2033,'Plateau de coffre – 7 places','plateau-de-coffre-7-places-7n5061170a','Pratique et résistant. Le plateau de coffre protège des salissures et des liquides pouvant s´échapper grâce à son bord relevé. Résistant aux acides, lavable, antidérapant.',NULL,NULL,NULL,'fr_FR'),(2034,2034,'Film protecteur pare-chocs arrière','film-protecteur-pare-chocs-arriere-7n5061197','Adhésif transparent adapté à la forme du pare-chocs pour le protéger des rayures. Installation facile et rapide.',NULL,NULL,NULL,'fr_FR'),(2035,2035,'Feuille de protection noire de seuil de porte avec le logo Alhambra','feuille-de-protection-noire-de-seuil-de-porte-avec-le-logo-alhambra-7n5061197b','Le film noir avec le logo Alhambra améliore non seulement l\'aspect des seuils de port, mais il les protège aussi contre les rayures. Découpé avec précision, le protecteur est fixé à l\'emplacement exact. Chaque jeu est composé de quatre pièces de film pour les portes avant et arrière. 1 jeu = 4 unités',NULL,NULL,NULL,'fr_FR'),(2036,2036,'Plaques protectrices métallisées  – transparentes','plaques-protectrices-metallisees-transparentes-7n5061197c','Le film transparent protège les seuils de porte contre les rayures. Usinées avec précision, ces protections s´adaptent parfaitement pour une installation parfaite. Chaque jeu comprend quatre pièces, pour les portes avant et arrière. 1 jeu = 4 unités',NULL,NULL,NULL,'fr_FR'),(2037,2037,'Tapis en caoutchouc','tapis-en-caoutchouc-7n5061500--041','Jeu de 4 tapis caoutchouc ALHAMBRA (1ère, 2ème rangée)',NULL,NULL,NULL,'fr_FR'),(2038,2038,'Kit de tapis en caoutchouc 1re et 2e rangée de sièges','kit-de-tapis-en-caoutchouc-1-re-et-2-e-rangee-de-sieges-7n5061500041','Fabriqués en caoutchouc avec bords de 10 mm. Kit de 4 tapis, 2 avant (1re rangée) + 2 arrière (2e rangée) Système de fixation d\'origine SEAT, qui évite le déplacement pendant la conduite Assortis au modèle de la voiture',NULL,NULL,NULL,'fr_FR'),(2039,2039,'Tapis en caoutchouc','tapis-en-caoutchouc-7n5061500a-041','Jeu de 5 tapis caoutchouc ALHAMBRA (1ère, 2ème et 3ème rangée)',NULL,NULL,NULL,'fr_FR'),(2040,2040,'Kit de tapis en caoutchouc 1re, 2e et 3e rangée de sièges','kit-de-tapis-en-caoutchouc-1-re-2-e-et-3-e-rangee-de-sieges-7n5061500a041','Fabriqués en caoutchouc avec bords de 10 mm. Kit de 5 tapis, 2 avant (1re rangée) + 2 arrière (2e rangée)+ 1 arrière (3e rangée) Système de fixation d\'origine SEAT, qui évite le déplacement pendant la conduite Assortis au modèle de la voiture',NULL,NULL,NULL,'fr_FR'),(2041,2041,'Jeu de 5 tapis (LHD)','jeu-de-5-tapis-lhd-7n5061675041','Jeu de 2 tapis avant et 2 arrière (2e rangée) + 1 arrière (3e rangée) Qualité identique aux tapis de série.',NULL,NULL,NULL,'fr_FR'),(2042,2042,'Pédales sportives (LHD)','pedales-sportives-lhd-7n5064200','Une vraie manière de mettre en valeur l\'intérieur ; ces pédales sportives attractives donneront une bonne impression lors de chaque conduite de l\'Alhambra. Faciles à poser/déposer En caoutchouc antidérapant Frein, embrayage et accélérateur',NULL,NULL,NULL,'fr_FR'),(2043,2043,'Rideaux solaires arrière et latéraux fixes','rideaux-solaires-arriere-et-lateraux-fixes-7n5064365a','Rideaux de protection solaire adaptables à la glace arrière et aux glaces latérales fixes. Protègent du soleil, tout en conservant la visibilité et sans compromettre la sécurité routière, et améliorent les conditions climatiques du véhicule.  Faciles à installer grâce à un système de clips de fixation. Ensemble composé de 3 rideaux.',NULL,NULL,NULL,'fr_FR'),(2044,2044,'Porte-vélos hayon.','porte-velos-hayon-7n5071104','Ne voyagez plus sans vos vélos. Ce porte-vélos sur hayon supporte jusqu´à 3 vélos, sans empiéter sur l´espace intérieur du véhicule. Installation facile et rapide. Dispositif antivol. Les vélos ne masquent pas les phares arrière et la plaque d´immatriculation. Capacité maximum : 60 kg.  Non compatible avec portail électrique.',NULL,NULL,NULL,'fr_FR'),(2045,2045,'Barres de toit.','barres-de-toit-7n5071151','Transportez tout ce que vous voulez (coffre, vélos, skis, snowboards) sur le toit de votre voiture à l´aide de ces barres de toit.  Système protégé par dispositif antivol. La conception aérodynamique des barres permet de réduire les nuisances sonores. Fabrication en aluminium léger.',NULL,NULL,NULL,'fr_FR'),(2046,2046,'Seuils de porte chromés','seuils-de-porte-chromes-7n5071300','Personnalisation SEAT Alhambra. Fabrication en acier inoxydable, avec logo gravé au laser. Ces pièces protègent le seuil de porte et renforcent le caractère sportif du véhicule. Finition brillante.',NULL,NULL,NULL,'fr_FR'),(2047,2047,'Plaques de protection métallisées – couleur noire et rayures blanches','plaques-de-protection-metallisees-couleur-noire-et-rayures-blanches-7n5071310','Le film transparent protège les seuils de porte contre les rayures. Usinées avec précision, ces protections s´adaptent parfaitement pour une installation parfaite. Chaque jeu comprend quatre pièces, pour les portes avant et arrière. 1 jeu = 4 unités',NULL,NULL,NULL,'fr_FR'),(2048,2048,'REVÊTEMENT MIROIR RÉTROVISEUR CHROMÉ','revetement-miroir-retroviseur-chrome-7n5072530','Les décorations pour rétroviseurs extérieurs Original SEAT en acier inoxydable, de grande qualité, confèrent à votre véhicule un aspect élégant. Ces caches, aux mesures précises, sont fournies en jeux de 2 unités (côtés gauche et droit). Ensemble fourni : Caches pour rétroviseurs droit et gauche, en acier inoxydable poli haute brillance',NULL,NULL,NULL,'fr_FR'),(2049,2049,'Jupes garde-boue avant','jupes-garde-boue-avant-7n5075101','Pièce moulée par injection (EVA Injection Moulding) en plastique noir. Vis de fixation fournies. Protègent la carrosserie des pierres projetées par les roues.',NULL,NULL,NULL,'fr_FR'),(2050,2050,'Bavettes garde-boue arrière','bavettes-garde-boue-arriere-7n5075101a','En plastique noir d\'EVA Injection Moulding. Vis de fixation comprises. Elles protègent la carrosserie des pierres projetées par les roues. Vis de fixation comprises.',NULL,NULL,NULL,'fr_FR'),(2051,2051,'Attache de remorque fixe','attache-de-remorque-fixe-7n5092101','Attache de remorque fixe. Pour les véhicules fabriqués jusqu\'à mai 2012, il est nécessaire de demander également les éléments suivants : Revêtement 7N0807819 ; Vis (2x) WHT003954 ; Écrous (2x) N90833801. Pour les véhicules fabriqués après mai 2012 la poser conjointement avec les éléments suivants : Spoiler pare-chocs 7N0807521A 9B9; Revêtement 7N0807819 ; Vis (2x) WHT003954 ; Écrous (2x) N90833801.',NULL,NULL,NULL,'fr_FR'),(2052,2052,'Attelage de remorque','attelage-de-remorque-7n5092101a','Attache de remorque démontable.',NULL,NULL,NULL,'fr_FR'),(2053,2053,'Jeu de tapis, 3e rangée de sièges','jeu-de-tapis-3-e-rangee-de-sieges-7n5863011aloe','Qualité identique aux tapis de série.',NULL,NULL,NULL,'fr_FR'),(2054,2054,'Jeu de tapis (LHD)','jeu-de-tapis-lhd-7n5863011loe','Jeu de 2 tapis avant et 2 arrière (2e rangée) Système de fixation des pièces avant. Qualité identique aux tapis de série.',NULL,NULL,NULL,'fr_FR'),(2055,2055,'Aspirateur portatif 12 V','aspirateur-portatif-12-v-91401','- Design moderne et léger sans vis apparentes. - Voyant LED : niveau d’aspiration et charge. - Poids léger : 550 grammes. - Lanterne LED pour aspirer dans l’obscurité. - Petit et facile à ranger dans la voiture. - Aspiration puissante : 4 500 pascals. - Bruit modéré, inférieur à 75 décibels. - Chargeur 12 V.',NULL,NULL,NULL,'fr_FR'),(2056,2056,'Désodorisant électrique','desodorisant-electrique-91500','Profitez des propriétés de l’aromathérapie tout en conduisant. Grâce à ce désodorisant électrique, vous pourrez choisir entre plusieurs parfums aux essences naturelles qui favorisent le bien-être physique et émotionnel pour vous accompagner durant vos trajets. Durée approximative : 45 jours. L’emballage contient deux recharges du même arôme. 000091500FR Désodorisant rechargeable arôme fruits rouges, parfum fruité. 000091500HS Désodorisant rechargeable arôme herbal doux, parfum naturel. 000091500FM Désodorisant rechargeable arôme fruit mixte, parfum chaud. 000091500MC Désodorisant rechargeable arôme menthe claire, parfum revitalisant et rafraîchissant.',NULL,NULL,NULL,'fr_FR'),(2057,2057,'Masque SEAT M','masque-seat-m-6h1093100b','Masque SEAT en taille M',NULL,NULL,NULL,'fr_FR'),(2058,2058,'Masque SEAT L','masque-seat-l-6h1093100c','Masque SEAT en taille L',NULL,NULL,NULL,'fr_FR'),(2059,2059,'Gants HEBO City Winter','gants-hebo-city-winter-1l0084342a','Gants automne-hiver Homologués.',NULL,NULL,NULL,'fr_FR'),(2060,2060,'Gants HEBO City Winter','gants-hebo-city-winter-1l0084342b','Gants automne-hiver Homologués.',NULL,NULL,NULL,'fr_FR'),(2061,2061,'Gants HEBO City Winter','gants-hebo-city-winter-1l0084342c','Gants automne-hiver Homologués.',NULL,NULL,NULL,'fr_FR'),(2062,2062,'Gants HEBO City Winter','gants-hebo-city-winter-1l0084342d','Gants automne-hiver Homologués.',NULL,NULL,NULL,'fr_FR'),(2063,2063,'Gants HEBO City Summer','gants-hebo-city-summer-1l0084342e','Gant printemps-été. Homologués.',NULL,NULL,NULL,'fr_FR'),(2064,2064,'Gants HEBO City Summer','gants-hebo-city-summer-1l0084342f','Gant printemps-été. Homologués.',NULL,NULL,NULL,'fr_FR'),(2065,2065,'Gants HEBO City Summer','gants-hebo-city-summer-1l0084342g','Gant printemps-été. Homologués.',NULL,NULL,NULL,'fr_FR'),(2066,2066,'Gants HEBO City Summer','gants-hebo-city-summer-1l0084342h','Gant printemps-été. Homologués.',NULL,NULL,NULL,'fr_FR'),(2067,2067,'Câble 3 en 1 MFI pour charge et données','cable-3-en-1-mfi-pour-charge-et-donnees-000051444am','Profitez de vos voyages pour recharger vos dispositifs ou transférer vos données simultanément avec ce câble au design 3 en 1 MFI, doté de trois types de câbles USB différents : USB-C, micro-USB et câbles Lightning (Apple).  Votre SEAT est compatible avec votre monde : iPhone XS / XS Max / XR / X / 8/8 Plus / 7/7 Plus / 6/6 Plus, iPad Pro 12.9, 10.5, iPad de 4e génération, iPad mini, mini 2, mini 4.',NULL,NULL,NULL,'fr_FR'),(2068,2068,'Adaptateur USB-USB Type C','adaptateur-usb-usb-type-c-000051444ap','On sait à quel point la technologie change vite, c’est la raison pour laquelle votre SEAT est fournie avec une entrée USB 3.1C, même si votre chargeur mobile possède une sortie USB 2.0B, votre vie n’a pas à changer : avec cet adaptateur, vous pourrez continuer à charger votre mobile sur votre SEAT.',NULL,NULL,NULL,'fr_FR'),(2069,2069,'Câble 3 en 1 de charge et données USB-C','cable-3-en-1-de-charge-et-donnees-usb-c-000051444aq','Câble de charge et données 3 en 1, compatible avec : iPhone XS / XS Max / XR / X / 8/8 Plus / 7/7 Plus / 6/6 Plus, iPad Pro 12.9, 10.5, iPad de 4e génération, iPad mini, mini 2, mini 4.  Trois types différents de câbles USB : USB-C, micro-USB et câble d’éclairage (Apple) Design 3 en 1 qui charge et transfère les données simultanément.',NULL,NULL,NULL,'fr_FR'),(2070,2070,'Adaptateur multimédia MEDIA IN pour iPod','adaptateur-multimedia-media-in-pour-i-pod-7n5051446','Adaptateur pour connecter un iPod à l´entrée MEDIA IN. Écoutez de la musique via la radio ou le système de radionavigation et les haut-parleurs de la voiture. Dispositif de visualisation des titres et contrôle via la radio ou le système de radionavigation. Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(2071,2071,'Adaptateur multimédia MEDIA IN pour mini USB','adaptateur-multimedia-media-in-pour-mini-usb-7n5051510','Adaptateur pour connecter des sources audio via le port mini USB à l´entrée MEDIA IN. Écoutez de la musique via la radio ou le système de radionavigation et les haut-parleurs de la voiture. Dispositif de visualisation des titres et contrôle via la radio ou le système de radionavigation. Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(2072,2072,'Adaptateur multimédia MEDIA IN pour AUX IN','adaptateur-multimedia-media-in-pour-aux-in-7n5051510a','Adaptateur pour connecter sources audio avec casques (3,5 mm) connectées à l´entrée MEDIA IN. Écoutez de la musique via la radio et le système de radionavigation et les haut-parleurs de la voiture. Dispositif de visualisation des titres et contrôle via la radio ou le système de radionavigation. Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(2073,2073,'Adaptateur multimédia MEDIA IN pour USB','adaptateur-multimedia-media-in-pour-usb-7n5051510b','Adaptateur pour connecter des sources audio via le port USB à l´entrée MEDIA IN. Écoutez de la musique via la radio ou le système de radionavigation et les haut-parleurs de la voiture. Dispositif de visualisation des titres et contrôle via la radio ou le système de radionavigation. Cet accessoire est applicable à la Leon Cupra',NULL,NULL,NULL,'fr_FR'),(2074,2074,'Aspirateur portatif 12 V','aspirateur-portatif-12-v-000091401','- Design moderne et léger sans vis apparentes. - Voyant LED : niveau d’aspiration et charge. - Poids léger : 550 grammes. - Lanterne LED pour aspirer dans l’obscurité. - Petit et facile à ranger dans la voiture. - Aspiration puissante : 4 500 pascals. - Bruit modéré, inférieur à 75 décibels. - Chargeur 12 V.',NULL,NULL,NULL,'fr_FR'),(2075,2075,'Désodorisant électrique','desodorisant-electrique-000091500','Profitez des propriétés de l’aromathérapie tout en conduisant. Grâce à ce désodorisant électrique, vous pourrez choisir entre plusieurs parfums aux essences naturelles qui favorisent le bien-être physique et émotionnel pour vous accompagner durant vos trajets. Durée approximative : 45 jours. L’emballage contient deux recharges du même arôme. 000091500FR Désodorisant rechargeable arôme fruits rouges, parfum fruité. 000091500HS Désodorisant rechargeable arôme herbal doux, parfum naturel. 000091500FM Désodorisant rechargeable arôme fruit mixte, parfum chaud. 000091500MC Désodorisant rechargeable arôme menthe claire, parfum revitalisant et rafraîchissant.',NULL,NULL,NULL,'fr_FR'),(2076,2076,'Casque intégral HEBO','casque-integral-hebo-1l0050320a','Casque intégral double écran, personnalisé par SEAT',NULL,NULL,NULL,'fr_FR'),(2077,2077,'Casque intégral HEBO','casque-integral-hebo-1l0050320b','Casque intégral double écran, personnalisé par SEAT',NULL,NULL,NULL,'fr_FR'),(2078,2078,'Casque intégral HEBO','casque-integral-hebo-1l0050320c','Casque intégral double écran, personnalisé par SEAT',NULL,NULL,NULL,'fr_FR'),(2079,2079,'Casque intégral HEBO','casque-integral-hebo-1l0050320d','Casque intégral double écran, personnalisé par SEAT',NULL,NULL,NULL,'fr_FR'),(2080,2080,'Casque Jet HEBO','casque-jet-hebo-1l0050320e','Casque Jet à double écran, personnalisé par SEAT',NULL,NULL,NULL,'fr_FR'),(2081,2081,'Casque Jet HEBO','casque-jet-hebo-1l0050320f','Casque Jet à double écran, personnalisé par SEAT',NULL,NULL,NULL,'fr_FR'),(2082,2082,'Casque Jet HEBO','casque-jet-hebo-1l0050320g','Casque Jet à double écran, personnalisé par SEAT',NULL,NULL,NULL,'fr_FR'),(2083,2083,'Casque Jet HEBO','casque-jet-hebo-1l0050320h','Casque Jet à double écran, personnalisé par SEAT',NULL,NULL,NULL,'fr_FR');
